INSERT INTO `landing_pages` (`id`, `hero_title`, `hero_description`, `created_at`, `updated_at`) VALUES
(1, 'Platform Sistem Computer Assisted Test (CAT)', 'Membantu casis POLRI, TNI, CPNS dan Kedinasan dalam berlatih agar lebih siap menghadapi tes yang sebenarnya', NULL, '2025-07-21 07:32:27');
INSERT INTO `landing_page_features` (`id`, `title`, `description`, `created_at`, `updated_at`) VALUES
(1, 'Permintaan Lengkap', 'Terdiri dari tes TNI, POLRI, Kedinasan, dan CPNS yang didalamnya terdapat banyak kategori yang akan diujikan. ', NULL, NULL),
(2, 'Sistem Penilaian', 'Sistem penilaian untuk kategori peminatan sesuai dengan sistem yang sebenarnya, sehingga siswa dapat mengetahui ambang batas nilai di kategori tersebut.', '2025-07-17 06:51:41', '2025-07-17 06:51:41'),
(3, 'Peringkat Nilai', 'Siswa dapat melihat ranking dari masing-masing Try Out yang telah diikuti sehingga siswa tahu dimana posisi dia dibanding dengan siswa lainnya.', '2025-07-17 06:52:58', '2025-07-17 06:52:58'),
(4, 'Pembahasan Materi', 'Pembahasan materi disajikan dalam bentuk dokumentasi tertulis atau video, baik itu pembahasan untuk masing-masing soal, atau materi yang disampaikan sesuai dengan judul bahasan.', '2025-07-17 06:53:51', '2025-07-17 06:53:51'),
(5, 'Webinar', 'Siswa dapat mengikuti webinar via Zoom Meeting yang bertujuan untuk mengevaluasi kegiatan pembelajaran.', '2025-07-17 06:55:19', '2025-07-17 06:55:19'),
(6, 'Affiliate Program', 'Selain bermanfaat bagi diri sendiri, siswa dapat mengajakan teman-teman lainnya kedalam sistem, dan siswa tersebut akan mendapatkan komisi ketika siswa baru mengikuti link nya dan melakukan transaksi.', '2025-07-17 07:44:33', '2025-07-18 06:33:22');
INSERT INTO `landing_page_highlights` (`id`, `title1`, `description1`, `title2`, `description2`, `title3`, `description3`, `created_at`, `updated_at`) VALUES
(1, 'Dibuat khusus seperti aslinya', 'Sistem dibuat mirip dengan tes aslinya agar anda tidak perlu banyak beradaptasi, sehingga anda tetap fokus dan menghindari dari masalah teknis yang tidak diinginkan.', 'Modern responsive design', 'Menampilkan komponen mobile-first yang dibuat dengan sangat elegan, aplikasi akan berfungsi dengan baik di perangkat apa pun seperti laptop, tablet ataupun smartphone!', 'Dokumentasi Lengkap', 'Semua tata letak, bagian halaman, komponen, dan utilitas sepenuhnya tercakup dalam dokumen lengkap agar memudahkan user ketika menggunakan aplikasi CAT', '2025-07-18 02:27:04', '2025-07-18 03:16:48');
