INSERT INTO `questions` (`id`, `created_at`, `updated_at`, `deleted_at`, `question_title_id`, `value_category_id`, `audio_input`, `audio`, `audio_played_limit`, `audio_answer_time`, `question`, `option_1`, `option_2`, `option_3`, `option_4`, `option_5`, `point_1`, `point_2`, `point_3`, `point_4`, `point_5`, `wrong_point`, `correct_point`, `answer`, `discussion`, `section`) VALUES
('007abcc9-23b1-4e35-931d-e2e4a2065e9d', '2023-10-14 04:19:39', '2023-10-14 04:19:39', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Anda adalah seorang pegawai di Sekolah Menengah Atas. Suatu saat, ketika semua pegawai sedang istirahat di jam makan siang dan anda sendiri berada di kantor, ada salah seorang wali siswa datang untuk konsultasi saat itu juga karena terburu-buru ada acara lain. Maka sikap anda ...</p>', '<p>Membiarkan saja dan menunggu pegawai lain untuk melayani</p>', '<p>Melayani dengan sopan meskipun anda tahu teman anda lebih baik pelayanannya daripada anda</p>', '<p>Menjelaskan peraturan baha tamu tidak bisa dilayani saat jam istiahat</p>', '<p>Menolak dengan tegas dan menyuruh tamu untuk menunggu</p>', '<p>Marah dan menyuruh tamu pergi dari sekolah karena sekolah sedang sepi</p>', 3, 5, 4, 2, 1, 0, 1, 2, NULL, 1),
('00a5c635-c6fa-41e2-8652-2c8b4f25ce2a', '2023-10-14 07:46:34', '2023-10-14 07:46:34', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Anda bekerja di sebuah hotel yang sudah cukup tua tapi memiliki desain dan fasilitas yang sangat baik, tetapi baru-baru ini ada berita viral mengenai hotel anda yang digambarkan bahwa hotel tersebut angker dikarenakan unggahan orang yang kurang bertanggung jawab. Hal tersebut berdampak pada jumlah pelanggan yang menurun dan menyebabkan masalah keuangan pada hotel anda, apa yang akan anda usulkan kepada pimpinan untuk promosi hotel?</p>', '<p>Mengusulkan untuk membuat program promosi dengan banyak potongan harga dan kemudahan fasilitas seperti pemesanan secara daring</p>', '<p>Mengusulkan untuk membuat program hadiah pada pelanggan</p>', '<p>Mengusulkan untuk memanfaatkan medsos dengan menggaet influencer untuk staycation di hotel dan menunjukan keindahan hotel</p>', '<p>Mengusulkan untuk mengganti interior hotel agar lebih menarik pelanggan</p>', '<p>Mengusulkan untuk memberikan layanan tambahan dan voucher tiket gratis pada pengunjung pertama di setiap bulan</p>', 4, 3, 5, 1, 2, 0, 1, 3, NULL, 1),
('00c61830-348c-49b4-9218-c9b6405d9147', '2023-10-18 05:29:27', '2023-10-18 05:29:27', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Saya sedang ujian SKD, waktu tersedia hanya 5 menit lagi namun ada 20 soal yang belum saya kerjakan. Saya...</p>', '<p>tidak memperdulikannya dan berusaha sebaik mungkin</p>', '<p>diam untuk menutupi kecemasan anda</p>', '<p>mengerjakan dengan teliti dan berusaha sebaik mungkin</p>', '<p>khawatir tidak terselesaikan</p>', '<p>memikirkannya hingga menjadi tidak fokus</p>', 4, 3, 5, 2, 1, 0, 1, 3, NULL, 1),
('00dc3836-bd80-4b55-8f9d-6bd64c7a22b4', '2023-10-18 03:22:40', '2023-10-18 03:22:40', NULL, '557e3be9-1ea4-45e4-8163-29eb4435e058', NULL, 0, NULL, NULL, NULL, '<p>Dari lima gambar berikut manakah yang berbeda&hellip;</p>\n<p><img src=\"/storage/upload_files/questions/20231018101804soal 35.jpg\" alt=\"\" width=\"524\" height=\"118\" /></p>', '<p>Gambar A</p>', '<p>Gambar B</p>', '<p>Gambar C</p>', '<p>Gambar D</p>', '<p>Gambar E</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('0149e9ee-8ad0-4910-b69e-3b3a2247813e', '2023-10-17 08:35:52', '2023-10-17 08:35:52', NULL, 'b6b3d933-7f1c-4ac1-abf2-14928a6ab49f', NULL, 0, NULL, NULL, NULL, '<p>Masyarakat perlu mengupayakan persatuan, salah satu bentuk upaya persatuan di lingkungan masyarakat adalah......</p>', '<p>Menghindari forum temu warga</p>', '<p>Meningkatkan sikap inklusif individu</p>', '<p>Mengurangi kegiatan sosialisasi antar warga</p>', '<p>Membatasi pergerakan ormas</p>', '<p>Membubarkan acara temu warga</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('026c73f5-7436-4943-b91c-338d7c2cd7df', '2023-10-23 08:47:29', '2023-10-23 08:47:29', NULL, '00cc482f-6b53-42a2-9045-e1b555bb5d19', NULL, 0, NULL, NULL, NULL, '<p>81 64 72 56 .... &hellip;. 54 40 45 32 36</p>', '<p>66 38</p>', '<p>61 42</p>', '<p>32 39</p>', '<p>63 48</p>', '<p>30 32</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 3),
('0340042a-fe81-473c-a389-cef3b0fc514a', '2023-10-20 07:50:52', '2023-10-20 07:50:52', NULL, '00cc482f-6b53-42a2-9045-e1b555bb5d19', NULL, 0, NULL, NULL, NULL, '<p>Sekelompok pecinta kucing terdiri dari 15 orang rata-rata memiliki 9 ekor kucing yang dipelihara. 3 orang yang memiliki rata-rata 3 ekor kucing bergabung dengan kelompok tersebut. Rata-rata banyaknya kucing dari kelompok tersebut adalah.....</p>', '<p>4</p>', '<p>6</p>', '<p>8</p>', '<p>10</p>', '<p>12</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('03af31f5-a552-45d3-aba3-12e8770c85ec', '2023-10-18 07:35:08', '2023-10-18 07:35:08', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Saya dituduh dan dimarahi oleh ketua kelompok saya, sedangkan tuduhan itu tidak sesual dengan keadaan yang sebenarnya. Saya akan.....</p>', '<p>Menanggapi pertanyaan siapapun dari isu Itu</p>', '<p>Mencari penyebar isu tersebut dan memarahinya</p>', '<p>Membiarkan isu itu berkembang dan, toh nanti berhenti sendiri</p>', '<p>Menerangkan bagaimana keadaan yang sesungguhnya</p>', '<p>Menceritakan pada teman dekat</p>', 3, 1, 2, 5, 4, 0, 1, 4, NULL, 1),
('03d19282-4348-4dae-9424-228475b35c7f', '2023-10-16 07:38:20', '2023-10-16 07:38:20', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p>Pembangunan sebuah gedung direncanakan selesai dalam waktu 22 hari bila dikerjakan oleh 20 orang. Setelah dikerjakan 10 hari, pekerjaan dihentikan selama 6 hari. Supaya pembangunan itu selesai tepat pada waktunya, maka diperlukan tambahan pekerja sebanyak....</p>', '<p>40 orang</p>', '<p>30 orang</p>', '<p>25 orang</p>', '<p>20 orang</p>', '<p>15 orang</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('043b7ccd-3f2c-464c-9036-1d2951b27c34', '2023-10-18 04:38:32', '2023-10-18 04:38:32', NULL, '557e3be9-1ea4-45e4-8163-29eb4435e058', NULL, 0, NULL, NULL, NULL, '<p>7,8 + 6 x &frac12; - 3 =</p>', '<p>7,7</p>', '<p>7,8</p>', '<p>7,9</p>', '<p>8,1</p>', '<p>8,2</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('0506e91c-3292-48e5-b591-d3ac3490fb77', '2023-10-14 08:15:10', '2023-10-14 08:15:10', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Di wilayah Anda mengajar ada komunita GTT (Guru Tidak Tetap) yang terwadahi dalam PGRI. Melakukan penggalangan dana sukarela untuk berjuang ke Jakarta mengusulkan ke pemerintah agar diangkat sebagai PNS. Jika Anda adalah guru PNS yang telah menerima tunjangan profesi, apa yang akan Anda lakukan?</p>', '<p>Mendukung sepenuhnya penggalangan dana itu dengan mengajak teman guru PNS lainnya untuk berpartisipasi dalam penggalangan dana.</p>', '<p>Memberi nasehat kepada teman guru GTT untuk tidak terlalu berambisi diangkat sebagai PNS karena pengangkatan PNS ada aturannya.</p>', '<p>Menaruh simpati terhadap upaya penggalangan dana itu meskipun tidak harus memberikan kontribusi dalam bentuk uang.</p>', '<p>Berpartisipasi aktif dalam penggalangan dana itu agar memperoleh dana yang cukup dan mampu membayar perwakilan GTT ke Jakarta</p>', '<p>Mengusulkan kepada pengurus PGRI daerah agar membayar perwakilan GTT untuk pergi ke Jakarta menyampaikan aspirasinya</p>', 3, 2, 5, 4, 1, 0, 1, 3, NULL, 1),
('05106425-9e42-483a-84ee-3364ba7248c7', '2023-10-16 07:41:52', '2023-10-16 07:41:52', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p>Sebuah bangunan 2 lantai dapat diselesaikan oleh 8 orang dalam 4 hari. Berapa orang yang dibutuhkan untuk menyelesaikan bangunan 5 lantaldalam 3 hari?</p>', '<p>21 orang</p>', '<p>24 orang</p>', '<p>25 orang</p>', '<p>27 orang</p>', '<p>30 orang</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('0564b321-860c-42d2-9290-709898d8cecb', '2023-10-26 09:09:30', '2023-10-26 09:09:30', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Tahun 2021 rencananya perusahaan anda akan mengadakan pelatihan gratis bahasa inggris yang dijadwalkan dilakukan setelah jam kerja selesai, sehingga membuat pulang kerja menjadi lebih sore, bagaimana sikap anda?</p>', '<p>Sangat berminat untuk mengikutinya, tapi meminta pada atasan untuk diadakan pada jam kantor saja</p>', '<p>Sangat berminat untuk mengikutinya dan mulai mengkomunikasikan pada keluarga karena akan pulang terlambat</p>', '<p>Sangat berminat untuk mengikutinya dan berharap pelatihan bisa di lakukan pada hari minggu saja</p>', '<p>Melihat respon dari teman-teman yang lain, jika banyak yg berminat makan baru memutuskan untuk ikut</p>', '<p>Tidak berminat untuk mengikutinya karena merasa sudah sangat sibuk</p>', 4, 5, 3, 1, 2, 0, 1, 2, NULL, 1),
('06ceddd2-4a0f-405f-8d7d-d36798cc85a9', '2023-10-17 09:08:43', '2023-10-17 09:08:43', NULL, 'b6b3d933-7f1c-4ac1-abf2-14928a6ab49f', NULL, 0, NULL, NULL, NULL, '<p>Penulisan huruf kapital yang benar adalah ...</p>', '<p>Mereka masuk dari pintu Timur</p>', '<p>Pisang Ambon mengandung banyak nutrisi</p>', '<p>Devisi itu dipimpin oleh seorang Mayor Jendral</p>', '<p>Pada tahun ini mereka pergi naik Haji</p>', '<p>Sidang akan dipimpin oleh Presiden Republik Indonesia</p>', 0, 0, 0, 0, 0, 0, 1, 5, NULL, 1),
('07648547-66fd-403f-9e20-c15ef9421415', '2023-10-19 06:47:21', '2023-10-19 06:47:21', NULL, '80cec561-fc0b-46c7-aed4-f0ad73061557', NULL, 0, NULL, NULL, NULL, '<p>Semangat nasionalisme yang terkandung dalam pasal 32 ayat (1) dan (2) undang-undang dasar 1949 menitikberatkan nasionalisme dibidang...</p>', '<p>Budaya</p>', '<p>Sosial</p>', '<p>Ekonomi</p>', '<p>Politik</p>', '<p>HAM</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('07e9da2f-b369-40b7-ba54-f2213083b628', '2023-10-18 05:27:41', '2023-10-18 05:27:41', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Saya terlambat datang ke kantor dan dimarahi pimpinan. Maka saya&hellip;</p>', '<p>beralasan bahwa pagi ini jalanan padat</p>', '<p>meminta maaf dan bekerja seperti biasa</p>', '<p>kesal dengan pimpinan karena saya ditegur</p>', '<p>berjanji pada pimpinan jika besok anda tidak akan terlambat kembali</p>', '<p>saya menjadi malas bekerja dan bekerja semau anda</p>', 3, 4, 1, 5, 2, 0, 1, 4, NULL, 1),
('0831459f-74de-4e7a-b71a-e6cae95c548a', '2023-10-14 05:03:53', '2023-10-14 05:03:53', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<ol>\n<li>aya ditugaskan untuk memimpin tim dengan waktu kerja yang sangat terbatas. Saat Saya mensosialisasikan mengenai hal ini ke anggota tim kerja yang terbentuk, mereka menunjukkan sikap tidak peduli dengan tugas yang diberikan. Sikap saya adalah....</li>\n</ol>', '<p>Bekerja sendiri asalkan tugas selesai</p>', '<p>Memberi ancaman yang efektif seperti akan dikeluarkan dari tim, bagi anggota tim yang tidak serius kerjanya</p>', '<p>Mudah sekali, tinggal melaporkan ke atasan Saya agar orang tersebut diberi sanksi yang pantas</p>', '<p>Membagi tugas secara adil sesuai porsinya, mengarahkan, mendampingi dan memotivasi selalu anggota tim untuk menyelesaikannya, serta jika ada kekeliruan akan memberi teguran</p>', '<p>Menasihatinya agar anggota tim segera sadar akan penyelesaian tugas yang diberikan</p>', 1, 2, 3, 5, 4, 0, 1, 4, NULL, 1),
('084f237d-0a2d-4ae4-bd47-eca52a8c5066', '2023-10-18 08:54:18', '2023-10-18 08:54:18', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Hari itu anda menyuruh bawahan anda untuk datang ke kantor, namun bawahan anda terlambat ke kantor karena telat bangun tidur, karena semalaman anda mengikuti ritual kanjeng nabi dalam memperingati hari agung, bagaimana sikap anda sebagai atasan....</p>', '<p>Memperbolehkan bawahan anda untuk datang terlambat</p>', '<p>Professional harus ditegakkan</p>', '<p>Membuat bawahan anda untuk tidak mengikuti ritual itu lagi</p>', '<p>Mentoleransi ketidaktepatan waktu datang karena hari itu bukan hari kerja</p>', '<p>Merasa kesal dan memberi siksaan pada bawahan anda karena lebih mementingkan hal lain dibanding bekerja</p>', 4, 3, 2, 5, 1, 0, 1, 4, NULL, 1),
('08f1fc80-4866-4e55-89cb-fe3be7765150', '2023-10-14 04:28:14', '2023-10-14 04:28:14', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Salah seorang rekan saya selalu menemukan cara-cara yang ringkas dalam menyelesaikan tugas yang diberikan kepada kami. Sikap saya...</p>', '<p>Bertanya kepada rekan tersebut mengenal pendekatan yang digunakannya dalam menganalisis masalah</p>', '<p>Memperhatikan bagaimana cara kerjanya dan mengambil sisi-sisi yang bisa saya gunakan</p>', '<p>Konsisten dengan cara kerja yang biasa saya gunakan</p>', '<p>Membiarkan rekan tersebut dengan cara kerjanya karena gaya setiap orang berbeda-beda</p>', '<p>Merasa terganggu karena sepertinya cara-cara tersebut diperolehnya dengan cara curang</p>', 4, 5, 3, 2, 1, 0, 1, 2, NULL, 1),
('0991ed9f-1227-4e24-ad09-c25b91bf4109', '2023-10-13 04:33:09', '2023-10-13 04:33:09', NULL, 'dfcc80d7-7e2f-4c19-88cc-d69371bbee12', NULL, 0, NULL, NULL, NULL, '<p>Nilai-nilai bela negara sebagaimana tertuang dalam Peraturan Menteri Pertahanan RI Nomor 32 tahun 2016 tentang Pedoman Pembinaan kesadaran Bela Negara. Berikut ini yang bukan termasuk nilai-nilai bela negara yang telah dirumuskan oleh Menteri Pertahanan RI adalah...</p>', '<p>Cinta tanah air</p>', '<p>Kesadaran berbangsa dan bernegara</p>', '<p>Yakin akan Pancasila sebagai ideologi negara</p>', '<p>Mempunyai semangat untuk mewujudkan negara berdaulat, adil dan makmur</p>', '<p>Memiliki kemampuan awal bela negara</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('09d10275-7c58-4ab1-bf8e-34b2986c3a57', '2023-10-19 07:22:09', '2023-10-19 07:22:09', NULL, '80cec561-fc0b-46c7-aed4-f0ad73061557', NULL, 0, NULL, NULL, NULL, '<p>Perumusan dasar negara pada awal kemerdekaan mencerminkan suasana kebatinan nasional dengan segala keberagaman yang ada. Salah satunya adalah penghilangan 7 kata dalam perumusan dasar negara Indonesia pada sila pertama demi.....</p>', '<p>Menjaga hasil keputusan musyawarah mufakat antara pendiri negara</p>', '<p>Mempercepat proses proklamasi kemerdekaan</p>', '<p>Mempercepat syarat dan ketentuan untuk mendirikan negara</p>', '<p>Menjaga keutuhan wilayah Indonesia</p>', '<p>Mempertahankan stabilitas keamanan dari pengaruh penjajah Jepang</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('0afddd36-c854-4156-a921-c18a3422b98a', '2023-10-16 06:02:12', '2023-10-16 06:02:12', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p>Jika kucingnya mengeong, maka ia merasa lapar.</p>\n<p>Dengan demikian...</p>', '<p>Kucingnya tidak mengeong, maka ia tidak merasa lapar</p>', '<p>la merasa lapar, maka kucingnya mengeong</p>', '<p>Kucingnya mengeong dan dia tidak merasa lapar</p>', '<p>Kucingnya mengeong atau ia merasa lapar</p>', '<p>Kucingnya mengeong, maka ia tidak merasa lapar</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('0b28f9b0-4966-4cb3-8c56-4c88a6bbf304', '2023-10-19 06:41:01', '2023-10-19 06:41:01', NULL, '80cec561-fc0b-46c7-aed4-f0ad73061557', NULL, 0, NULL, NULL, NULL, '<p>Bangkitnya nasionalisme didorong oleh faktor dalam (internal) maupun faktor luar (eksternal). Berikut ini yang merupakan faktor internal lahir dan berkebangnya nasionalisme Indonesia, kecuali....</p>', '<p>Kesadaran untuk bersatu sebagai satu bangsa yakni bangsa indonesia</p>', '<p>Kejayaan bangsa Indonesia sebelum kedatangan bangsa barat</p>', '<p>Penderitaan rakyat akibat politik Drainage</p>', '<p>Adanya Diskriminasi rasial</p>', '<p>Munculnya golongan terpelajar</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('0b44fdb5-4b82-4b8a-948b-0d8226778632', '2023-10-17 05:05:23', '2023-10-17 05:05:23', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Arum seorang pramuniaga yang sedang melayani pembeli, tiba-tiba menerima telfon dan diberikan instruksi untuk segera menemui atasan dikarenakan ada hal yang penting. Hal yang seharusnya dilakukan Arum adalah...</p>', '<p>Langsung pergi menemui atasannya segera</p>', '<p>Meminta pelanggan menunggu ia menyelesaikan perintah atasannya</p>', '<p>Tetap melayani pembeli dan tidak menghiraukan perintah atasannya</p>', '<p>Meminta kepada rekan kerjanya untuk menggantikan dirinya melayani pembeli</p>', '<p>Meminta kepada rekan kerjanya untuk menggantikan dirinya memenuhi perintah atasan</p>', 2, 3, 4, 5, 1, 0, 1, 4, NULL, 1),
('0bf85521-3686-468f-984e-78a8c73c2f14', '2023-10-13 06:22:47', '2023-10-13 06:22:47', NULL, 'dfcc80d7-7e2f-4c19-88cc-d69371bbee12', NULL, 0, NULL, NULL, NULL, '<p>Dewi mendapat nilai terbaik dari lomba melukis. Namun Dewa tidak terima karena menganggap lukisan Dewi abstrak dan tidak lebih baik dari lukisannya. Mengejek dan mencela hasil karya orang lain merupakan pelanggaran sila ke...</p>', '<p>Lima</p>', '<p>Empat</p>', '<p>Tiga</p>', '<p>Dua</p>', '<p>Satu</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
