('0d184acd-8b6a-4f44-84d1-83c5a215c985', '2023-10-18 05:02:29', '2023-10-18 05:02:29', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Anda diminta rekan kerja anda untuk memalsukan sebuah data di perusahaan anda. Maka anda akan &hellip;</p>', '<p>Hal tersebut sering terjadi dimanapun</p>', '<p>Melakukannya karena takut dimarahi oleh atasan anda</p>', '<p>Mengingatkan atasan anda dan melaporkan kepada yang berwenang</p>', '<p>Sudah menjadi kebiasaan yang tidak baik</p>', '<p>Tidak ingin terlibat didalamnya dan berusaha menghiraukannya</p>', 2, 3, 5, 1, 4, 0, 1, 3, NULL, 1),
('0d3f1cd8-b00d-4401-a885-b9958a6b8936', '2023-10-14 05:52:23', '2023-10-14 05:52:23', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Awal tahun ini anda baru saja lulus dari sebuah Universitas ternama dengan predikat cumloude. Anda pun mencoba peruntungan untuk melamar di beberapa perusahaan. Setelah mengikuti beberapa kali proses seleksi di beberapa perusahaan akhirnya anda diterima disebuah perusahaan yang terletak di pinggiran kota. Kemudian Anda memutuskan untuk mencari kontrakan di sekitar lokasi perusahaan anda bekerja. Namun anda merasa tinggal di pinggiran kota memang sangat tidak mengenakkan. Mulai dari susahnya transportasi umum untuk ke kota, jauhnya fasilitas kesehatan, sampai jarangnya tempat hiburan sebagai pelepas stres jika pulang bekerja, tapi dengan tinggal di pinggiran kota membuat anda sering tiba tepat waktu di kantor, bagaimana sikap anda....</p>', '<p>Saya akan mencoba untuk bertahan semampunya untuk tetap tinggal di pinggiran kota karena akan membuat saya lebih dekat dengan lokasi perusahaan</p>', '<p>Mencari tempat tinggal lain yang lebih nyaman, meskipun sedikit jauh dari lokasi perusahaan tempat anda bekerja</p>', '<p>Mencari cara agar dapat menikmati kehidupan di daerah pinggiran kota yang lokasinya dekat dengan pekerjaan anda</p>', '<p>Berusaha untuk bekerja lebih giat dengan harapan bisa mendapatkan fasilitas rumah dari kantor</p>', '<p>Menerima hal ini sebagai resiko dari pekerjaan yang anda ambil dan berusaha untuk tetap bisa merasa nyaman tinggal di daerah pinggiran</p>', 3, 1, 5, 2, 4, 0, 1, 3, NULL, 1),
('0e30def7-4706-44e4-b099-9d2fddfc9963', '2023-10-16 04:10:11', '2023-10-16 04:10:11', NULL, '7353afdf-8c22-4e71-a553-90921b9692ab', NULL, 0, NULL, NULL, NULL, '<p>Sebuah manuskrip kuno yang menceritakan kejayaan Majapahit dalam menyatukan nusantara menjadi cikal bakal lahirnya nasionalisme yang dikembangkan pada founding fathers di Indonesia. Manuskrip tersebut berjudul....</p>', '<p>Sutasoma</p>', '<p>Babad Tanah Jawi</p>', '<p>Negarakertagama</p>', '<p>Purwaka Caruban Nagari</p>', '<p>Pararaton</p>', 0, 0, 0, 0, 0, 0, 1, 5, NULL, 1),
('1154bfcc-e0b7-4f31-b2bb-f67c4fcf6d69', '2023-10-19 07:49:08', '2023-10-19 07:49:08', NULL, '80cec561-fc0b-46c7-aed4-f0ad73061557', NULL, 0, NULL, NULL, NULL, '<p>Memiliki harga diri, rasa bangga dan rasa sayang terhadap kepribadian dan identitas bangsanya yang tumbuh dari dan sesuai dengan sejarah dan kebudayaannya, merupakan bagian dari prinsip nasionalisme yaitu......</p>', '<p>Kesatuan</p>', '<p>Kebebasan</p>', '<p>Kesamaan</p>', '<p>Kepribadian dan identitas</p>', '<p>Prestasi</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
