('116ca017-3e71-4438-83e6-f6825906f01d', '2023-10-17 07:40:54', '2023-10-17 07:40:54', NULL, 'b6b3d933-7f1c-4ac1-abf2-14928a6ab49f', NULL, 0, NULL, NULL, NULL, '<p>Di bawah ini yang merupakan definisi dari Bela negara adalah...</p>', '<p>Jiwa kecintaan kepada Negara Kesatuan Republik Indonesia yang berdasarkan Pancasila dan Undang-Undang Dasar 1945 dalam menjamin kelangsungan hidup bangsa dan negara</p>', '<p>Kewajiban dasar manusia</p>', '<p>Kehormatan bagi setiap warga negara yang dilaksanakan dengan penuh kesadaran, tanggung jawab, dan rela berkorban dalam pengabdian kepada negara dan bangsa, yang ketika diwujudkan dalam bentuk sikap dan perilaku, maka jiwa, kewajiban, dan kehormatan tersebut menjelma menjadi \"Upaya Bela Negara\"</p>', '<p>A, B, dan C Benar</p>', '<p>A dan C benar</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('12636b85-bf16-486d-9d62-24bae7a97b63', '2023-10-19 07:17:48', '2023-10-19 07:17:48', NULL, '80cec561-fc0b-46c7-aed4-f0ad73061557', NULL, 0, NULL, NULL, NULL, '<p>Sistem pertahanan dan keamanan rakyat semesta (Sishankamarata) bercirikan...</p>', '<p>Kerakyatan, berkeadilan, gotong royong</p>', '<p>Kesemestaan, kewilayahan, kerakyatan</p>', '<p>Kesemestaan, kerakyatan, berkeadilan</p>', '<p>Kesatuan, keberlanjutan, kedaulatan</p>', '<p>Berkeadilan, kekeluargaan, keberlanjutan</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('1273d096-9397-4230-98d1-c6ba3e0a1dac', '2023-10-13 05:59:21', '2023-10-13 05:59:21', NULL, 'dfcc80d7-7e2f-4c19-88cc-d69371bbee12', NULL, 0, NULL, NULL, NULL, '<p>Bela negara yang dilakukan dengan jalan pengabdian sesuai dengan profesinya masing-masing merupakan bentuk bela negara dari aspek...</p>', '<p>Normatif</p>', '<p>Informal</p>', '<p>Profesi</p>', '<p>Non-fisik</p>', '<p>Fungsional</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('12ce3c37-3359-460f-ad20-d1fd4b0b0dfa', '2023-10-25 07:08:36', '2023-10-25 07:08:36', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Anda merasa tidak cocok dengan salah satu rekan kerjda kantor anda. Suatu hari anda terpilih untuk berada satu tim kerja dengan dia yang akan anda lakukan adalah&hellip;</p>', '<p>Minta bertukar tempat dengan rekan kerja lain</p>', '<p>Menyelesaikan proyek kerja tersebut sendirian tanpa melibatkannya</p>', '<p>Tidak mau terlibat dalam proyek kerja tersebut dan membiarkannya menyelesaikan sendirian</p>', '<p>Menyelesaikan proyek kerja tersebut bersamanya secara professional</p>', '<p>Menolak untuk berada dalam tim kerja tersebut</p>', 4, 3, 2, 5, 1, 0, 1, 4, NULL, 1),
('12d69b76-cb26-4197-aa71-486fac2e47d2', '2023-10-18 08:02:09', '2023-10-18 08:02:09', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Apakah anda bersedia untuk memperdebatkan sesuatu, padahal kelompok anda jelas tidak menyetujuinya?</p>', '<p>Saya akan tetap mempertahankan pendapat saya</p>', '<p>Saya akan menyimak pendapat lain terlebih dahulu</p>', '<p>Saya akan berpikir ulang dan mencari jalan tengah</p>', '<p>Saya akan mengalah</p>', '<p>Saya akan mengumpulkan teman terlebih dahulu</p>', 2, 4, 5, 3, 1, 0, 1, 3, NULL, 1),
('1329b2a2-c596-4410-b544-a2c7cb7fae0e', '2023-10-20 07:29:15', '2023-10-20 07:29:15', NULL, '00cc482f-6b53-42a2-9045-e1b555bb5d19', NULL, 0, NULL, NULL, NULL, '<p>Ibu Ratna ingin akan membeli tepung untuk keperluan membuat kue. Satu bungkus tepung memiliki tara 0,5 kilogram dengan berat kotor 2 kilogram. Jika ibu Ratna membutuhkan tepung sebanyak 5 kilogram, berapa bungkus tepung yang harus dibeli oleh ibu Ratna?</p>', '<p>5</p>', '<p>3</p>', '<p>6</p>', '<p>4</p>', '<p>2</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('137804ff-7baa-4fa2-ad84-8102e46022a9', '2023-10-18 07:20:46', '2023-10-18 07:20:46', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Jarak dari rumah ke kantor adalah 30 menit dengan bus. Tanpa diketahui sebelumnya, hari lnl kendaraan umum melakukan aksi mogok beroperasi. Akibat kejadian tersebut saya....</p>', '<p>Saya tetap menunggu siapa tahu seseorang akan memberikan saya tumpangan</p>', '<p>Saya berusaha menghentikan kendaran yang lewat untuk mendapatkan tumpangan</p>', '<p>Saya akan berjalan kaki secepat mungkin</p>', '<p>Lebih baik pulang dan tidak usah masuk kerja</p>', '<p>Saya akan berjalan kaki sambil mencari tumpangan</p>', 2, 4, 3, 1, 5, 0, 1, 5, NULL, 1),
('1418c37c-ea21-4b82-bb9a-71fcde5c9445', '2023-10-17 03:17:27', '2023-10-17 03:17:27', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Hari ini dikantor akan diadakan rapat menganai kebijakan yang akan ditempuh oleh perusahaan untuk meningkatkan pelayanan terhadap masyarakat. Semua karyawan diminta menyampaikan ide mereka saat rapat berlangsung. Anda telah menyampaikan ide anda sebagaiperwakilan divisi anda, namun ada rekan lain yang kurang mendukung ide anda karena dinilai tidak memberikan perubahan terhadap perusahaan kedepannya. Sikap anda sebaiknya....</p>', '<p>Membicarakan dengan rekan perwakilan divisi lain mengenai gagasan yang anda ajukan dan dampaknya bagi perusahaan</p>', '<p>Mencari dukungan ketua rapat dengan memberikan data yang mendukung ide anda agar diterima</p>', '<p>Membicarakan dengan divisi lain untuk memadukan gagasan yang anda sampaikan</p>', '<p>Mengganti dengan ide lain agar dapat diterima oleh semua perwakilan divisi</p>', '<p>Merumuskan ide secara detail supaya rekan lain mengerti bahwa ide yang anda sampaikan akan berdampak baik bagi perusahaan</p>', 4, 2, 3, 1, 5, 0, 1, 5, NULL, 1),
('141aff7b-c94b-48e7-841e-accfacfe2454', '2023-10-20 07:49:29', '2023-10-20 07:49:29', NULL, '00cc482f-6b53-42a2-9045-e1b555bb5d19', NULL, 0, NULL, NULL, NULL, '<p>Jarak antara kota P dan Q adalah setengah jarak antara kota R dan S. Di antara kota P dan Q terdapat kota T. Jarak kota P ke kota R sama dengan jarak kota Q ke kota S, yaitu setengah jarak kota P ke kota T. Jarak yang paling jauh adalah antara kota .....</p>', '<p>P dan Q</p>', '<p>R dan S</p>', '<p>P dan R</p>', '<p>Q dan S</p>', '<p>R dan T</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
