('1507f957-81be-472d-88ff-6a7672c38d2a', '2023-10-16 05:14:27', '2023-10-16 05:14:27', NULL, '7353afdf-8c22-4e71-a553-90921b9692ab', NULL, 0, NULL, NULL, NULL, '<p>Makna dari wawasan kebangsaan Indonesia yaitu mengamanatkan kepada seluruh bangsa agar menempatkan persatuan dan kesatuan serta kepentingan dan keselamatan bangsa dan negara di atas kepentingan pribadi dan golongan. Kesediaan untuk menjalin hubungan harmonis diantara sesama anak bangsa, merupakan salah satu dari prinsip wawasan kebangsaan Indonesia yaitu...</p>', '<p>Pengorbanan</p>', '<p>Kesetaraan</p>', '<p>Kesinambungan</p>', '<p>Kekeluargaan</p>', '<p>Kebersamaan</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
