('15e840a7-4db6-441e-ba6e-ade7dfa72b29', '2023-10-14 09:43:55', '2023-10-16 03:22:13', NULL, 'e9f84a80-562c-4b59-b70d-8f1c9f4e3b4f', NULL, 0, NULL, NULL, NULL, '<p>Perhatikan gambar dibawah ini!</p>\n<p>Tentukan satu gambar yang merupakan pencerminan dari gambar yang menjadi soal atau pertanyaan</p>\n<p><img src=\"/../storage/upload_files/questions/20231016102112Soal 62.jpg\" alt=\"\" width=\"258\" height=\"166\" /></p>', '<p>Gambar A</p>', '<p>Gambar B</p>', '<p>Gambar C</p>', '<p>Gambar D</p>', '<p>Gambar E</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('167c1462-52b3-4441-8556-0771be6b20da', '2023-10-13 04:17:18', '2023-10-13 04:17:18', NULL, 'dfcc80d7-7e2f-4c19-88cc-d69371bbee12', NULL, 0, NULL, NULL, NULL, '<p>Faktor yang menyebabkan korupsi meliputi dua faktor yaitu faktor internal dan eksternal. Berikut ini yang bukan termasuk faktor eksternal...</p>', '<p>Instabilitas politik</p>', '<p>Pemimpin yang buruk</p>', '<p>Gaji yang rendah</p>', '<p>Lemahnya hukum</p>', '<p>Gaya hidup konsumtif</p>', 0, 0, 0, 0, 0, 0, 1, 5, NULL, 1),
('178c5d56-7075-48c2-845f-fa44bc4262e6', '2023-10-14 09:55:13', '2023-10-16 03:27:46', NULL, 'e9f84a80-562c-4b59-b70d-8f1c9f4e3b4f', NULL, 0, NULL, NULL, NULL, '<p>Seri Gambar</p>\n<p>Perhatikan seri gambar berikut dan kemudian tentukan satu gambar yang tersedia yang merupakan kelanjutan dari seri gambar yang menjadi soal.</p>\n<p><img src=\"/../storage/upload_files/questions/20231016102702Soal 64.jpg\" alt=\"\" width=\"403\" height=\"122\" /></p>', '<p>Gambar A</p>', '<p>Gambar B</p>', '<p>Gambar C</p>', '<p>Gambar D</p>', '<p>Gambar E</p>', 0, 0, 0, 0, 0, 0, 1, 5, NULL, 1),
('17c3a278-14b4-4135-81f0-90892f229f46', '2023-10-13 09:42:55', '2023-10-13 09:42:55', NULL, 'e9f84a80-562c-4b59-b70d-8f1c9f4e3b4f', NULL, 0, NULL, NULL, NULL, '<p>Sebuah bus menempuh perjalan dari kota P ke kota Q dengan kecepatan rata-rata 40 km/jam dan kembali dengan kecepatan rata-rata 60 km/jam. Jika jarak dari kota P ke kota Q adalah 120 km, kecepatan rata-rata per jam untuk seluruh perjalanan adalah .. km/jam</p>', '<p>42</p>', '<p>46</p>', '<p>48</p>', '<p>50</p>', '<p>52</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('17d63b7f-e7ba-480b-92c2-1cdf64d3e69a', '2023-10-18 05:12:45', '2023-10-18 05:12:45', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Rekan kerja anda mengajak anda pergi ke restoran terbaru di kota anda ketika sedang bekerja. Sikap anda adalah....</p>', '<p>Jika tidak ada atasan anda, anda akan pergi bersama rekan kerja anda</p>', '<p>memarahinya dan membentaknya didepan rekan kerja anda yang lainnya</p>', '<p>pergi bersama rekan kerja anda</p>', '<p>tetap bekerja seperti biasa dan-menghiraukannya</p>', '<p>bimbang dan teta fokus pada pekerjaan anda</p>', 3, 1, 2, 5, 4, 0, 1, 4, NULL, 1),
