('1aaf65e0-65b3-404d-916b-c22fd46e18cd', '2023-10-18 03:26:08', '2023-10-18 03:26:08', NULL, '557e3be9-1ea4-45e4-8163-29eb4435e058', NULL, 0, NULL, NULL, NULL, '<p>Dari lima gambar berikut, manakah yang berbeda&hellip;</p>\n<p><img src=\"/storage/upload_files/questions/20231018102430soal 36.jpg\" alt=\"\" width=\"500\" height=\"83\" /></p>', '<p>Gambar A</p>', '<p>Gambar B</p>', '<p>Gambar C</p>', '<p>Gambar D</p>', '<p>Gambar E</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('1b33fd8a-42b8-4aed-ab4c-e37ebcb9acf6', '2023-10-18 08:23:23', '2023-10-18 08:23:23', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Anda berasal dari keluarga yang membiasakan hidup disiplin, segala sesuatunya terencana dan terarah, namun berbeda dengan teman anda yang melakukan segala sesuatu dadakan, spontan dan tidak memiliki tujuan, bagaimana sikap anda terhadap teman anda&hellip;</p>', '<p>membencinya karena dia berbeda dari anda</p>', '<p>sirik terhadapnya dan menganggap dia berlebihan terhadap hidupnya</p>', '<p>menerima perbedaan karena tiap dldikan keluarga itu berbeda dan anda pun bisa seperti teman anda jika anda mau</p>', '<p>tidak membenarkan kebiasaan teman anda jika dia termasuk dari keluarga anda</p>', '<p>menanggapinya biasa saja</p>', 2, 1, 5, 3, 4, 0, 1, 3, NULL, 1),
('1c269c5e-2a85-49d9-8f20-3ed1fff1f5cb', '2023-10-26 06:44:21', '2023-10-26 06:44:21', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Di masa pandemi seperti saat ini banyak sekali berita dan informasi hoax di media sosial yang disebarkan oleh orang yang tidak bertanggung jawab tentang masalah atau isu kesehatan yang terkadang menyudutkan tenaga kesehatan atau pemerintah. Hal ini menyebabkan banyak orang yang masih mudah terprovokasi. melakukan perdebatan yang tidak perlu bahkan perundungandi dunia maya. Sikap anda mengatasi hal ini adalah.....</p>', '<p>Membatasi penggunaan media sosial untuk keperluan yang penting saja</p>', '<p>Mengenali sumber berita dan memilih apakah berita tersebut akurat atau tidak</p>', '<p>Menghindari membaca berita yang memiliki judul provokatif</p>', '<p>Membaca berita tetapi sepenuhnya percaya pada berita tersebut</p>', '<p>Membaca keseluruhan informasi secara lengkap</p>', 4, 5, 3, 2, 1, 0, 1, 2, NULL, 1),
('1c7b57c1-0e50-4f95-9625-da56b74bd008', '2023-10-17 08:50:38', '2023-10-17 08:50:38', NULL, 'b6b3d933-7f1c-4ac1-abf2-14928a6ab49f', NULL, 0, NULL, NULL, NULL, '<p>Invasi Peristiwa Bandung Lautan Api (BMI) adalah bentuk perlawanan raykat Indonesia kepada para penjajah. Rakyat menolak rencana pendjajahan lagi yang akan dilakukan oleh pasukan sekutu, Faktor yang menguatkan kedatangan tentara sekutu ke Bandung adalah...</p>', '<p>Pasukan sekutu ingin menguasai rempah-rempah dari Indonesia</p>', '<p>Pasukan sekutu berusaha menguasai tempat-tempat vital seperti lapangan, radio, gedung dan stasiun kereta</p>', '<p>Pasukan sekutu ingin mengambil alih tahanan perang atau APWL(Allied Prisoners of War and Internees) yang dipenjarakan oleh tentara Jepang</p>', '<p>Pasukan sekutu ingin menguasai pemerintahan</p>', '<p>Pasukan sekutu membelot dari pasukan Jepang</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('1cc5701a-aad2-4ba6-a8f6-f3a373a09efc', '2023-10-13 04:04:14', '2023-10-13 04:04:14', NULL, 'dfcc80d7-7e2f-4c19-88cc-d69371bbee12', NULL, 0, NULL, NULL, NULL, '<p>Kegagalan nasionalisme politik di Indonesia saat ini ditunjukkan dengan terjadinya ...</p>', '<p>Menguatnya anasir-anasir nasionalisme kultural</p>', '<p>Banyaknya aksi teror bom dari sindikat internasional</p>', '<p>Melemahnya sistem integrasi nasional</p>', '<p>Menciutnya politik yang mengatasnamakan agama dan suku</p>', '<p>Makin banyaknya berita hoaks dan provokatif di sosial media</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('1cd1d8d0-bf28-4746-8ab6-c6fe92d35676', '2023-10-16 05:20:38', '2023-10-16 05:20:38', NULL, '7353afdf-8c22-4e71-a553-90921b9692ab', NULL, 0, NULL, NULL, NULL, '<p>Nasionalisme adalah perasaan cinta atau bangga terhadap tanah air dan bangsanya dengan tetap menghormati bangsa lain karena merasa sebagai bagian dari bangsa lain di dunia. Indikator dari sikap nasionalisme diantaranya kecuali....</p>', '<p>Menjaga dan melindungi Negara</p>', '<p>Sikap rela berkorban/patriotisme</p>', '<p>Pantang menyerah</p>', '<p>Indonesia bersatu</p>', '<p>Melestarikan budaya Indonesia</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
