('1fcca060-55c3-4ce1-88dc-929e3ca11b61', '2023-10-25 04:02:11', '2023-10-25 04:02:11', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Anda adalah petugas kebersihan disuatu kantor. Saat itu ketika anda sedang menyapu halaman depan kantor pada pukul 16.45 WIB pada saat kantor memang akan sudah tutup. Seseorang menghampiri anda dan ia terlihat sangat tergesa-gesa untuk meminta pelayanan, padahal jam pelayanan hanya sampai pukul 16.00 WIB. Yang anda lakukan......</p>', '<p>Melaporkan kepada atasan adanya kejadian tersebut</p>', '<p>Segera mencari orang yang mungkin bisa membantu melayaninya</p>', '<p>Melayaninya sebaik mungkin sesuai, keperluannya</p>', '<p>Membiarkannya dan pura-pura tidak melihatnya</p>', '<p>Menjelaskannya kalau jam pelayanan sudah tutup dan memintanya untuk datang keesokan harinya</p>', 4, 5, 3, 2, 1, 0, 1, 2, NULL, 1),
('1fefb0b4-f72e-4506-bf08-ff13c225a8a1', '2023-10-19 06:53:37', '2023-10-19 06:54:01', NULL, '80cec561-fc0b-46c7-aed4-f0ad73061557', NULL, 0, NULL, NULL, NULL, '<p>Norma ini berasal dari integritas diri manusia yang menghasilkan moral dan akhlak. Berlaku umum bagi seluruh anggota masyarakat (universal). Sanksi bagi pelanggar norma ini berupa perasaan tidak tenang. Norma yang dimaksud adalah....</p>', '<p>Norma agama</p>', '<p>Norma adat</p>', '<p>Norma hukum</p>', '<p>Norma kesopanan</p>', '<p>Norma kesusilaan</p>', 0, 0, 0, 0, 0, 0, 1, 5, NULL, 1),
('2096316a-5a23-4265-8536-723d144ed7eb', '2023-10-23 09:15:53', '2023-10-25 03:12:19', NULL, '00cc482f-6b53-42a2-9045-e1b555bb5d19', NULL, 0, NULL, NULL, NULL, '<p><img src=\"/storage/upload_files/questions/20231023041400Soal 60.jpg\" alt=\"\" width=\"414\" height=\"262\" /></p>', '<p>Gambar A</p>', '<p>Gambar B</p>', '<p>Gambar C</p>', '<p>Gambar D</p>', '<p>Gambar E</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('20e067a7-7005-46c8-aa4d-d6f303d63874', '2023-10-17 05:37:09', '2023-10-17 05:37:09', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Anda adalah seorang kasir antrian sebuah tiket pertunjukkan disuatu wahana bermain di kota anda. Anda selalu saja menjumpai seorang ibu - ibu kepanasan dalam mengantri, lansia yang menunggu dengan kepanasan, tidak ada aturan dikantor anda tentang masalah tersebut. Apa yang harusnya anda lakukan...</p>', '<p>Meminta pengertian kepada pengunjung lain supaya ibu-ibu dan lansia tersebut untk dilayani terlebih dahulu setiap anda melihat kejadian tersebut</p>', '<p>Memberi masukan kepada kantor untuk membuat tempat antrian yang lebih bagus</p>', '<p>Tetap menjalankan tugas yang kantor perintahkan sesuai SOP</p>', '<p>Rasanya sangat tidak nyaman bekerja disini</p>', '<p>Memberi masukan kepada kantor supaya lebih memprioritaskan ibu hamil dan lansia karena tidak tega melihat kejadian seperti itu</p>', 4, 3, 2, 1, 5, 0, 1, 5, NULL, 1),
('222ecec5-9083-4492-b71f-5e38574e1dd0', '2023-10-14 05:12:11', '2023-10-14 05:12:11', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Karena banyaknya tugas team yang harus diselesaikan anda meminta bantuan teman anda untuk mengerjakan sebuah tugas yang deadline juga bersamaan dengan tugas team yang lain. Namun di tengah proses pengerjaan tugas tersebut kelihatannya teman anda kurang bersemangat mengerjakannya, apa yang anda lakukan...</p>', '<p>Menanyakan hal yang membuatnya tidak bersemangat</p>', '<p>Mengamati dan mencari tahu akar permasalahannya</p>', '<p>Mengamati dan mencari tahu akar permasalahannya</p>', '<p>Mengobrol dan mengingatkan teman akan target pengerjaan seharusnya</p>', '<p>Meminta agar tugas tersebut dapat diselesaikan tepat waktu</p>', 2, 1, 4, 3, 5, 0, 1, 5, NULL, 1),
('2283f187-6af0-45af-9e0e-c2318973e475', '2023-10-18 07:42:34', '2023-10-18 07:42:34', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Ketika saya sedang naik motor di jalan mendekati kampus tempat saya kuliah dulu, saya melihat seorang dosen saya yang dulu terkenal sangat galak sedang jalan kaki, saya akan....</p>', '<p>Berhenti-dan menyalami dosen tersebut</p>', '<p>Diam dan pura-pura tidak tahu</p>', '<p>Langsung menambah kecepatan agar tidak terlihat</p>', '<p>Dalam hati masih menyimpan dendam karena pernah dimarahl</p>', '<p>Menyalami guru tersebut dan menawarl untuk memberi boncengan</p>', 4, 2, 1, 3, 5, 0, 1, 5, NULL, 1),
('230ceee2-085f-4ef4-9f38-a83e66d96c19', '2023-10-26 06:39:35', '2023-10-26 06:39:35', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Anda adalah pegawai baru yang berkerja di divisi layanan pengaduan konsumen. Divisi ini dibagi dua yaitu melayani pengaduan secara online atau daring dan layanan pengaduan konsumen secara langsung. Untuk mempermudah dokumentasi pengaduan,atasan anda memerintahkan untuk mengisikan detail permasalahan setiap konsumen yang mengadukan keluhannya isian detail aduan didokumentasikan di aplikasi khusus yang harus di kuasa oleh seluruh anggota divisi layanan pengaduan konsumen sebagai pegawai baru, maka anda akan......</p>', '<p>Meminta bantuan rekan yang sudah bekerja lebih lama untuk mengajari menggunakan aplikasi layanan pengaduan konsumen</p>', '<p>Mengikuti training atau pelatihan yang diadakan oleh perusahaan dalam menggunakan aplikasi layanan pengaduan konsumen</p>', '<p>Meminta tim IT untuk membuat buku catatan sebelum mengisi ke aplikasi layanan pengaduan selagi masih belum paham cara menggunakan aplikasi layanan pengaduan</p>', '<p>Sementara waktu mencatat pengaduan konsumen di buku catatan sebelum mengisi ke aplikasi layanan pengaduan</p>', '<p>Memperhatikan rekan sejawat saat menggunakan aplikasi layanan pengaduan kemudian menirunya</p>', 5, 4, 3, 1, 2, 0, 1, 1, NULL, 1),
('23e5753f-8715-4507-a3f6-751fb140a2e3', '2023-10-13 09:54:29', '2023-10-13 09:54:29', NULL, 'e9f84a80-562c-4b59-b70d-8f1c9f4e3b4f', NULL, 0, NULL, NULL, NULL, '<p>Hasil dari 186 x 24: 6 adalah ...</p>', '<p>764</p>', '<p>744</p>', '<p>678</p>', '<p>550</p>', '<p>436</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('2412872c-8628-4f3c-918a-fe2a7c6c9bc1', '2023-10-17 05:29:59', '2023-10-17 05:29:59', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Ketika sedang mengerjakan suatu tugas atau pekerjaan yang mendadak dan harus segera diselesaikan, saya selalu...</p>', '<p>Bekerja dengan santai dan mengerjakan sebisanya</p>', '<p>Bekerja dengan cepat yang penting pekerjaan selesai</p>', '<p>Bekerja dengan tenang dan tidak terburu-buru untuk memulai</p>', '<p>Bekerja dengan baik karena tugas tersebut disertai bonus atau bayaran tambahan</p>', '<p>Bekerja dengan segera dan tetap berusaha menyelesaikannya dengan sungguh-sungguh</p>', 3, 4, 2, 1, 5, 0, 1, 5, NULL, 1),
('247834ec-f2c7-4f1a-a9eb-ddefd0798516', '2023-10-13 06:56:06', '2023-10-13 06:56:06', NULL, 'dfcc80d7-7e2f-4c19-88cc-d69371bbee12', NULL, 0, NULL, NULL, NULL, '<p>Cermatilah kalimat berikut!</p>\n<ul>\n<li>Buatlah simpul awal terlebih dahulu. Posisi buntut benang ada di tangan kanan, sedangkan benang yang panjang ada di tangan kiri</li>\n<li>Ulangi perintah yang sama seperti di atas seterusnya sampai panjang yang diinginkan</li>\n<li>Kaitan jarum hakpen pada benang kemudian tarik perlahan masukkan melalui lubang bulatan/simpul hidup yang telah dibuat tadi sehingga terbentuk bulatan baru</li>\n</ul>\n<p>Urutan kalimat tersebut agar menjadi paragraf eksposisi yang padu adalah.&hellip;....</p>', '<p>(1), (2), (3)</p>', '<p>(3), (1), (2)</p>', '<p>(2), (3), (1)</p>', '<p>(3), (2), (1)</p>', '<p>(1), (3), (2)</p>', 0, 0, 0, 0, 0, 0, 1, 5, NULL, 1),
('24b0a3b3-d364-4f61-a1ce-cc78ca8253f0', '2023-10-17 06:00:00', '2023-10-17 06:00:00', NULL, 'b6b3d933-7f1c-4ac1-abf2-14928a6ab49f', NULL, 0, NULL, NULL, NULL, '<p>Evaluasi kinerja pegawai untuk menghindari dari tindakan korupsi dapat dilakukan dengan kegiatan seperti...</p>', '<p>Surveillance</p>', '<p>Musrembang</p>', '<p>Survei institusi</p>', '<p>Balitbang</p>', '<p>Survei mawas diri</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('24c01357-3d27-43af-a081-a0d7b437bed1', '2023-10-26 06:17:08', '2023-10-26 06:17:08', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Suatu hari anda di traktir makan siang oleh teman anda yang mempunyai pola hidup vegetarian sedangkan anda tidak menyukai sayuran dan ingin menyantap sop buntut sebagai menu makan siang anda. Maka sikap anda adalah.....</p>', '<p>Menolak traktiran oleh teman anda dan memilih untuk memakan sop buntut</p>', '<p>Menerima ajakan teman anda dan meminta teman anda memilih tempat makan yang dikehendaki</p>', '<p>Menerima ajakan teman anda dan meminta teman anda mengikuti pilihan menu makan anda</p>', '<p>Menolak ditraktir teman anda karena anda tidak menyukai sayuran</p>', '<p>Menerima ajakan teman anda tetapi meminta teman anda untuk memilih tempat makan yang menyediakan menu vegetarian dan sup buntut</p>', 2, 4, 3, 1, 5, 0, 1, 5, NULL, 1),
('2600b19a-d9f5-4243-ab6f-6a300a839f2e', '2023-10-16 07:31:17', '2023-10-16 07:31:17', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p>Seorang pedagang membeli 2 karung beras masing-masing beratnya 1 kuintal dengan tara 2,5%. Harga pembelian setiap karung beras Rp 200.000,00. Jika beras itu dijual dengan harga Rp 2.400,00 per kilogram, maka besar keuntungan penjual sebesar....</p>', '<p>Rp 34.000,00</p>', '<p>Rp 56.000,00</p>', '<p>Rp 68.000,00</p>', '<p>Rp 80.000,00</p>', '<p>Rp 92.000,00</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('26849df1-fa4d-4213-8c40-d9aaf3f767b5', '2023-10-17 03:26:00', '2023-10-17 03:26:00', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Salah satu rekan kerja anda yang merupakan sahabat karib anda menggunakan uang kantor untuk keperluan berobat anaknya yang sedang dirawat di rumah sakit. Anda diminta merahasiakan kepada atasan anda karena ia takut mendapat sanksi jika ketahuan. Maka sikap andaseharusnya...</p>', '<p>Menjauhi rekan kerja anda karena dia bermasalah dan mungkin akan mempengaruhi posisi anda di perusahaan</p>', '<p>Menyarankan rekan kerja anda untuk mengakui kealahannya kepada atasan anda</p>', '<p>Tidak memberi tahu kepada siapapun</p>', '<p>Menyarankan rekan kerja anda untuk mengakui kesalahannya kepada atasan anda dan membantunya mengembalikan uang kantor semampu anda</p>', '<p>Memberi tahu kepada atasan karena perbuatan tersebut akan merugikan perusahaan</p>', 2, 4, 3, 5, 1, 0, 1, 4, NULL, 1),
('26960f76-baee-468b-87b4-17f72d17af5a', '2023-10-25 03:26:22', '2023-10-25 03:26:22', NULL, '00cc482f-6b53-42a2-9045-e1b555bb5d19', NULL, 0, NULL, NULL, NULL, '<p><img src=\"/../storage/upload_files/questions/20231025102429Soal 61.jpg\" alt=\"\" width=\"505\" height=\"247\" /></p>', '<p>Gambar A</p>', '<p>Gambar B</p>', '<p>Gambar C</p>', '<p>Gambar D</p>', '<p>Gambar E</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('26a1c84e-04a8-43f1-bbff-f6eaf0d68117', '2023-10-18 04:26:51', '2023-10-18 04:26:51', NULL, '557e3be9-1ea4-45e4-8163-29eb4435e058', NULL, 0, NULL, NULL, NULL, '<p>Jika P = 5 x  dan Q = 3 X &frac14; maka hubungan yang tepat adalah&hellip;</p>', '<p>P &gt; Q</p>', '<p>P = Q</p>', '<p>P &lt; Q</p>', '<p>P dan Q tidak dapat ditentukan</p>', '<p>P = 3Q</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('27836a6f-4cfc-44da-b8a8-4883c78ed9f9', '2023-10-26 06:12:56', '2023-10-26 06:12:56', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Anda tinggal di desa tetapi bekerja di kota pada minggu pagi akan diadakan kerja bakti membersihkan sampah ditepi sungai pada hari minggu yang sama anda sudah mempunyai acara sendirian dikantor. Ketentuan warga desa menegaskan bahwa setiap kepala rumah tangga diwajibkan mengikuti kerja bakti apabila tidak dapat hadir akan dikenakan denda. Tindakan yang anda lakukan.....</p>', '<p>Meminta anaknya mewakili kegiatan kerja bakti</p>', '<p>Mengamati kegiatan kerja bakti setelah itu pergi ke kantor</p>', '<p>Memilih membayar denda karena akan pergi ke kantor</p>', '<p>Mengorbankan kegiatan kerja bakti dan lebih memilih pergi ke kantor</p>', '<p>Mengikuti kerja bakti terlebih dahulu setelah itu pergi ke kantor</p>', 4, 3, 2, 1, 5, 0, 1, 5, NULL, 1);
INSERT INTO `questions` (`id`, `created_at`, `updated_at`, `deleted_at`, `question_title_id`, `value_category_id`, `audio_input`, `audio`, `audio_played_limit`, `audio_answer_time`, `question`, `option_1`, `option_2`, `option_3`, `option_4`, `option_5`, `point_1`, `point_2`, `point_3`, `point_4`, `point_5`, `wrong_point`, `correct_point`, `answer`, `discussion`, `section`) VALUES
('29f845e1-c5d8-44de-8a0d-ec5d053e4e92', '2023-10-17 04:47:49', '2023-10-17 04:47:49', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Anda adalah seorang kepala bagian di suatu dinas Kabupaten X. Hari ini atasan anda pergi ke luar kota untuk urusan dinas yang penting. Anda diminta mengawasi pegawai dengan ketat. Hal ini dilakukan karena atasan pernah mendapat laporan bahwa banyak karyawan yang sering terlambat datang dan pulang sebelum waktunya. Suatu ketika datang tamu dari provinsi yang mempunyai urusan penting terkait tugas dan harus diselesaikan hari itu juga. la memaksa anda untuk memberitahukan kemana atasan anda karena sudah lima hari atasan anda tidak dapat dihubungi. Sikap anda sebaiknya...</p>', '<p>Tetap tidak mengatakan kemana atasan anda pergi karena sudah berjanji</p>', '<p>Memberitahu kemana atasan anda pergi mengingat kondisi genting yang terjadi</p>', '<p>Berjanji akan segera menghubungi atasan anda tetapi tetap memberitahu kemana atasan anda pergi</p>', '<p>Mengatakan tidak tahu kemana atasan anda pergi</p>', '<p>Mengatakan kepada tamu.dari provinsi bahwa anda tidak memiliki kewenangan untuk memberitahukan informasi kemana atasan anda pergi</p>', 4, 1, 2, 3, 5, 0, 1, 5, NULL, 1),
('2a1fd0cc-f9c2-4dec-b84b-75b3f7984719', '2023-10-26 09:33:24', '2023-10-26 09:34:06', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Anda adalah seorang karyawan apotik, datang seorang pasien yang ingin membeli obat yang harus menggunakan resep dokter karena bisa membahayakan kesehatan. Namun pembeli tersebut memaksa untuk membelinya dan dia memberikan sejumlah uang kepada anda agar mau memberikan obat tersebut, bagaimana sikap anda.....</p>', '<p>Saya memberikan obat tersebut kepadanya, karena tidak ada yang tahu</p>', '<p>Saya menjadi ragu-ragu</p>', '<p>Saya berkonsultasi dengan rekan sejawat terlebih dahulu</p>', '<p>Saya langsung menolaknya</p>', '<p>Saya mencoba memberikan penjelasan ke pasien karena tidak berani langsung menolak takut pasien&nbsp;tersinggung</p>', 5, 2, 4, 3, 1, 0, 1, 1, NULL, 1),
('2a4a36bd-fcee-4c33-80ec-bf74e0e8eacb', '2023-10-14 07:57:49', '2023-10-14 07:57:49', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Ketika di kantor, saya tiba-tiba ingin mem-print 3 lembar data - data pribadi, yang tidak ada hubungannya dengan pekerjaan...</p>', '<p>Maka saya langsung saja mem-print di kantor</p>', '<p>Saya mem-print di kantor namun dengan memakai kertas saya sendiri</p>', '<p>Saya mem-print di kantor namun menunggu setelah jam kerja selesai</p>', '<p>Saya mem-print di rumah saja memakai printer sendiri</p>', '<p>Saya mem-print di kantor pada saat printer tidak dipakai</p>', 1, 4, 3, 5, 2, 0, 1, 4, NULL, 1),
('2a5d2bc4-4af7-4a6a-ae62-e1475335ac60', '2023-10-17 05:07:11', '2023-10-17 05:07:11', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Kesetaraan manusia bermakna bahwa manusia sebagai mahkluk ciptaan Tuhan Yang Maha Esa memiliki tingkat atau kedudukan yang sama.Kedudukan tersebut bersumber dari adanya pandangan bahwa.....</p>', '<p>Semua manusia diciptakan sebagai makhluk mulia dan tinggi derajatnya dibandingkan dengan makhluk lainnya</p>', '<p>Manusia adalah makhluk yang memiliki akal dan pikiran</p>', '<p>Setiap manusia memiliki kemampuan untuk mempertahankan hidup</p>', '<p>Semua manusia memilki kekuatan yang tidak dimiliki oleh makhluk lain</p>', '<p>Manusia memiliki kemampuan untuk bekerja</p>', 5, 4, 3, 2, 1, 0, 1, 1, NULL, 1),
('2ba12d42-60c3-4057-a6ed-b98c19b0e033', '2023-10-16 04:21:20', '2023-10-16 04:21:20', NULL, '7353afdf-8c22-4e71-a553-90921b9692ab', NULL, 0, NULL, NULL, NULL, '<p>Semangat nasionalisme terdapat dalam jiwa Pancasila yaitu sila ke</p>', '<p>Satu</p>', '<p>Dua</p>', '<p>Tiga</p>', '<p>Empat</p>', '<p>Lima</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('2ba50d0f-98be-4f7f-9942-48fd93b53c4f', '2023-10-19 07:54:26', '2023-10-19 07:54:26', NULL, '80cec561-fc0b-46c7-aed4-f0ad73061557', NULL, 0, NULL, NULL, NULL, '<p>Anda dipilih menjadi ketua coordinator kerja sebuah proyek dikantor tempat Anda bekerja. PadahalAnda baru saja diterima di kantor tersebut. Hal ini membuat beberapa rekan setim Anda merasa kecewa dan tidak serius dalam mengerjakan tugas. Sikap Anda adalah......</p>', '<p>Tetap mengerjakan proyek yang diberikan meskipun tidak disetujui oleh rekan satu tim</p>', '<p>Merasa rendah diri dan meminta pimpinan mempertimbangkan kembali keputusan tersebut</p>', '<p>Meminta pimpinan kantor untuk mengganti rekan setim yang tidak setuju dengan kepemimpinan saya</p>', '<p>Tetap bekerja sesuai dengan tanggung jawab yang diberikan dan memberikan teguran pada rekan tersebut</p>', '<p>Hanya bekerja sama dengan rekan satu tim yang setuju dengan saya</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('2c202092-0276-44ad-a12f-f902802d282a', '2023-10-26 09:10:55', '2023-10-26 09:10:55', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Anda mendapatkan kepercayaan dari dosen anda untuk menjadi penanggungjawab kelas, kemudian dosen anda meminta anda untuk menyebarkan pamflet seminar yang berisi ajakan mengikuti komunitas yang isunya menimbulkan perpecahan kelompok, sikap anda</p>', '<p>menyebarkan pamflet saja karena takut dimarahi dosen</p>', '<p>mencoba mendiskusikannya dengan dosen anda, barangkali dosen anda tidak memeriksa isi pamflet tersebut</p>', '<p>menghiraukannya saja karena tidak mau terlibat masalah apapun</p>', '<p>mencoba berdiskusi dengan teman sekelas yang aktif di keorganisasian</p>', '<p>menolak mentah-mentah</p>', 3, 5, 4, 2, 1, 0, 1, 2, NULL, 1),
('2cb309e0-e239-4c9d-809e-f90b74aa797b', '2023-10-16 07:13:01', '2023-10-16 07:13:01', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p>Gunakan informasi di bawah ini untuk soal nomor 38-411</p>\n<p>Seorang mahasiswa X harus mengerjakan sebuah essai dengan aturan sebagai berikut:</p>\n<p>- Soal 2 hanya boleh dikerjakan bersama soal 3</p>\n<p>- Soal 1 hanya boleh dikerjakan jika soal 5 tidak dikerjakan</p>\n<p>- Soal 2 tidak boleh dikerjakan jika soal 4 dikerjakan</p>\n<p>- Soal 5 hanya boleh dikerjakan, bersama soal 6</p>\n<p>Jika mahasiswa tersebut wajib mengerjakan soal 6, maka ...</p>', '<p>Mahasiswa tersebut pasti mengerjakan soal 1</p>', '<p>Mahasiswa tersebut pasti mengerjakan soal 5</p>', '<p>Mahasiswa tersebut pasti tidak mengerjakan soal 2</p>', '<p>Mahasiswa tersebut pasti mengerjakan soal 4</p>', '<p>Mahasiswa tersebut pasti tidak mengerjakan soal 3</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('2cb495ac-d93f-4403-b3f8-96b2581b9da2', '2023-10-17 08:23:23', '2023-10-17 08:23:23', NULL, 'b6b3d933-7f1c-4ac1-abf2-14928a6ab49f', NULL, 0, NULL, NULL, NULL, '<p>Para produsen dalam negeri pun kini telah menjaga .... produksinya. Mereka tidak sembarangan dalam .... barang. Mereka sadar bahwa .... harus disertai dengan usaha kendali mutu.</p>\n<p>Kata baku yang sesuai untuk melengkapi kalimat yang rumpang dalam paragraf tersebut adalah</p>', '<p>kualitas, memproduksi, produktifitas</p>', '<p>kwalitas, memproduksi, produktivitas</p>', '<p>C kualitas, memproduksir, produktivitas</p>', '<p>kualitas memproduksi produktivitas</p>', '<p>Kwalitas, memproduksi, produktifitas</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('2e9957aa-b079-401d-99fd-568590b1bb68', '2023-10-17 05:03:21', '2023-10-17 05:03:21', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Para siswa berasal dari berbagai latar belakang yang berbeda mencakup budaya, nilai-nilai, tingkat ekonomi, maupun tingkat pendidikan orang tua. Terhadap berbagai perbedaan itu, sikap guru sebaiknya adalah.....</p>', '<p>Mengelompokkan siswa sesuai dengan kondisi serta latar belakang yang sama</p>', '<p>Menampilkan sikap yang wajar terhadap perbedaan perbedaan pemikiran, sikap, dan perilaku anak didiknya</p>', '<p>Berpandangan bahwa segala perbedaan siswa merupakan fakta yang tidak dapat dihindari</p>', '<p>Mengurangi perbedaan - perbedaan itu dan mengutamakan keseragaman</p>', '<p>Peka terhadap perbedaap dan berperan menumbuhkan sikap saling menghargai antara siswa satu dengan lainnya</p>', 3, 4, 1, 2, 5, 0, 1, 5, NULL, 1),
('2ec2b423-2e34-4b38-8c55-c6a2c77a4d9c', '2023-10-16 08:19:07', '2023-10-16 08:19:07', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p>Jika k/l = 3/8 dan m/l = 4/6 maka nilai m/k adalah.....</p>', '<p>3/8</p>', '<p>6/9</p>', '<p>9/16</p>', '<p>16/9</p>', '<p>1/9</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
