('30ed6db4-da93-4835-9481-a5a8e9c2d78b', '2023-10-20 06:40:54', '2023-10-20 06:40:54', NULL, '00cc482f-6b53-42a2-9045-e1b555bb5d19', NULL, 0, NULL, NULL, NULL, '<p>Azka selalu membeli gulali setiap hari Sabtu, kecuali jika ibu membelikannya es krim.</p>\n<p>Hari ini ibu membelikannya es krim.</p>\n<p>Kesimpulannya...</p>', '<p>Azka mendapatkan gulali dan es krim</p>', '<p>Hari ini bukan hari Sabtu</p>', '<p>Azka tidak membeli es krim</p>', '<p>Azka tidak membeli gulali di hari Sabtu</p>', '<p>Azka mendapatkan es krim meskipun bukan hari Sabtu</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('32c536a6-9995-424a-ae1f-64215b904c3f', '2023-10-14 07:20:19', '2023-10-14 07:20:19', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Menggunakan fasilitas internet untuk kepentingan pribadi adalah hal yang sudang dianggap lumrah meskipun pimpinan selalu mengingatkan larangan atas hal itu. Akan tetapi, sebagian kecil pegawai di kantor saya menggunakan internet untuk kepentingan pribadi ini sudah masuk dalam level mengkhawatirkan yaitu untuk berjualan online. Sikap saya...</p>', '<p>Bersama-sama dengan beberapa orang rekan yang satu pandangan saya mendesak pimpinan untuk mengubah peraturan tersebut</p>', '<p>Saya merasa peraturan dan himbauan berkenaan dengan hal itu akan percuma saja</p>', '<p>Saya tidak akan terlalu mempermasalahkan karena orang lain termasuk pimpinan juga tidak mau ambil pusing</p>', '<p>Saya akan mematuhi peraturan yang ditetapkan dan secara santai mengajak pegawai lain untuk juga mulai mengubah kebiasaan buruknya</p>', '<p>Menemukan solusi agar internet yang digunakan untuk berjualan online tersebut diblok</p>', 1, 2, 3, 5, 4, 0, 1, 4, NULL, 1),
('32fb074f-ad28-489c-b3c9-c0c5538cd446', '2023-10-17 06:08:01', '2023-10-17 06:08:01', NULL, 'b6b3d933-7f1c-4ac1-abf2-14928a6ab49f', NULL, 0, NULL, NULL, NULL, '<p>\"Setiap warga negara berhak dan wajib ikut serta dalam upaya pembelaan negara\" Merupakan bunyi pasal dalam UUD 1945, atau lebih tepatnya terdapat pada...</p>', '<p>Pasal 26 ayat 2</p>', '<p>Pasala 25 ayat 1</p>', '<p>Pasal 24 ayat 2</p>', '<p>Pasal 27 ayat (3)</p>', '<p>Pasal 3 ayat 1</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
