('348b2c5b-4f59-4b09-83d3-7c0bbe9cffdd', '2023-10-17 03:28:30', '2023-10-17 03:28:30', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Anda adalah ketua tim yang menangani pengembangan proyek lapangan di berbagai daerah. Suatu hari, ada anggota tim anda memalsukan data lapangan di daerah X sehingga menyebabkan terhambatnya pengembangan proyek. Hal ini diketahui dari dari laporan anggota tim lainnya. Sikap anda terhadap anggota tim tersebut adalah....</p>', '<p>Menegurnya langsung yang melakukan perbuatan tersebut di depan yang lain agar yang lain dapat mengambil pelajaran</p>', '<p>Memberikan peringatan keras kepada anggota tim yang melakukan perbuatan tersebut setelah terdapat laporan dari anggota tim lainnya.</p>', '<p>Menyelidiki dahulu, jika ternyata laporan tersebut benar, maka anda sebagai ketua tim akan meminta pendapat anggota tim lain untuk mengambil keputusan bersama</p>', '<p>Mengingatkannya agar tidak melakukannya lagi karena semua tim akan menanggung akibatnya</p>', '<p>Menunggu waktu tepat untuk menegur dan menasihatinya agar tidak mengulangi kesalahan tersebut</p>', 3, 2, 5, 4, 1, 0, 1, 3, NULL, 1),
('385d1d22-f9e3-460c-97a0-df2331bd00dd', '2023-10-13 08:25:17', '2023-10-13 08:25:17', NULL, 'e9f84a80-562c-4b59-b70d-8f1c9f4e3b4f', NULL, 0, NULL, NULL, NULL, '<p>Rata-rata berat badan 5 orang anak adalah 60 kg. Jika berat badan anak yang paling ringan adalah 50 kg, berapakah berat anak yang mempunyai berat badan paling besar ?...</p>', '<p>80 kg</p>', '<p>90 kg</p>', '<p>100 kg</p>', '<p>110 kg</p>', '<p>120 kg</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('396478b1-e881-48a0-920f-6528d47f79c0', '2023-10-14 06:39:29', '2023-10-14 06:39:29', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Anda adalah seorang auditor internal di sebuah instansi pemerintah. Anda diminta untuk melakukan pembersihan data yang diterima dari Kementrian Keuangan dan menemukan bukti adanya laporan yang tidak sinkron dengan data keuangan. Dalam aturan, hal ini merupakan pelanggaran. Maka sikap anda....</p>', '<p>Melakukan verifikasi dan validasi data-data penerima ganda di lapangan untuk mencocokkan data yang dianalisis</p>', '<p>Melaporkan temuan ini kepada atasan</p>', '<p>Berkoordinasi dengan pihak Kementrian Keuangan agar data keuangan bisa disesuaikan</p>', '<p>Melakukan perbaikan data laporan keuangan agar kejadian serupa tidak terulang kembali</p>', '<p>Meminta agar pihak pembuat laporan dapat jujur dan melaporkan jika data tidak sinkron</p>', 3, 5, 4, 2, 1, 0, 1, 2, NULL, 1),
('3b42d1e6-7613-40b0-afa3-57ac1591a357', '2023-10-19 07:51:11', '2023-10-19 07:51:11', NULL, '80cec561-fc0b-46c7-aed4-f0ad73061557', NULL, 0, NULL, NULL, NULL, '<p><em>Good money habit</em> adalah fondasi terpenting dalam mencapai kesejahteraan finansial. Unsur utama dalam menjalankan sebuah rencana keuangan adalah kemampuan dan komitmen untuk menabung dan berinvestasi.</p>\n<p>(<em>Make it Happen, Now</em>)</p>\n<p>Makna kata Komitmen dalam paragraf di atas adalah....</p>', '<p>Mewajibkan diri</p>', '<p>Perjanjiian untuk melakukan sesuatu</p>', '<p>Pertempuran</p>', '<p>Juru tafsir</p>', '<p>Bagian yang terpisah</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('3b598954-ebde-4874-a469-8edb2f321ec8', '2023-10-13 08:21:19', '2023-10-13 08:21:19', NULL, 'e9f84a80-562c-4b59-b70d-8f1c9f4e3b4f', NULL, 0, NULL, NULL, NULL, '<p>Seorang siswa telah mengikuti tes sebanyak n kali dan memperoleh nilai rata-rata 80. Berapa nilai yang harus dia peroleh pada tes selanjutnya agar nilai rata-rata menjadi 82 ?</p>', '<p>2n - 82</p>', '<p>n + 82</p>', '<p>2n + 82</p>', '<p>2n + 80</p>', '<p>2n - 80</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('3b8cbf32-3aef-4cb0-8381-8f2ab397d761', '2023-10-19 07:37:15', '2023-10-19 07:37:15', NULL, '80cec561-fc0b-46c7-aed4-f0ad73061557', NULL, 0, NULL, NULL, NULL, '<p>Dalam seleksi CPNS 2019, Aldo ditawari bantuan oleh seseorang yang mengaku bisa membuat Aldo lulus menjadi CPNS dengan syarat harus memberikan sejumlah uang. Karena sangat menginginkan agar menjadi PNS dan agar lebih percaya diri saatbertemu dengan calon mertua. Aldo akhirnya tergiur dengan tawaran tersebut tanpa ragu memberikan uang yang dipersyaratkan agar lolos. Sikap Aldo adalah merupakan pelanggaran terhadap Pancasila khususnya sila ke.....</p>', '<p>Satu</p>', '<p>Dua</p>', '<p>Tiga</p>', '<p>Empat</p>', '<p>Lima</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
