('3f2f84d7-35b4-4b2a-abad-2c071eec9a03', '2023-10-17 04:46:03', '2023-10-17 04:46:03', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Anda akan melakukan audit di sekolah yang lokasinya cukup jauh dan hanya bisa ditempuh dengan jalur darat. Di tengah perjalanan, mobil yang anda bawa mengalami kecelakaan padahal mobil tersebut adalah mobil pinjaman. Untuk memperbaiki mobil tersebut anda harus mengeluarkan uang yang tidak sedikit. Setelah mobil di servis dengan menunggu 3 jam lamanya, anda kembali melanjutkan perjalanan. Ketika anda sudah menyelesaikan tugas audit anda di sekolah, kepala sekolah memberikan sejumlah uang. Sikap anda sebaiknya....</p>', '<p>Menerima uang transport tersebut jika tidak diketahui oleh rekan tim yang lain</p>', '<p>Mengembalikan uang transport secara tegas dan halus</p>', '<p>Menolak karena anda tahu itu bentuk-gratifikasi</p>', '<p>Menolak karena disuruh atasan untuk bekerja dengan jujur dan bebas KKN</p>', '<p>Marah karena kepala sekolah telah berusaha menyogok anda</p>', 1, 4, 5, 3, 2, 0, 1, 3, NULL, 1),
