('414f2721-1fa1-4db8-a838-536341eda285', '2023-10-18 05:35:39', '2023-10-18 05:35:39', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Saya mendapatkan beasiswa untuk melanjutkan pendidikan diluar kota. Namun periode beasiswa tersebut bentrok dengan acara pernikahan saya. Maka saya&hellip;</p>', '<p>mengambil beasiswa tersebut namun saya meminta izin ketika menjelang pernikahan saya untuk tidak mengikuti perkuliahan</p>', '<p>menunda beasiswa tersebut demi acara pernikahan anda</p>', '<p>menolak beasiswa tersebut karena acara pernikahan lebih penting</p>', '<p>mengambil beasiswa tersebut dan menunda acara pernikahan</p>', '<p>mengambil beasiswa tersebut dan membatalkan acara pernikahan</p>', 5, 2, 1, 4, 3, 0, 1, 1, NULL, 1),
