('4281f8a0-5bc7-47b8-bc81-44d6494275c3', '2023-10-13 07:58:55', '2023-10-13 07:58:55', NULL, 'e9f84a80-562c-4b59-b70d-8f1c9f4e3b4f', NULL, 0, NULL, NULL, NULL, '<p>Sebuah bola dilempar ke atas dengan ketinggian 1,2 m. Setelah menyentuh tanah bola memantul kembali setinggi dari tinggi semula. Jika pantulan selanjutnya juga memenuhi &nbsp;dari tinggi pantulan sebelumnya, maka tinggi pantulan bola setelah enam kali menyentuh tanah adalah...cm</p>', '<p>22</p>', '<p>21,36</p>', '<p>24</p>', '<p>25,70</p>', '<p>26</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('4308dc05-60c0-45fb-8eb7-2d654d6b4d89', '2023-10-20 07:20:48', '2023-10-20 07:27:02', NULL, '00cc482f-6b53-42a2-9045-e1b555bb5d19', NULL, 0, NULL, NULL, NULL, '<p>Ibu membeli baju untuk Nuri seharga Rp 235.000 yang mendapatkan diskon 4%. Ibu juga membelikan Deni sepatu baru dengan diskon 2%. Jika jumlah keseluruhan yang harus dibayar ibu adalah Rp545.080, berapakah harga beli sepatu milik Deni?</p>', '<p>Rp 494.000</p>', '<p>Rp 645.000</p>', '<p>Rp 159.200</p>', '<p>Rp 326.000</p>', '<p>Rp 322.000</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('435de615-dbe3-4d1e-be37-586495916abf', '2023-10-26 07:00:04', '2023-10-26 07:00:04', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Anda sebagai sekretaris direktur perusahaan swasta dituntut untuk paham segala aplikasi teknologi yang digunakan di perusahaan anda berkerja. Tim IT perusahaan mengembangkan aplikasi yang merupakan terobosan terbaru untuk membantu tim marketing perusahaan anda bekerja, sikap anda adalah......</p>', '<p>Membantu tim IT untuk membuat terobosan terbaru aplikasi untuk perusahaan meskipun diminta</p>', '<p>Memberikan kontribusi ide untuk pengembangan aplikasi</p>', '<p>Mempelajari aplikasi terbaru yang dibuat tim IT sebelum diserahkan kepada tim marketing</p>', '<p>Membiarkan tim IT membuat terobosan aplikasi terbaru hingga selesai dan mempelajari bersama tim marketing cara penggunaan aplikasi tersebut</p>', '<p>Ikut mendukung ide tim untuk membuat terobosan aplikasi terbaru</p>', 1, 3, 4, 5, 2, 0, 1, 4, NULL, 1),
('438c4a89-1fa1-4769-84d1-d07415067d92', '2023-10-16 08:58:43', '2023-10-16 08:58:43', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p><img src=\"/../storage/upload_files/questions/20231016035541Soal 64.jpg\" alt=\"\" width=\"440\" height=\"242\" /></p>', '<p>Gambar A</p>', '<p>Gambar B</p>', '<p>Gambar C</p>', '<p>Gambar D</p>', '<p>Gambar E</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('44ee46dd-ef0c-4275-a7d0-d74d63a17191', '2023-10-17 08:33:32', '2023-10-17 08:33:32', NULL, 'b6b3d933-7f1c-4ac1-abf2-14928a6ab49f', NULL, 0, NULL, NULL, NULL, '<p>\"Mangga yang dijual di kios itu besar-besar\". Kata ulang yang semakna dengan kata ulang di atas adalah &hellip;</p>', '<p>Karena bangun kesiangan, Ardi berangkat tergesa-gesa</p>', '<p>Karyawan di kantor ini rajin-rajin dalam bekerja</p>', '<p>Sebagai sesama ciptaan Tuhan, kita harus hormat-menghormati</p>', '<p>Doni menahan-nahan sakitnya karena jatuh dari motor</p>', '<p>Anak itu menangis sambil menarik-narik bajunya</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('454c82d6-1146-4100-b44c-d9d31a04963b', '2023-10-17 05:08:48', '2023-10-17 05:08:48', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Suatu hari salah satu pemuda suku sunda diperas oleh beberapa orang pemuda dari suku jawa. Setelah itu, pemuda tersebut pulang danmenceritakan kejadian tersebut kepada pemuda dari sukunya. Mendengar cerita tersebut, para pemuda suku sunda tidak terima. Mereka pun membuat perhitungan dengan para pemuda suku jawa. Konflik tersebut menyebabkan beberapa rumah suku jawa hangus terbakar. Untuk menyelesaikan konflik tersebut, Anda sebagai pemimpin kedua suku tersebut akan..</p>', '<p>Menumbuhkembangkan toleransi antarsuku</p>', '<p>Melakukan penyuluhan kepada kedua suku</p>', '<p>Memerintahkan saja aparat di bawah untuk mengamankan</p>', '<p>Memberikan vonis terhadap kedua suku</p>', '<p>Mengadakan rekonsiliasi antar suku</p>', 4, 3, 2, 1, 5, 0, 1, 5, NULL, 1),
('459cce29-f07b-454f-8509-8cf4acc0bae8', '2023-10-13 03:53:21', '2023-10-13 03:53:21', NULL, 'dfcc80d7-7e2f-4c19-88cc-d69371bbee12', NULL, 0, NULL, NULL, NULL, '<p>Munculnya nasionalisme dipengaruhi oleh hal-hal berikut, kecuali....</p>', '<p>Piagam Bill of Right</p>', '<p>Revolusi Prancis</p>', '<p>Magna Charta</p>', '<p>Revolusi Cina</p>', '<p>Renaissance</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('45dd344c-2383-42ef-a629-98074d782c44', '2023-10-13 09:40:12', '2023-10-13 09:44:05', NULL, 'e9f84a80-562c-4b59-b70d-8f1c9f4e3b4f', NULL, 0, NULL, NULL, NULL, '<p>Hari akan melakukan perjalanan dari Yogyakarta ke Banjarmasin, Kalimantan Selatan. Perjalan dari rumah ke bandara Yogyakarta memakan waktu 45 menit. Karena ada sedikit gangguan teknis di bandara, ia harus menunggu selama 1,75 jam. Perjalanan dari Yogyakarta ke Banjarmasin memerlukan waktu 1,5 jam menggunakan pesawat. Jika Hari berangkat dari rumah pada pukul 05.12 WIB, maka ia akan tiba di Banjarmasin pada pukul&hellip; WIB.</p>', '<p>08.12</p>', '<p>08.30</p>', '<p>08.36</p>', '<p>08.42</p>', '<p>09.12</p>', 0, 0, 0, 0, 0, 0, 1, 5, NULL, 1),
('46b5b798-cdc7-4fdd-b385-1f452bd99728', '2023-10-16 08:06:10', '2023-10-16 08:06:10', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p>Rumah Andra berjarak 1,5 km dari kantornya. Bila berjalan rata-rata 4,5 km per jam. Berapa jam yang dibutuhkan untuk berjalan pulang pergi selama 1 minggu bila ia bekerja dari Senin sampai Sabtu dan tidak pernah makan siang di rumah pada hari kerja?</p>', '<p>4 jam</p>', '<p>8 jam</p>', '<p>5 jam</p>', '<p>6 jam</p>', '<p>7 jam</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('4742991f-d698-47ae-9eb5-06853679afb0', '2023-10-17 07:37:38', '2023-10-17 07:37:38', NULL, 'b6b3d933-7f1c-4ac1-abf2-14928a6ab49f', NULL, 0, NULL, NULL, NULL, '<p>Sikap dan perilaku warga negara yang dijiwai oleh kecintaannya kepada Negara dan Undang-Undang Dasar 1945 dalam menjalin kelangsungan hidup bangsa dan negara adalah pengertian dari...</p>', '<p>Cinta tanah air</p>', '<p>Bela negara</p>', '<p>Integritas</p>', '<p>Nasionalisme</p>', '<p>Patriotisme</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('47b4911f-2250-40af-b409-682bb486a820', '2023-10-14 05:14:20', '2023-10-14 05:14:20', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Sebagai seorang mahasiswa anda mendapat tugas meneliti kehidupan masyarakat suku Samin di daerah Blora, Jawa Tengah. Selama penelitian Anda harus tinggal disana selama kurang lebih dua bulan. Dalam proses penelitiannya setiap hari anda diwajibkan mengikuti cara hidup suku Samin. Anda harus mengenakan pakaian hitam, makan makanan olahan masyarakat sendiri dan berbagai aturan lainnya. Sikap yang anda tunjukkan.......</p>', '<p>Mengabaikan aturan karena tidak sependapat</p>', '<p>Tidak mematuhi aturan karena berbeda suku bangsa</p>', '<p>Mengubah aturan karena anda lebih pandai dari masyarakat suku</p>', '<p>Menghormati dan memenuhi aturan karena setiap suku memiliki perbedaan pedoman</p>', '<p>Menghormati dan mematuhi aturan kepala suku dengan mengusulkan kepada kepala suku budaya-budaya apa saja yang sebaiknya dihilangkan karena berbeda adat dengan anda</p>', 2, 1, 3, 5, 4, 0, 1, 4, NULL, 1),
('47e37c80-5de6-4af0-be0e-c9a0e794623d', '2023-10-18 05:45:34', '2023-10-18 05:45:34', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Suatu rapat yang akan akan anda ikuti tidak dihadiri ketua. Sehingga jalannya rapat menjadi tidak terarah. Sebagai wakil yang ditunjuk atasan yang akan anda lakukan...</p>', '<p>Tetap menjalani rapat sesuai jadwal</p>', '<p>Mencatat semua hasil rapat dan melaporkan pada atasan</p>', '<p>Memandu anggota rapat sesuai agenda yang dijadwalkan. Sehingga menghasilkan suatu keputusan yang diharapkan</p>', '<p>Menjalankan tugas tersebut sebatas kemampuan dan kapasitas anda</p>', '<p>Memimpin rapat dengan penuh tanggung jawab</p>', 1, 3, 5, 4, 2, 0, 1, 3, NULL, 1),
('481b987e-baa4-41a6-ab5b-4f8ed5158626', '2023-10-18 08:42:28', '2023-10-18 08:42:28', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Ketika anda pulang dari kantor, anda naik angkutan umum, kemudian di jalan ada segerombolan orang yang melakukan aksi demo dikarenakan tidak setuju dengan diberlakukannya PPKM, bagaimana sikap anda&hellip;</p>', '<p>Mengikutinya karena usaha saya juga bangkrut karena adanya PPKM</p>', '<p>Mengompori pendemo dengan melakukan aksi yang lebih tragis</p>', '<p>Berpendapat bahwa demo merupakan tindakan yang buang-buang waktu</p>', '<p>Kesal dengan tindakan pendemo karena banyak jalan jadi macet</p>', '<p>Aspirasi boleh saja namun tidak sampai merusak lingkungan</p>', 3, 1, 4, 2, 5, 0, 1, 5, NULL, 1),
('485cc86e-7a95-4131-92cb-99bd3857ccb4', '2023-10-14 04:38:22', '2023-10-14 04:38:22', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Indonesia dikenal sebagai negara yang penuh keragaman budaya, bahasa, adat istiadat dan kepercayaan. Di perusahaan anda terdiri dari berbagai ragam budaya, banyak karyawan muslim mengeluhkan sulitnya beribadah karena sering tidak ada waktu khusus untuk menjalankan ibadah karena mereka harus tetap bekerja. Sikap anda sebagai salah satu karyawan muslim di perusahaan tersebut ...</p>', '<p>Mendiskusikan hal ini dalam rapat umum perusahaan sehingga tercapai solusi terbaik bagi semua pihak</p>', '<p>Mengajak teman-teman sejawat untuk mengajukan protes dan perbaikan kebijakan</p>', '<p>Meminta perusahaan untuk mengubah kebijakannya agar dapat memfasilitasi para karyawan untuk beribadah</p>', '<p>Tetap bertahan dengan kebijakan yang ada dan mencoba untuk mencuri waktu menjalankan ibadah</p>', '<p>Membantu rekan-rekan untuk mengerjakan tugas mereka sehingga mereka dapat beribadah di tengah kesibukan kerja</p>', 5, 1, 4, 3, 2, 0, 1, 1, NULL, 1),
('489590b5-9533-48a9-89f6-97ce04624d0a', '2023-10-17 03:45:24', '2023-10-17 03:45:24', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Anda adalah anggota karang taruna dilingkungan tempat anda tinggal. Salah satu kegiatan karang taruna tahunan adalah melakukan rekreasi wisata pemuda. Namun kegiatan ini batal dilakukan karena kekurangan dana untuk melaksanakannya. Diadakanlah rapat bulanan untuk membahas solusi permasalahan dari kekurangan dana supaya acara tahunan tersebut dapat dilaksanakan tahun ini. Apa usulan yang akan anda ajukan?</p>', '<p>Membatalkan saja acara rekreasi wisata pemuda karena tidak semua orang mau berpartisipasi di acara tersebut</p>', '<p>Meminta anggota karang taruna untuk mengadakan acara dana usaha dan menggalangkan iuran dari warga sekitar untuk mendapatkan dana tambahan agar kegiatan tersebut dapat dilaksanakan</p>', '<p>Mengusulkan untuk menggunakan dana desa yang diberikan pemerintah untuk menutupi kekurangan dana kegiatan rekreasi wisata pemuda</p>', '<p>Mengusulkan untuk menghapus saja kegiatan karang taruna tahunan tersebut karena membutuhkan dana yang tidak sedikit</p>', '<p>Mengusulkan kegiatan tahunan lain yang lebih bermanfaat bukan hanya sekedar rekreasi wisata saja</p>', 4, 5, 1, 2, 3, 0, 1, 2, NULL, 1),
('491bd9a5-e626-43d1-9298-e2957e4befe9', '2023-10-18 05:47:56', '2023-10-18 05:47:56', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Dalam sebuah kelompok setiap anggota diwajibkan untuk menyampaikan opini dan gagasannya terhadap proyek yang sedang dijalankan. Opini dan gagasan ini digunakan untuk membantu membangun kinerja dalam rangka mencapai tujuan bersama. Opini yang dilarang untuk disampaikan adalah opini yang bertemakan.....</p>', '<p>Berbagai hal yang dapat menyinggung orang lain</p>', '<p>Berbagi hal yang mengancam keutuhan kelompok</p>', '<p>Berbagai hal yang bertemakan SARA</p>', '<p>Opini yang mengandung unsur dendam pribadi</p>', '<p>Opini yang berusaha menghadirkan suasana humoris</p>', 2, 5, 4, 3, 1, 0, 1, 2, NULL, 1),
('4982cf60-8a19-4cd1-9d95-3b0d9bd56162', '2023-10-16 05:28:21', '2023-10-16 05:28:21', NULL, '7353afdf-8c22-4e71-a553-90921b9692ab', NULL, 0, NULL, NULL, NULL, '<p>Sejak awal memasuki bangku kuliah, Natasya Oktafisa memang memiliki target untuk lulus cepat. Dengan usahanya yang maksimal, lulusan ilmu hukum (FIB) Unpad ini berhasil meraih gelar sarjana dalam waktu 2 tahun 11 bulan. Penulisan nama dan gelar Natasya Oktafisa yang tepat adalah....</p>', '<p>Natasya Oktafisa, S.H</p>', '<p>Natasya oktafisa, S.H</p>', '<p>Natasya Oktafisa, SH</p>', '<p>Natasya Oktafisa S.H</p>', '<p>Natasya Oktafisa SH</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('49c3145b-27ce-40a9-a3ca-0932d802ea79', '2023-10-16 04:34:43', '2023-10-16 04:34:43', NULL, '7353afdf-8c22-4e71-a553-90921b9692ab', NULL, 0, NULL, NULL, NULL, '<p>Baik buruknya perilaku seorang pegawai ASN maupun penyelenggara negara dalam menjalankan tugas dan wewenangnya dapat dilihat dari 2 aspek yaitu ....</p>', '<p>Integritas dan komitmen</p>', '<p>Kinerja dan komitmen</p>', '<p>Prestasi dan integritas</p>', '<p>Etika dan perilaku</p>', '<p>Norma dan etika</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('4a970513-a614-49b4-bc3c-c87dc025ff19', '2023-10-17 03:11:58', '2023-10-17 03:11:58', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Anda bekerja di kantor pemerintah daerah yang bertugas dalam penyaluran bantuan. Agar bantuan dapat disalurkan dengan tepat, anda diminta melakukan survey lapangan ke beberapa wilayah. Dalam waktu dua minggu survey harus sudah selesai sedangkan wilayah yang akan diamati cukup luas. Apa yang anda lakukan...</p>', '<p>Mengajak petugas yang ada di wilayah untuk bekerjasama menyelesaikan survey</p>', '<p>Melaksanakan survey sendirian sesuai perintah</p>', '<p>Meminta bantuan beberapa teman yang saya percaya untuk menyelesaikan survey</p>', '<p>Membuat laporan hasil survey secara asal-asalan tanpa datang ke wilayah</p>', '<p>Membuat laporan hasil survey berdasarkan data hasil survey tahun lalu</p>', 5, 4, 3, 1, 2, 0, 1, 1, NULL, 1),
('4ab64cb1-7530-46f7-ae6b-76ef8308318f', '2023-10-17 04:40:52', '2023-10-17 04:40:52', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Di tengah mengerjakan sebuah tugas yang cukup penting, Ibu saya mengirimkan pesan melalui aplikasi whatsapp tentang kondisi perasaannya yang tidak enak. Sikap saya adalah....</p>', '<p>Sebagai seorang anak dan ASN yang baik saya akan membalas pesan dari ibu saya hingga persoalannya teratasi sementara waktu</p>', '<p>Melanjutkan tugas saya dan tidak membuka pesan yang dikirimkan kepada saya</p>', '<p>Saya berusaha secepatnya menyelesaikan tugas agar bisa tenang membaca serta membalas pesan dari ibu saya</p>', '<p>Membaca dan meminta ibu saya untuk menuliskan semua yang ingin beliau sampaikan agar nanti bisa saya balas dengan seksama</p>', '<p>Terus mengerjakan tugas dan sesekali membalas pesan dari ibu pada poin-poin pokok masalahnya</p>', 2, 1, 4, 3, 5, 0, 1, 5, NULL, 1),
('4ad96b2e-c209-4efa-8cae-d7d94de76801', '2023-10-16 07:04:42', '2023-10-16 07:04:42', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p>Tidak semua anak sekolah suka berbohong kepada orangtuanya bahwa dia telah mengerjakan PR.</p>\n<p>Tata adalah seorang anak yang jujur dalam semua hal dan kepada siapapun, kecuali kepada neneknya.</p>\n<p>Kebohongan Tata tersebut adalah sering mengatakan bahwa nenek masih terlihat cantik.</p>\n<p>Kesimpulan yang tepat adalah...</p>', '<p>Tata sangat disayangi kedua orangtuanya karena selalu bersikap jujur</p>', '<p>Kepada kakaknya, Tata mengatakan belum mengerjakan PR bila memang belum</p>', '<p>Tata hampir selalu jujur pada kedua orangtuanya jika telah mengerjakan PR</p>', '<p>Tata pernah membohongi pamannya mengenai PR</p>', '<p>Nenek Tata masih terlihat cantik</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('4ba04bf5-ae77-40ce-bfab-dad9a040994d', '2023-10-17 08:48:57', '2023-10-17 08:48:57', NULL, 'b6b3d933-7f1c-4ac1-abf2-14928a6ab49f', NULL, 0, NULL, NULL, NULL, '<p>Kata baku terdapat dalam kalimat...</p>', '<p>Bajunya terbuat dari kain sutra</p>', '<p>Tempellah perangko di sudut kanan atas</p>', '<p>Saya berani menanggung risiko apa saja</p>', '<p>Dia harus berfikir jernih dalam menyelesaikan masalah itu</p>', '<p>Mereka sedang mentelaah puisi karya W.S. Rendra</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('4bb72ea5-f35e-4e6a-b393-cfe62f4f1490', '2023-10-13 08:27:06', '2023-10-13 08:27:06', NULL, 'e9f84a80-562c-4b59-b70d-8f1c9f4e3b4f', NULL, 0, NULL, NULL, NULL, '<p>Amin berangkat dari Magelang ke Jepara pukul 08.15 dengan kecepatan rata-rata 40 km per jam. Pada waktu bersamaan Meli berangkat dari Jepara menuju Magelang dengan kecepatan rata-rata 45 km per jam. Bila jarak Magelang ke Jepara 255 km, Amin dan Meli berpapasan di jalan pukul....</p>', '<p>10.24</p>', '<p>10.54</p>', '<p>11.32</p>', '<p>11.15</p>', '<p>11.08</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('4bd77001-9c37-472f-8f87-27fc3b8276d8', '2023-10-16 08:44:03', '2023-10-16 08:44:03', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p><img src=\"/../storage/upload_files/questions/20231016034102soal 61.jpg\" alt=\"\" width=\"309\" height=\"217\" /></p>', '<p>Gambar A</p>', '<p>Gambar B</p>', '<p>Gambar C</p>', '<p>Gambar D</p>', '<p>Gambar E</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('4d4bd30a-c321-4074-8e8d-87469bfbb199', '2023-10-20 07:53:09', '2023-10-20 07:53:09', NULL, '00cc482f-6b53-42a2-9045-e1b555bb5d19', NULL, 0, NULL, NULL, NULL, '<p>Keluarga Rama akan pergi ke restoran untuk makan bersama. Keluarga Rama terdiri dari Rama, istri Rama, dan 3 anaknya. Jika di restoran tersebut mejanya berbentuk bundar, maka ada berapa banyak urutan tempat duduk bila Rama dan istrinya harus berdempetan?</p>', '<p>3</p>', '<p>8</p>', '<p>10</p>', '<p>12</p>', '<p>16</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('4d4d7c83-9073-4165-889a-7c6ee8576e79', '2023-10-26 06:25:10', '2023-10-26 06:25:10', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Anda bekerja sebagai karyawan di karyawan di salah satu perusahaan terbesar di kota anda sangat banyak karyawan yang berkerja di sana. Kondisi kerja yang paling anda harapkan dari lingkungan kantor anda adalah kondisi yang.....</p>', '<p>Menghasilkan pendapatan tambahan bagi anda</p>', '<p>Memotivasi anda untuk berkerja lebih giat</p>', '<p>Memberi kesempatan kepada anda untuk mengaktualisasikan diri</p>', '<p>Memberi kemungkinan promosi jabatan bagi anda</p>', '<p>Menyediakan stabilitas pekerjaan kepada anda</p>', 1, 5, 4, 2, 3, 0, 1, 2, NULL, 1),
('4e9b7370-4c01-4d93-a08f-499e696b9bf5', '2023-10-13 03:57:18', '2023-10-13 03:57:18', NULL, 'dfcc80d7-7e2f-4c19-88cc-d69371bbee12', NULL, 0, NULL, NULL, NULL, '<p>Globalisasi berkembang sangat cepat sehingga mempengaruhi bidang kehidupan masyarakat multikultural sehingga menimbulkan disintegrasi bangsa dan berdampak pada...</p>', '<p>Ketimpangan ekonomi</p>', '<p>Perbedaan gaya hidup</p>', '<p>Meningkatnya urbanisasi</p>', '<p>Munculnya konflik sosial.</p>', '<p>Melemahnya idealisme primordialisme</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('4f8cc27b-6830-430d-9bef-4e59d0beac19', '2023-10-16 08:08:35', '2023-10-16 08:08:35', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p>Hasil dari 4,8 x 44 + 1,7 x 26 + 44 x 1,7 + 26 x 4,8 = ...</p>', '<p>492</p>', '<p>455</p>', '<p>573</p>', '<p>542</p>', '<p>679</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('51ad56fe-aa7a-446b-b16e-8516f594cc48', '2023-10-14 03:59:15', '2023-10-14 03:59:15', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Belakangan di kampung anda sedang marak terjadi pembegalan. Untuk menghindari jatuhnya korban, pak RT meminta warga untuk tidak keluar rumah setelah jam 9 malam dan diadakan ronda bergilir. Saat anda melakukan ronda, anda melihat sekelompok anak muda sedang duduk-duduk di warung padahal waktu sudah pukul 10 malam. Sikap anda...</p>', '<p>Membiarkan saja karena jumlah mereka banyak jadi akan aman dari pembegalan</p>', '<p>Memfoto kemudian mengirimkan foto ke pak RT agar ditegur</p>', '<p>Menegur para pemuda dan meminta mereka untuk segera pulang ke rumah masing-masin</p>', '<p>Pura-pura tidak tahu karena saya tidak terlalu mengenal para pemuda tersebut</p>', '<p>Memarahi mereka karena tidak mau mengikuti aturan dari pak RT</p>\n<p>&nbsp;</p>', 1, 3, 5, 2, 4, 0, 1, 3, NULL, 1),
('51d6b01c-ce33-45a6-99af-5e039e07b4f4', '2023-10-16 07:27:17', '2023-10-16 07:27:17', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p>Seorang mahasiswa X harus mengerjakan sebuah essai dengan aturan sebagai berikut:</p>\n<p>- Soal 2 hanya boleh dikerjakan bersama soal 3</p>\n<p>- Soal 1 hanya boleh dikerjakan jika soal 5 tidak dikerjakan</p>\n<p>- Soal 2 tidak boleh dikerjakan jika soal 4 dikerjakan</p>\n<p>-Soal 5 hanya boleh dikerjakan bersama soal 6</p>\n<p>Jika mahasiswa tersebut harus memilih 3 soal dan tidak boleh mengerjakan soal 4, maka dia hanya boleh mengerjakan soal.</p>', '<p>1, 2, dan 3</p>', '<p>1, 5, dan 6</p>', '<p>2, 3, dan 5</p>', '<p>2, 5 dan 6</p>', '<p>3, 5, dan 6</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('53380f62-de93-4ae7-bada-21fa612ee7c5', '2023-10-17 03:52:12', '2023-10-17 03:52:12', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Warga perumahan tempat anda tinggal mengadakan siskamling secara bergiliran. Sementara jadwal harian anda padat sehingga kadang anda sampai rumah sudah larut malam. Sikap anda adalah....</p>', '<p>Meminta tetangga menggantikan jadwal anda dan memberikan kompensasi jika anda tidak bisa ikut siskamling</p>', '<p>Membayar denda karena tidak mengikuti jadwal siskamling</p>', '<p>Meminta jadwal siskamling di hari anda tidak sibuk</p>', '<p>Berusaha menepati jadwal siskamling yang telah ditentukan dengan mengatur jadwal harian anda</p>', '<p>Ikut jadwal siskamling yang anda bisa meskipun bukan jadwal anda</p>', 2, 1, 4, 5, 3, 0, 1, 4, NULL, 1),
('553502f1-68dc-46c3-91a3-5cd55ffca98d', '2023-10-14 07:41:14', '2023-10-14 07:41:14', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Di zaman ini banyak muncul pekerjaan - pekerjaan baru yang tidak pernah dipikirkan atau ada sebelumnya yang bahkan dapat menghasilkan pendapatan lebih banyak dari pada bekerja di kantor seperti gamer professional, youtuber, selebgram tetapi pandangan masyarakat terutama generasi tua mengenai hal tersebut masih dianggap hal yang negatif apalagi jika melihat anaknya menggunakan gadget sepanjang hari padahal belum tentu yang dilakukan anaknya negatif. Hal tersebut karena banyak pemberitaan negatif mengenai dampak buruk penggunaan gadget dan teknologi yang tidak tepat, sikap anda?...</p>', '<p>Mendukung penggunaan gadget dan kemajuan teknologi selama tidak berlebihan dan tentunya bermanfaat serta terkontrol</p>', '<p>Mengawasi penggunaan gadget pada anak</p>', '<p>Membebaskan penggunaan gadget dan teknologi sebebas - bebasnya untuk mengembangkan diri</p>', '<p>Membatasi penggunaan gadget dan teknologi agar tidak kecanduan</p>', '<p>Menggunakan gadget dan teknologi secukupnya</p>', 5, 2, 1, 4, 3, 0, 1, 1, NULL, 1),
