('5678bc6c-df81-49f3-98c0-daddc1b9880e', '2023-10-18 06:11:00', '2023-10-18 06:11:00', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Beberapa tahun lagi anda akan memasuki usia pensiun dari salah satu instansi pemerintahan tempat anda bekerja selama ini. Tanggung jawab anda untuk mengabdi bagi negara pun telah selesai. Sekarang anda memasuki babak baru dimana tidak lagi terikat dengan pekerjaan dan pengabdian terhadap negara. Hal apa yang akan anda rencanakan untuk selanjutnya ketika waktu itu telah tiba&hellip;</p>', '<p>Saya membuka usaha kecil-kecilan di rumah sambil menghabiskan hari tua saya dengan anak dan cucu cucu saya</p>', '<p>Memiliki tanah di berbagai tempat strategis untuk investasi masa tua saya dan keluarga</p>', '<p>Membuka lapangan kerja buat orang terdekat dan yang membutuhkan pekerjaan karena zaman sekarang sulit</p>', '<p>Memiliki warisan harta yang berguna bagi anak cucu saya kelak ketika waktu tersebut sudah tiba</p>', '<p>Beristirahat saja setiap hari di rumah menikmati hari tua saya bersama keluarga</p>', 5, 4, 3, 2, 1, 0, 1, 1, NULL, 1),
('5734916d-7c14-46de-b54e-28c13092e56b', '2023-10-17 03:30:52', '2023-10-17 03:30:52', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Anda mengikuti program Relawan Mengajar program pemerintah yang mengharuskan anda mengajar di daerah terpencil. Ditempat anda mengajar, masyarakatnya menganut kepercayaan animisme yang sudah mendarah daging dimana setiap satu bulan sekali merekamengadakan pesta penghormatan kepada leluhur. Sikap anda setelah melihat keadaan tersebut adalah.....</p>', '<p>Mengikuti kegiatan pesta tersebut untuk menghormati masyarakat setempat</p>', '<p>Mempelajari kebudayaan masyarakat setempat, selama tidak bertentangan dengan keyakinan anda, maka anda akan mengikuti kegiatan tersebut</p>', '<p>Menghargai dan menghormati kebudayaan masyarakat setempat sebagai kekayaan budaya di Indonesia</p>', '<p>Mengajukan permohonan pindah lokasi mengajar karena kebudayaan setempat tidak baik dengan keyakinan anda</p>', '<p>Meminta izin kepada kepala warga agar tidak mengikuti kegiatan pesta penghormatan leluhur karena tidak sesuai dengan keyakinan anda</p>', 2, 5, 4, 1, 3, 0, 1, 2, NULL, 1),
('577b3af7-19b6-4de7-b40e-739c99ed849b', '2023-10-26 06:37:13', '2023-10-26 06:37:13', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Di era milenium perubahan dunia terjadi dengan cepat, perubahan tersebut merambat dalam kehidupan sehari-hari, maka saya......</p>', '<p>Mengikuti perkembangan teknologi dan media massa</p>', '<p>Mempelajari cara pengoperasian komputer</p>', '<p>Meminta orang tua untuk melengkapi barang-barang elektronik</p>', '<p>Berusaha mempelajari buku pengetahuan yang baru</p>', '<p>Berusaha menguasai keterampilan di bidang teknologi informasi mutakhir</p>', 3, 4, 1, 2, 5, 0, 1, 5, NULL, 1),
('581a8118-9363-4acf-b1d9-1ef70d6a5854', '2023-10-16 05:44:06', '2023-10-16 05:44:06', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p>Bendang : ....</p>', '<p>Benteng</p>', '<p>Sawah</p>', '<p>Saluran air</p>', '<p>Salur</p>', '<p>Sungai</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('5862894a-dfd4-4378-9586-57f3e594c49a', '2023-10-25 04:08:45', '2023-10-25 04:08:45', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Anda sedang bekerja dikantor dan saat itu keadaan kantor sedang ramai dipenuhi tamu. Karena sedang berjalan terburu-buru. Anda tidak sengaja menabrak salah seorang tamu didekat anda kemudian barang yang sedang di bawa terjatuh. Anda langsung meminta maaf. Tetapi ternyata orang tersebut tidak terima dan marah-marah. Tindakan yang sebaiknya Anda ambil.....</p>', '<p>Anda mengajak orang tersebut ke tempat sepi agar tidak menjadi pusat perhatian</p>', '<p>Meninggalkan orang tersebut untuk menghindari masalah berkepanjangan</p>', '<p>Membiarkan saja dia marah-marah didepan umum</p>', '<p>Balas dendam dan mengatakan bahwa kemarahannya tidak pantas ditujukan kepada Anda</p>', '<p>Menjaga perasaan agar tidak terpancing emosi</p>', 4, 3, 2, 1, 5, 0, 1, 5, NULL, 1),
('589c8b60-fbff-4f6e-a8bd-b3d928bf3d0a', '2023-10-26 09:04:58', '2023-10-26 09:04:58', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Setiap tahun dilakukan penilaian kinera untuk dasar usulan kenaikan golongan karyawan dan juga untuk promosi jabatan, setelah nilai di rekap alen manager SDM dokumen peniaian tersebut di masukkan amplop untuk dirahasiakan terlebih dahulu. Anda dipercaya oleh manager anda untuk menyimpan amplop tersebut dikarenakan manager anda mendadak harus cuti. Temandekat anda mencoba mencari tahu apakah dia masuk dalam promosi atau tidak melalui anda, bagaimana sikap anda?</p>', '<p>Saya memberikan obat tersebut kepadanya, karena tidak ada yang tahu</p>', '<p>Saya menjadi ragu-ragu</p>', '<p>Saya berkonsultasi dengan rekan sejawat terlebih dahulu</p>', '<p>Saya langsung menolaknya</p>', '<p>Saya mencoba memberikan penjelasan ke pasien karena tidak berani langsung menolak takut pasien&nbsp;tersinggung</p>', 2, 1, 5, 3, 4, 0, 1, 3, NULL, 1),
('58b491be-acb6-4b10-bea9-ace35d39ea19', '2023-10-16 05:48:24', '2023-10-16 05:48:24', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p>Muradif &gt;&lt;</p>', '<p>SINONIM</p>', '<p>Antonim</p>', '<p>Homonim</p>', '<p>Hiponim</p>', '<p>Jamak</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('59881e2a-b87a-44db-9e59-e534ea5ee7c8', '2023-10-16 09:18:40', '2023-10-16 09:18:40', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Anda merupakan seorang karyawan pada sebuah perusahaan jasa yang bergerak dalam bidang transportasi. Siang ini akan di adakan sebuahdiskusi singkat dengan pimpinan perusahaan. Semua karyawan diminta untuk memberikan usulan terkait peningkatan kualitas pelayanan terhadap pelanggan kedepannya agar banyak dari customer yang memakai jasa perusahaan anda, sikap anda....</p>', '<p>Memberikan usulan jika ingin meningkatkan pelayanan, perusahaan harus memenuhi semua hal yang diinginkan oleh pelanggan tanpa terkecuali</p>', '<p>Mengusulkan adanya jalur khusus untuk ibu hamil dan menyusui dan para lansia</p>', '<p>Mengusulkan agar pada hari libur massal biaya tiket didiskon hingga 50% sehingga banyak dari pelanggan yang akan menggunakan jasa perusahaan anda</p>', '<p>Memberikan usulan agar perusahaan menyediakan fasilitas khusus bagi ibu hamil, menyusui dan lansia</p>', '<p>Menyusulkan agar alat transportasi yang digunakan selalu bersih dengan cara merekrut karyawan baru dengan gaji tinggi</p>', 1, 2, 3, 5, 4, 0, 1, 4, NULL, 1),
