('5b63f8f3-cbdb-40bb-9e4d-d43c2981f7a0', '2023-10-18 04:19:53', '2023-10-18 04:19:53', NULL, '557e3be9-1ea4-45e4-8163-29eb4435e058', NULL, 0, NULL, NULL, NULL, '<p>69, 73, 61, 61, 49, 53, &hellip;, &hellip;, &hellip;, 33</p>', '<p>41, 41, 39</p>', '<p>35, 44, 44</p>', '<p>26, 26, 32</p>', '<p>52, 64, 64</p>', '<p>39, 25, 25</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('5c25fd40-dcde-4343-8970-44f974f93a92', '2023-10-13 07:53:31', '2023-10-13 07:53:31', NULL, 'e9f84a80-562c-4b59-b70d-8f1c9f4e3b4f', NULL, 0, NULL, NULL, NULL, '<p>Enam mahasiswa yaitu A, B, C, D, E, dan F. masing-masing akan presentasi di depan kelas. Masing-masing hanya akan maju ke depan kelas satu kali saja dan sesuai dengan urutan sebagai berikut:</p>\n<ul>\n<li>C akan maju pada urutan keempat atau terakhir</li>\n<li>D akan menjadi pembicara ketiga setelah A</li>\n<li>B akan maju sebelum C</li>\n<li>F akan maju sebelum D</li>\n</ul>\n<p>Manakah dari pernyataan berikut yang benar?</p>', '<p>D akan maju pada urutan ketiga</p>', '<p>A akan maju pada urutan pertama</p>', '<p>F akan maju pada urutan keenam</p>', '<p>E akan maju pada urutan keenam</p>', '<p>B akan maju pada urutan kedua</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('5ce7a4d9-3d55-4a0c-ae96-678ee2843ee8', '2023-10-19 06:55:56', '2023-10-19 06:55:56', NULL, '80cec561-fc0b-46c7-aed4-f0ad73061557', NULL, 0, NULL, NULL, NULL, '<p>Dalam kondisi tidak mendesak atau diperlukan, timnas pencegahan korupsi menyampaikan laporan pelaksanaan stranas PK kepada Presiden secara berkala setiap.....kali</p>', '<p>1 bulan</p>', '<p>6 bulan</p>', '<p>1 tahun</p>', '<p>4 bulan</p>', '<p>3 bulan</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('5f45b503-dc50-4b37-9cb4-61817ca6cd79', '2023-10-14 07:23:55', '2023-10-14 07:23:55', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Atasan di unit kerja saya melakukan mark up laporan keuangan yang dananya digunakan untuk menutupi tagihan rumah sakit orang tuanya. Sikap saya...</p>', '<p>Merasa wajar saja karena hal itu sudah menjadi kebiasaan di banyak kantor</p>', '<p>Langsung melaporkan kepada pihak pimpinan yang berwenang</p>', '<p>Menyadari bahwa kebiasaan mark up adalah sebuah kebiasaan yang buruk</p>', '<p>Berusaha tidak terlibat dalam persoalan mark up tersebut dan berusaha mengingatkan orang tersebut</p>', '<p>Berdoa di dalam hati agar keburukan menjauh dari hidup saya</p>', 1, 4, 2, 5, 3, 0, 1, 4, NULL, 1),
('5f7c57f3-f763-4057-8795-817bbf6ea94e', '2023-10-17 04:18:56', '2023-10-17 04:18:56', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Anda bekerja sebagai seorang karyawan di instansi pemerintahan, hari ini adalah hari terakhir anda bekerja, karena anda sudah mengambil cuti selama seminggu kedepan untuk menjenguk orang tua suami/istri anda yang lagi dilanda musibah. Sebelum cuti anda harus menyelesaikan tugas-tugas penting terlebih dahulu. Namun tiba-tiba anda diajak atasan anda untuk menemaninya ke kantin untuk mengobrol mengenaipekerjaan dan makan di waktu jam kerja. Hal apa yang akan anda lakukan</p>', '<p>Menyetujuinya dan segera langsung ke kantin</p>', '<p>Menyelesaikan tugas-tugas penting terlebih dahulu, baru kemudian bergegas menuju ke kantin memenuhi panggilan atasan</p>', '<p>Menolaknya ke kantin dan mengingatkannya dengan sopan agar menjaga profesionalisme kerja</p>', '<p>Melaporkannya atasan anda kepada Badan Kepegawaian agar mendapat teguran</p>', '<p>Meminta tolong rekan kerja lain untuk menggantikan anda menemani atasan di kantin</p>', 3, 4, 5, 1, 2, 0, 1, 3, NULL, 1),
('5fedf19f-f852-417c-956a-1b907643c681', '2023-10-14 07:15:22', '2023-10-14 07:15:22', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Selama masa pandemi ini, kegiatan belajar mengajar di sekolah Voni dilaksanakan secara daring menggunakan beberapa aplikasi. Hal ini memerlukan ketelitian agar tugas yang dikirimkan tidak tertukar. Voni sebagai ketua kelas sebaiknya..</p>', '<p>Bertanya kepada guru tentang cara penggunaan aplikasi agar dapat mengerjakan tugas kelompok dengan baik</p>', '<p>Meminta seorang guru untuk memberikan tutorial cara penggunaan aplikasi yang dipakai di semua mata pelajaran</p>', '<p>Mempelajari aplikasi- aplikasi tersebut bersama teman yang sudah mahir</p>', '<p>Membaca dan mempelajari tutorial penggunaan aplikasi tersebut agar bisa menggunakan dengan baik dan memudahkan penyelesaian tugas sekolah</p>', '<p>Mempelajari penggunaan aplikasi yang dipakai di mata pelajaran yang memerlukan kecanggihan teknologi</p>', 2, 1, 3, 5, 4, 0, 1, 4, NULL, 1),
('60284b27-c7c9-4525-b61f-78457fa5d960', '2023-10-13 03:47:01', '2023-10-13 03:47:01', NULL, 'dfcc80d7-7e2f-4c19-88cc-d69371bbee12', NULL, 0, NULL, NULL, NULL, '<p>Upaya jangka panjang yang dapat dilakukan untuk mengantisipasi dampak negatif globalisasi terhadap nilai nasionalisme adalah....</p>', '<p>Menggunakan produk kualitas tinggi dari dalam negeri</p>', '<p>Mewujudkan supremasi hukum</p>', '<p>Melaksanakan perintah agama dengan sebaiknya</p>', '<p>Menanamkan dan mengamalkan nilai pancasila dengan sebaiknya</p>', '<p>Selektif terhadap pengaruh globalisasi dalam bidang ekonomi dan sosial budaya</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('606c6eeb-f9fd-4fb4-9892-c1cdb01fb1cb', '2023-10-18 08:48:12', '2023-10-18 08:48:12', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Anda merupakan anak sulung dari delapan bersaudara. Anda merasa memiliki adik yang memiliki suami dari keturunan cina, saat sedang lebaran suami dari adik anda mengikuti acara lebaran, sikap anda....</p>', '<p>Merasa aneh karena dengan mengikuti kegiatan lebaran berarti ia termasuk kaum tersebut</p>', '<p>Tidak menganggap adanya suami dari adik anda</p>', '<p>Terbuka dan menerima kehadiran suami dari adik anda karena telah menghargai nilai yang ada dalam agama keluarga anda</p>', '<p>Menerimanya dan meminta thr agar sebagai bentuk rasa kekeluargaan</p>', '<p>Membuat ia tidak nyaman agar tidak datang lagi saat lebaran</p>', 3, 2, 5, 4, 1, 0, 1, 3, NULL, 1),
('619ca4de-90de-4ad3-9ab1-b34684bbde70', '2023-10-16 09:27:55', '2023-10-16 09:27:55', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Suatu hari ada seorang nasabah yang mengeluhkan program asuransi bank yang dipilihnya tidak sesuai yang diharapkan sehingga marah-marah dan menyalahkan anda. Sikap anda sebagai customer service adalah....</p>', '<p>Memintanya untuk tetap tenang dan sabar karena hal tesebut tidak melanggar kesepakatan yang dibuat</p>', '<p>Memanggil satpam karena tindakan nasabah dapat mengganggu kenyamanan nasabah lain</p>', '<p>Berusaha sebaik mungkin menjelaskan rincian aturan dan program asuransi bank yang telah dipilih nasabah tersebut</p>', '<p>Mencatat dan menyampaikan keluhan nasabah tersebut pada bagian asuransi bank</p>', '<p>Menjelaskan bahwa program asuransi bank yang diambil telah melalui prosedur dan aturan yang berlaku</p>', 3, 1, 4, 5, 2, 0, 1, 4, NULL, 1),
('628ff922-58ed-4c81-a877-fc110cb62a65', '2023-10-18 05:41:28', '2023-10-18 05:41:28', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Anda bekerja sebagai konsultan pendidikan, banyak siswa dan orang tua yang bingung untuk menentukan jurusan. Sebagai konsultan yang handal yang akan anda lakukan...</p>', '<p>Memberikan beberapa alternatif jurusan yang sangat dibutuhkan di dunia kerja</p>', '<p>Menentukan jurusan yang akan memberikan keuntungan masa depan anak</p>', '<p>Menyarankan agar melanjutkan pendidikan keluar negeri</p>', '<p>Memberikan alternatif jurusan sesuai dengan kemampuan siswa dan kemampuan finansial orang tua</p>', '<p>Menentukan jurusan sesuai dengan kemampuan finansial orang tua</p>', 3, 4, 1, 5, 2, 0, 1, 4, NULL, 1),
('6294fbb2-558c-48ed-b7c9-d49d107d2b26', '2023-10-13 08:07:32', '2023-10-13 08:07:32', NULL, 'e9f84a80-562c-4b59-b70d-8f1c9f4e3b4f', NULL, 0, NULL, NULL, NULL, '<p>Umur Budi dibandingkan umur Adit adalah 4:3. Jika selisih umur mereka adalah 9 tahun, maka umur Budi adalah&hellip; tahun</p>', '<p>32</p>', '<p>36</p>', '<p>38</p>', '<p>40</p>', '<p>45</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
