('6364f901-b8d5-4345-a646-ca72283f842c', '2023-10-14 07:18:05', '2023-10-14 07:18:05', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Di dalam perusahaan tempat kamu bekerja diadakan pelatihan tentang teknologi yang baru rilis. Kamu mengetahui bahwa teknologi tersebut tidak ada hubungannya dengan pekerjaan yang kamu emban sedangkan atasanmu memerintahkan untuk ikut, maka tindakan anda adalah....</p>', '<p>Menolak karena bertolak belakang dengan pekerjaan yang saya emban</p>', '<p>Menerimanya dengan senang hati dan ambisius mengikutinya karena atasan akan memuji</p>', '<p>Menerima dan mengikuti pelatihan namun tidak mendengar apa materi pelatihan</p>', '<p>Menerima dan menunjukkan kepada atasan bahwa diri anda patuh dan taat kepada atasan</p>', '<p>Menerima dan mengikuti pelatihan karena berfikir mungkin dapat berguna kedepannya</p>\n<p>&nbsp;</p>', 2, 3, 1, 4, 5, 0, 1, 5, NULL, 1),
('63fe355c-0c3c-4a7d-9fa0-f764ad0394e7', '2023-10-16 07:52:38', '2023-10-16 07:52:38', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p>Untuk membentuk panitia sebuah acara, ada 2 orang calon ketua, 3 orang calon sekretaris, dan 2 orang calon bendahara, serta tidak satu pun yang dicalonkan pada dua jabatan yang berbeda. Jika panitia terdiri dari 1 orang ketua, 1 sekretaris, dan 1 bendahara, maka ada berapa cara susunan panitia tersebut dapat dibentuk?</p>', '<p>18 cara</p>', '<p>16 cara</p>', '<p>12 cara</p>', '<p>8 cara</p>', '<p>10 cara</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
