('64934d15-3e0c-4880-8dd2-022d84ebf2ad', '2023-10-14 04:35:54', '2023-10-14 04:35:54', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Saya dan tim sedang melaksanakan lembur untuk persiapan sebuah acara di instansi saya, akan tetapi salah seorang dari anggota tim tiba-tiba menyatakan akan pulang terlebih dahulu, sikap saya...</p>', '<p>Menyampaikan kepada anggota tim lainnya, apakah akan memberi ijin atau tidak</p>', '<p>Memaksa rekan tersebut untuk tetap tinggal dan mengerjakan apa yang telah menjadi tanggung jawabnya</p>', '<p>Memberikan ijin karena jika dipaksa tetap tinggal juga tidak memberi kontribusi apapun</p>', '<p>Memberikan iming-iming hadiah agar rekan tersebut tetap mau tinggal</p>', '<p>Memberikan nasehat untuk tetap tinggal dan mempertimbangkan keinginannya tersebut</p>', 4, 2, 1, 3, 5, 0, 1, 5, NULL, 1),
('64a3eed2-514f-4387-972d-4a9be295fbc3', '2023-10-19 07:40:18', '2023-10-19 07:40:18', NULL, '80cec561-fc0b-46c7-aed4-f0ad73061557', NULL, 0, NULL, NULL, NULL, '<p>Nasionalisme dalam arti sempit adalah suatu sikap yang meninggikan bangsanya sendiri, sekaligus tidak menghargai bangsa lain sebagaimana mestinya. Sikap seperti ini jelas mencerai beraikan bangsa yang satu dengan bangsa yang lain. Keadaan seperti ini sering disebut......</p>', '<p>Chauvinisme</p>', '<p>Nasionalisme</p>', '<p>Sinkretisme</p>', '<p>Radikalisme</p>', '<p>Religionisme</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
