('6555f16d-ffc9-4688-8e2a-cf3c9bccb112', '2023-10-17 04:12:13', '2023-10-17 04:12:13', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Atasan meminta laporan pertanggung jawaban kegiatan yang dilaksanakan sebelumnya dengan berbasis internet. Padahal anda sudah terbiasa membuat laporan berbasis print out dari hasil ketikan komputer. Sikap anda sebaiknya....</p>', '<p>Tetap membuat laporan berbasis print out karena sudah terbiasa membuat laporan dari hasil ketikan komputer</p>', '<p>Meminta teman untuk membuat laporan pertanggung jawaban dengan aplikasi sesuai petunjuk dari anda</p>', '<p>Belajar membuat laporan pertanggung jawaban melalui aplikasi yang disyaratkan oleh atasan sebisanya</p>', '<p>Meminta kebijakan dari atasan untuk membuat pengecualian terhadap kebiasaan anda membuat laporan pertanggung jawaban menggunakan print out</p>', '<p>Membentuk tim yang sudah ahli untuk membuat laporan pertanggung jawaban dengan aplikasi agar hasilnya lebih bagus</p>', 1, 3, 5, 2, 4, 0, 1, 3, NULL, 1),
('65c40883-2cf7-4d59-a7f1-05555b588ff0', '2023-10-16 07:36:10', '2023-10-16 07:36:10', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p>Sebuah taman berbentuk persegi panjang berukuran panjang 32 m dan lebar 24 m. Di sekeliling taman akan dipasang lampu dengan jarak antarlampu 4 m. Jumlah lampu yang diperlukan sebanyak .....</p>', '<p>120 lampu</p>', '<p>112 lampu</p>', '<p>52 lampu</p>', '<p>28 lampu</p>', '<p>14 lampu</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('65ecf06d-3dd1-4967-9767-1e11f553d790', '2023-10-14 06:42:55', '2023-10-14 06:42:55', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Rina adalah seorang PNS yang memiliki pekerjaan sampingan sebagai selebgram. Anda memiliki cukup banyak followers dan juga haters. Setiap foto atau video yang anda posting mendapatkan pujian dan juga kritikan. Bagaimana sikap Rina menanggapi komentar tersebut.</p>', '<p>Haters akan selalu ada, sehingga harus perlu untuk fokus memberikan konten yang terbaik bagi followers</p>', '<p>Menerima masukan dan kritik yang membangun</p>', '<p>Mengucapkan terima kasih atas segala komentar yang disampaikan dan menerima setiap komentar yang baik</p>', '<p>Menjadikan hal tersebut sebagai masukan agar menjadi pribadi yang lebih baik lagi</p>', '<p>Siap menerima kritikan dan saya jadikan bahan evaluasi untuk saya</p>', 1, 3, 2, 5, 4, 0, 1, 4, NULL, 1),
('65f573f7-449a-4a81-a7b7-1239a888f6cd', '2023-10-17 04:05:22', '2023-10-17 04:05:22', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Anda dulunya karyawan magang di perusahaan X. Lalu anda bekerja di perusahaan Y yang bergerak di bidang yang sama dengan perusahaan X.Di perusahaan Y tempat anda bekerja menggunakan software aplikasi yang menurut anda kurang efisien dibandingkan di perusahaan X tempat anda magang dulu. Menghadapi persoalan ini, maka anda...</p>', '<p>Meminta atasan di perusahaan Y tempat anda sekarang bekerja untuk menggunakan software aplikasi yang sama di perusahaan X karena menurut anda lebih efisien</p>', '<p>Meminta tim IT perusahaan Y untuk membuat software aplikasi yang lebih efisien seperti software aplikasi di perusahaan X</p>', '<p>Memberikan daftar apa saja yang menurut anda tidak efisien di software aplikasi di perusahaan Y tempat anda bekerja dibandingkan software aplikasi perusah&aacute;an X dan menyerahkan kepada tim IT untuk diperbaiki</p>', '<p>Mempelajari penggunaan software aplikasi di perusahaan Y dan tidak membandingkan dengan software aplikasi perusahaan X karena kedua perusahaan itu berbeda</p>', '<p>Mengusulkan kepada pimpinan direksi saat rapat untuk membuat software aplikasi di perusahaan Y lebih efektif dan mengemukakan ide anda bagaimana cara untuk membuat software aplikasi tersebut lebih efisien</p>', 1, 2, 3, 4, 5, 0, 1, 5, NULL, 1),
('667347a9-4458-4119-a7fb-df0548f66577', '2023-10-17 07:48:15', '2023-10-17 07:48:15', NULL, 'b6b3d933-7f1c-4ac1-abf2-14928a6ab49f', NULL, 0, NULL, NULL, NULL, '<p>Berikut ini merupakan nilai-nilai dasar bela negara, <em>kecuali</em>...</p>', '<p>Cinta Tanah Air</p>', '<p>Sadar berbangsa dan bernegara</p>', '<p>Setia kepada Pancasila sebagai ideologi negara</p>', '<p>Rela berkorban untuk bangsa dan negara</p>', '<p>Mempunyai kemampuan yang baik</p>', 0, 0, 0, 0, 0, 0, 1, 5, NULL, 1),
