('691f49e8-1f19-46a8-9fe1-78451cc1c41e', '2023-10-25 06:16:51', '2023-10-25 06:16:51', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Anda merupakan seorang pramusaji pada sebuah restoran. Datang seorang tamu bersama dengan keluarganya untuk makan direstoran anda. Pada saat menu sudah dihidangkan diatas meja dan mulai dinikmati oleh tamu tersebut. Kemudian dia memanggil anda dan komplain jika dia minta agar yang dia pesan dibikin tidak pedas sama sekali, sikap anda.....</p>', '<p>Meminta maaf dan langsung membuatkan menu baru sesuai pesanan</p>', '<p>Minta maaf dan memohon untuk menunggu agar dibuatkan yang baru</p>', '<p>Melaporkan kepada bagian dapur yang bertugas memasak</p>', '<p>Minta maaf dan melaporkan pada bagian dapur</p>', '<p>Minta maaf dan meminta bagian dapur untuk mengganti menu tersebut</p>', 1, 3, 2, 5, 4, 0, 1, 4, NULL, 1),
