('6982f262-640e-46c7-acae-90a66c09b713', '2023-10-19 07:38:28', '2023-10-19 07:38:28', NULL, '80cec561-fc0b-46c7-aed4-f0ad73061557', NULL, 0, NULL, NULL, NULL, '<p>Makna dari wawasan kebangsaan Indonesia yaitu mengamanatkan kepada seluruh bangsa agar menempatkan persatuan dan kesatuan serta kepentingan dan keselamatan bangsa dan negara di atas kepentingan pribadi dan golongan. Kesempatan yg sama untuk berperan demi bangsa, merupakan salah satu dari prinsip wawasan kebangsaan Indonesia yaitu.....</p>', '<p>Pengorbanan</p>', '<p>Kesederajatan</p>', '<p>Kesinambungan</p>', '<p>Kekeluargaan</p>', '<p>Kebersamaan</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('69d2907e-89c1-429c-860b-2773abd2fa8c', '2023-10-13 10:04:36', '2023-10-13 10:04:36', NULL, 'e9f84a80-562c-4b59-b70d-8f1c9f4e3b4f', NULL, 0, NULL, NULL, NULL, '<p>aba abe abi &hellip;&nbsp; &hellip;</p>', '<p>abm dan abq</p>', '<p>abu dan abo</p>', '<p>abe dan adi</p>', '<p>abj dan akj</p>', '<p>abd dan abx</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('6a00f6cb-8b8c-43d2-8d1e-5b21e2334358', '2023-10-13 04:24:13', '2023-10-13 04:24:13', NULL, 'dfcc80d7-7e2f-4c19-88cc-d69371bbee12', NULL, 0, NULL, NULL, NULL, '<p>Untuk membentuk karakter penyelenggara negara yang memiliki sikap kritis, rasional, dan berintegritas tinggi maka dalam hal ini diperlukan adanya..</p>', '<p>Sumpah setia jabatan</p>', '<p>Diklat prajabatan</p>', '<p>Peraturan perundang-undangan</p>', '<p>Seminar kepegawaian</p>', '<p>Kode etik dan kode perilaku</p>', 0, 0, 0, 0, 0, 0, 1, 5, NULL, 1),
('6abaa50a-c036-40e1-9658-8534711a84ea', '2023-10-14 03:54:31', '2023-10-14 03:54:31', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Pagi ini anda datang terburu-buru ke rumah sakit untuk shift pagi anda karena kendaraan yang anda tumpangi mengalami kebocoran ban sehingga anda harus menunggu lama. Saat tiba dirumah sakit anda hampir terlambat absen sidik jari. Saat anda menuju rudng absen, anda melihat seorang bapak-bapak kebingungan mencari ruang perawatan, sementara bagian resepsionis belum hadir. Apa yang anda lakukan?...</p>', '<p>Mengajak bapak itu untuk ikut saya absen sambil bisa menanyakan keperluannya dan mengantarkannya</p>', '<p>Meminta tolong rekan kerja yang lain untuk mengantarkan bapak itu ke ruang perawatan</p>', '<p>Memintanya menunggu resepsionis karena anda terburu-buru absen</p>', '<p>Mengantarnya menuju ruang perawatan baru saya absen</p>', '<p>Segera menuju absen, kemudian menemui bapak itu lagi dan menunjukkan arah ruang perawatan</p>', 2, 3, 4, 1, 5, 0, 1, 5, NULL, 1),
('6acf8956-6e46-47cf-95b6-9c592de21b82', '2023-10-16 04:13:50', '2023-10-16 04:13:50', NULL, '7353afdf-8c22-4e71-a553-90921b9692ab', NULL, 0, NULL, NULL, NULL, '<p>Semangat nasionalisme kaum terpelajar dalam membangun pendidikan skala nasional pada masa pergerakan kemerdekaan di dasarkan pada...</p>', '<p>Lulusan pendidikan tidak dapat diprediksi</p>', '<p>Masyarakat pribumi belum tertarik terhadap pendidikan</p>', '<p>Kolonial Belanda membatasi kesempatan kaum pribumi untuk belajar</p>', '<p>Pendidikan kolonial tidak tergantung pada masyarakat pribumi</p>', '<p>Corak pendidikan nasional berlatar belakang barat dan terbatas</p>', 0, 0, 0, 0, 0, 0, 1, 5, NULL, 1),
('6b0f9207-fd32-452c-9d54-65aaa8d6553c', '2023-10-14 08:22:35', '2023-10-14 08:22:35', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Rekan wanita dalam kelompok kerja anda tidak dipercaya untuk turut serta dalam suatu proyek luar daerah. Ternyata ketika anda mencari tahu kebenarannya, atasan anda menganggap bahwa seorang wanita tidak pantas untuk ikut dalam pekerjaan yang kompleks seperti proyek yang satu ini. Padahal, anda tahu bahwa rekan anda ini jauh lebih kompeten dan berwawasan dibanding anda. Menurut anda.....</p>', '<p>Ini merupakan bentuk ketidakadilan yang perlu di selesaikan</p>', '<p>Memberi tahu pihak atasan bahwa rekan anda ini berkompeten</p>', '<p>Menyebarluaskan hal ini pada media sosial</p>', '<p>Mempertanyakan keputusan atasan itu dan melaporkannya kepada pimpinan perusahaan</p>', '<p>Perlu menggalang suara dari berbagai pihak agar dapat ditindaklanjuti</p>', 4, 5, 1, 3, 2, 0, 1, 2, NULL, 1),
('6ba4112a-785c-4dd6-a4dd-d54d6a5aa70f', '2023-10-26 09:07:59', '2023-10-26 09:07:59', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Disebuah perusahaan anda menjadi ketua tim dalam sebuah kegiatan, kemudian anda diminta memilih anggota tim untuk bekerjasama dengan anda, pertimbangan anda dalam memilih angora tim adalah......</p>', '<p>yang sevisi saja</p>', '<p>yang memiliki latar belakang yang berbeda</p>', '<p>pentingnya pendapat atasan</p>', '<p>yang mau bergabung</p>', '<p>yang mudah bergaul dengan siapa saja</p>', 5, 2, 4, 1, 3, 0, 1, 1, NULL, 1),
('6be39165-5090-4d69-837a-7c43e686a047', '2023-10-13 07:42:59', '2023-10-13 07:42:59', NULL, 'e9f84a80-562c-4b59-b70d-8f1c9f4e3b4f', NULL, 0, NULL, NULL, NULL, '<p>Semua mobil dapat bergerak</p>\n<p>Semua mobil memiliki setir</p>\n<p>Kesimpulannya adalah...</p>', '<p>Ada mobil dapat bergerak dan memiliki setir</p>', '<p>Semua mobil dapat bergerak dan tidak memiliki setir</p>', '<p>Semua mobil tidak dapat bergerak dan memiliki setir</p>', '<p>Semua mobil dapat bergerak dan memiliki setir</p>', '<p>Semua mobil dapat bergerak karena memiliki setir</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('6cb3439c-0a7a-4328-ab07-9478c9ac5e58', '2023-10-14 08:25:36', '2023-10-14 08:25:36', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Terdapat peserta didik yang mengadu kepada guru, bahwa ia selalu melakukan tugas piket kebersihan kelas sendiri. Anggota yang lain tidak mau terlibat membersihkan kelas. Mereka memaksa dan mengancam jika melaporkan tersebut pada wali kelas. Sebagai guru yang mengetahui hal tersebut, apa yang akan Anda lakukan?</p>', '<p>Memberikan hukuman kepada seluruh anggota piket kebersihan karena tidak dapat membangun kerjasama yang baik dalam tugas yang menjadi tanggung jawab</p>', '<p>Guru melakukan evaluasi keterlibatan siswa terkait kegiatan piket kebersihan kelas serta menyampaikan hasilnya agar menjadi perhatian seluruh siswa untuk terlibat dalam tanggung jawab tersebut</p>', '<p>Memberikan teguran kepada siswa yang tidak mau terlibat dalam kegiatan piket kebersihan kelas agar siswa yang rajin tidak terpengaruh dan dia tidak mengulangi perbuatannya</p>', '<p>Merekomendasikan guru BK untuk melakukan konseling kelompok untuk mengajarkan keterampilan bekerjasama dengan orang lain dalam suatu kelompok</p>', '<p>Memfasilitasi pertemuan bersama agar terjadi komunikasi antar anggota kemlompok piket kebersihan sehingga anggira menyadari tugas masing-masing ketika jadwal piket kebersihan kelas berlangsung</p>', 1, 5, 2, 4, 3, 0, 1, 2, NULL, 1),
('700c9e5b-d0a3-4720-a2e3-4f9cfea65243', '2023-10-19 07:47:18', '2023-10-19 07:47:18', NULL, '80cec561-fc0b-46c7-aed4-f0ad73061557', NULL, 0, NULL, NULL, NULL, '<p>Kejahatan genosida adalah setiap perbuatan yang dilakukan dengan maksud untuk menghancurkan atau memusnahkan seluruh atau sebagian kelompok bangsa, ras, etnis, dan agama. Berikut yang merupakan contoh dari kejahatan genosida yaitu.....</p>', '<p>Perampasan kemerdekaan</p>', '<p>Perbudakan</p>', '<p>Pengusiran secara paksa</p>', '<p>Memaksakan tindakan-tindakan yang bertujuan mencegah kelahiran di dalam kelompok</p>', '<p>Penghilangan orang secara paksa</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('71b17e16-2dea-4d96-bb88-dc9d03266d37', '2023-10-18 08:16:21', '2023-10-18 08:16:21', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Terjadi konflik di tempat kerja anda karena atasan anda menyudutkan karyawannya yang selalu terlambat datang ke tempat bekerja, masalah tersebut menyerempet pada penyudutan agama, karena karyawan tersebut berasal dari agama minoritas, bagaimana tanggapan anda....</p>', '<p>menganggap bahwa gejolak antar agama akan selalu ada namun penyudutan terhadap suku tidak dibenarkan sekalipun dilakukan oleh atasan anda</p>', '<p>Ikut membenci suku tersebut karena sudah menjadi fakta bahwa orang yang berasal dari suku tersebut tidak profesional dalam bekerja</p>', '<p>diperlukan agar indonesia mampu akarta a menghilangkan perbedaan agama</p>', '<p>Indonesia perlu mencapai keseragaman agar tidak terjadi justifikasi antar agama karena sangat berpengaruh pada sudutpandang seseorang</p>', '<p>perbedaan agama hanya menimbulkan masyarakat yang bercerai-berai</p>', 5, 1, 4, 2, 3, 0, 1, 1, NULL, 1),
('71e5424a-7214-478c-9ccc-468a3b954365', '2023-10-18 08:33:51', '2023-10-18 08:33:51', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Karena di tempat kerja saya memPHK semua karyawan termasuk saya. Saya terpaksa pindah bekerja di sebuah perusahaan penerbitan buku. Tempat bekerja saya sekarang membuat saya menjadi minoritas, saya lulusan pesantren yang sudah terbiasa dengan nilai dan norma agama yang ketat, namun lingkungan kerja saya rata-rata tidak memiliki agama yang pasti, maka sikap saya&hellip;..</p>', '<p>Menyapa rekan kerja baru dan bersikap sewajarnya saja</p>', '<p>Mengamati lingkungan kerja dan berusaha menyesuaikan diri dengan yang lain</p>', '<p>Menyesal setiap hari karena bekerja di tempat yang menurut saya kotor</p>', '<p>Menghormati satu sama lain dengan terpaksa</p>', '<p>Berusaha bertahan karena memang harus bekerja</p>', 2, 5, 1, 3, 4, 0, 1, 2, NULL, 1),
('71fb8092-2e43-4016-ad27-0009b51d22b0', '2023-10-26 09:12:37', '2023-10-26 09:12:37', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Atasan memberikan sebuah tugas yang sangat penting. Padahal saat itu saya sedang mengalami masalah keluarga yang sangat serius. Saya akan....</p>', '<p>Mengerjakan pekerjaan itu dengan asal-asalan karena konsentrasi saya terbagi</p>', '<p>Menerima dan berusaha menyelesaikan tugas tersebut dengan baik</p>', '<p>Dengan tegas menolak dan merasa marah karena atasan tidak mempedulikan situasi yang saya hadapi</p>', '<p>Menghadap atasan dan meminta untuk memberikan tugas tersebut kepada rekan yang lain</p>', '<p>Menerima tugas tersebut, kemudian meminta tolong kepada teman untuk mengerjakannya</p>', 3, 5, 2, 4, 1, 0, 1, 2, NULL, 1),
('71febd40-f3d9-419e-aed9-7aada9e891e7', '2023-10-17 03:56:48', '2023-10-17 03:56:48', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Anda memiliki keponakan yang masih balita yang sangat ketergantungan dengan smartphone. Hal ini terjadi karena adik anda yang merupakan orangtua dari balita tersebut sangat sibuk dan memberikan anaknya smartphone sebagai hiburannya. Dampaknya keponakan anda menjadi terlambat berbicara dan kurang bisa beradaptasi dengan lingkungan atau teman sebayanya. Menghadapi hal ini, apa yang anda sarankan kepada adik anda?</p>', '<p>Meminta adik anda untuk membawa keponakan anda ke ahli terapi wicara</p>', '<p>Meminta adik anda untuk tidak memberikan keponakan anda smartphone dan mulai membiasakan keponakan anda untuk bertemu dengan teman-teman sebayanya</p>', '<p>Meminta adik anda untuk menyewa pengasuh yang paham cara mengasuh anak dengan benar</p>', '<p>Meminta adik anda untuk membelikan mainan lain dan tidak memberikan keponakan anda smartphone karena usianya masih kecil</p>', '<p>Mengajak adik anda untuk mengikuti seminar parenting bagaimana cara mendidik anak dengan benar</p>', 3, 5, 2, 4, 1, 0, 1, 2, NULL, 1),
('7201ac67-8834-46b9-9cb8-219cd6777415', '2023-10-14 07:33:00', '2023-10-14 07:33:00', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Anda dalam perjalanan menuju kantor sehabis makan siang dengan kondisi terburu-buru, akan tetapi tiba-tiba terjadi kecelakaan di depan anda. Tindakan anda.</p>', '<p>Melihat kondisi korban kecelakaan itu, jika parah sekali maka saya akan membantunya</p>', '<p>Melihat kondisi umum, jika memugkinkan maka akan saya bantu</p>', '<p>Mempertimbangkan untuk tidak membantu korban tersebut karena saya harus berada di kantor secepatnya</p>', '<p>Saya akan menyerahkan kepada orang lain untuk membantu korban tersebut</p>', '<p>Langsung ke kantor karena walau bagainamapun itu bukan urusan saya</p>', 4, 5, 2, 3, 1, 0, 1, 2, NULL, 1),
('73187c74-8878-48ab-abe3-4cc5a8d43c77', '2023-10-14 08:03:17', '2023-10-14 08:03:17', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Pasangan Anda memiliki masalah hingga mengganggu produktivitasnya bekerja. Maka bantuan yang anda berikan dalam bentuk...</p>', '<p>Menasehatinya agar mengambil cuti</p>', '<p>Menyemangati agar dapat melewati masa sulitnya</p>', '<p>Menasehati agar melupakan masalah</p>', '<p>Membiarkannya larut dalam kesendirian hingga mau bangkit dari keterpurukannya</p>', '<p>Membantu tugas-tugasnya yang terbengkalai</p>', 3, 5, 4, 1, 2, 0, 1, 2, NULL, 1),
('734003b7-ceb7-4e25-bd73-e0a9ecb448b1', '2023-10-26 08:56:44', '2023-10-26 08:56:44', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Setiap akhir tahun, perusahaan penilaian memiliki tradisi untuk membuat laporan tahunan akan tetapi, saat akhir tahun ini menjelang penilaian kerja. Anda belum sempat mengerjakan laporan tahunan pekerjaan anda akan......</p>', '<p>Meminta penundaan penilaian karena tidak mau mengerjakan laporan dengan tergesa-gesa</p>', '<p>Meminta orang untuk mengerjakan laporan kerja anda</p>', '<p>Segera mengerjakan laporan walaupun waktunya sudah sangat terlambat</p>', '<p>Mengambil laporan teman anda dan memodifikasinya supaya terlihat seperti laporan anda</p>', '<p>Menggunakan laporan tahun lalu yang mirip dan mengubah sedikit</p>', 4, 3, 5, 1, 2, 0, 1, 3, NULL, 1),
('73cf2272-bb44-4983-b3ac-c96e07507abc', '2023-10-13 06:37:48', '2023-10-13 06:37:48', NULL, 'dfcc80d7-7e2f-4c19-88cc-d69371bbee12', NULL, 0, NULL, NULL, NULL, '<p>Koperasi merupakan bentuk perekonomian rakyat yang sistem pengelolaannya berasal dari rakyat, oleh rakyat, dan untuk rakyat. Koperasi sebagai wadah yang tepat untuk meningkatkan hajat hidup masyarakat, terutama mereka yang berada pada tingkat ekonomi kelas bawah. Tidak adanya koperasi usaha kecil menengah sulit bersaing dengan perusahaan-perusahaan multi nasional yang dikelola dengan mengedepankan penerapan prinsip <em>efektifitas, evisiensi</em>, dan <em>produktifitas</em>.</p>', '<p>efektivit&agrave;s, efisiensi, produktifitas</p>', '<p>efektivitas, efisiensi, produktivitas</p>', '<p>efektifitas, efisiensi, produktivitas</p>', '<p>efektivitas, evisiensi, produktifitas</p>', '<p>efektifitas, efisiensi, produktifitas</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('74a71955-7e68-40b0-b76c-c0bc255c9f67', '2023-10-16 05:51:43', '2023-10-16 05:51:43', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p>Program: Proposal : Pelaksanaan</p>', '<p>Rencana : Pelaksanaan : Evaluasi</p>', '<p>Anggaran : Pengeluaran : Pencatatan</p>', '<p>Pembelian : Penjualan : Laba</p>', '<p>Belajar : Cita-cita : Sukses</p>', '<p>Perlombaan: Persaingan : Juara</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('754b4400-6a02-4a96-80ae-126ce1deb0c0', '2023-10-18 05:17:50', '2023-10-18 05:17:50', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Ketika saya sedang ada masalah, saya akan....</p>', '<p>mudah marah dan melempar barang</p>', '<p>bekerja sesuai jadwal dan tetap tenang</p>', '<p>bercerita kepada orang terdekat dan berusaha bekerja sesuai jadwal</p>', '<p>malas bekerja dan bekerja dengan penuh tekanan</p>', '<p>diam dan sedih tetapi tetap bekerja sesuai jadwal</p>', 1, 5, 4, 2, 3, 0, 1, 2, NULL, 1),
('76584d0c-02b0-4af9-a22e-01af0571d370', '2023-10-17 07:56:53', '2023-10-17 07:56:53', NULL, 'b6b3d933-7f1c-4ac1-abf2-14928a6ab49f', NULL, 0, NULL, NULL, NULL, '<p>Pada 22 Juni 2004 diundangkan Undang-Undang No. 10 Tahun 2004 tentang Pembentukan Peraturan Perundang-undangan, yang di dalamnya dinyatakan tentang macam-macam peraturan perundang-undangan. Urutan tertinggi berdasarkan UU No.10 Tahun 2004 adalah....</p>', '<p>Pancasila</p>', '<p>UUD 1945</p>', '<p>Peraturan Pemerintah</p>', '<p>Peraturan Presiden</p>', '<p>Peraturan Daerah</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('76bd0702-3cc9-4eab-8ae7-c23d092106d6', '2023-10-13 06:25:10', '2023-10-13 06:25:10', NULL, 'dfcc80d7-7e2f-4c19-88cc-d69371bbee12', NULL, 0, NULL, NULL, NULL, '<p>Saat ujian kenaikan kelas. Sari melihat Siska mencontek. Namun Sari tidak melaporkannya karena mereka ternyata saling bekerja sama. Tindakan yang dilakukan Siska telah melanggar nilai pancasila. Terutama sila ke...</p>', '<p>Satu</p>', '<p>Dua</p>', '<p>Tiga</p>', '<p>Empat</p>', '<p>Lima</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('77568ef3-3cd0-47d7-a12d-14b53ef94697', '2023-10-18 07:38:22', '2023-10-18 07:38:22', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Selama ini rekan-rekan di kantor saya memandang saya sebagai orang yang...</p>', '<p>Berperilaku sesuai perasaan saya apa adanya</p>', '<p>Berperilaku taat aturan jika sedang dilihat atasan atau orang lain</p>', '<p>Berperilaku santun dan baik hanya pada orang-orang yang berbuat balk pada saya</p>', '<p>Berperilaku taat aturan, mampu menahan emosi, dan tetap tenang saat menghadapi masalah</p>', '<p>Berperilaku mudah tersinggung, mudah terpancing emosinya oleh situasi-situasi yang kurang menyenangkan</p>', 4, 1, 3, 5, 2, 0, 1, 4, NULL, 1),
('78e93ce3-7622-4bb9-a97b-871463bfcf27', '2023-10-16 05:16:13', '2023-10-16 05:16:13', NULL, '7353afdf-8c22-4e71-a553-90921b9692ab', NULL, 0, NULL, NULL, NULL, '<p>Fungsi pendidikan adalah serangkaian tugas ataupun misi yang diemban dan dilaksanakan oleh pendidikan. Dari pengertian ini dapat dijelaskan bahwa sesungguhnya kegiatan atau praktek pendidikan di mana pun bukanlah kegiatan tanpa makna dan tujuan yang jelas. Dari segi kultural dan sosial, fungsi pendidikan adalah menumbuhkan kreatifitas subjek didik, menjaga kelestarian nilai-nilai insaniah dan ilahiah, serta menyiapkan tenaga kerja produktif.Perbaikan penulisan pada kata yang bercetak miring dalam paragraf tersebut adalah...</p>', '<p>Praktik, kreativitas; produktif</p>', '<p>Peraktik, kreativ, produktif</p>', '<p>Praktik, kreatifitas, produktif</p>', '<p>Praktek, kreatif, produktif</p>', '<p>Praktek, kreativitas, produkti</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('7a9b3b1e-74fe-4775-a76b-f1e5ecc4c1d4', '2023-10-13 06:28:53', '2023-10-13 06:28:53', NULL, 'dfcc80d7-7e2f-4c19-88cc-d69371bbee12', NULL, 0, NULL, NULL, NULL, '<p>Tujuan Nasionalisme juga didasari dari semangat gotong royong yaitu kedalam dan ke luar. Ke luar berarti....</p>', '<p>kemajemukan dan keanekaragaman budaya, suku, etnis, agama yang mewarnai kebangsaan Indonesia, perlu disikapi secara positif sebagai limpahan karunia yang bisa saling memperkaya khazanah budaya dan pengetahuan melalui proses penyerbukan budaya</p>', '<p>memuliakan kemanusiaan universal, dengan menjunjung tinggi persaudaraan, perdamaian dan keadilan antar umat manusia</p>', '<p>Bahwa kesetiaan yang tertinggi terdapat harus diserahkan pada negara kebangsaan</p>', '<p>masa kebangsaan yang bersemangat dan bertindak agresif terhadap bangsa lain</p>', '<p>kemajemukan dan keanekaragaman budaya, suku, etnis, agama yang mewarnai kebangsaan Indonesia, tidak boleh dipandang sebagai hal negatif dan menjadi ancaman yang bisa saling menegaskan</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('7b279cb7-48e3-4c4f-85e8-a6437638fcd8', '2023-10-16 07:32:42', '2023-10-16 07:32:42', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p>Pada hari Minggu, Adit bermain sepeda di halaman rumahnya. Jari-jari roda sepeda yang digunakan oleh Deni 42 cm. Jika selama bersepeda rodanya berputar sebanyak 50 kali, panjang lintasan yang dilalui adalah...</p>', '<p>55,44 meter</p>', '<p>132 meter</p>', '<p>264 meter</p>', '<p>277,20 meter</p>', '<p>286 meter</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('7ba60d60-bab4-43af-a8e4-0204a0e1b367', '2023-10-17 03:14:56', '2023-10-17 03:14:56', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Saat sedang melakukan acara outbond, sebelum acara dimulai biasanya pelatih memberikan arahan. Saat pemberian arahan tersebut, nampak dengan jelas tali sepatu pelatih lepas dari ikatannya. Hal ini sangat mengganggu jalannya pengarahan. Namun, setelah ditunggu beberapa saat, nampaknya tidak ada yang berani memberi tahu pelatih mengenai hal tersebut. Sikap saya sebaiknya....</p>', '<p>Menuliskan pesan ke secarik kertas dan memberikannya ke pelatih mengenai hal tersebut</p>', '<p>Terpaksa mengingatkan karena peserta lainnya tidak ada yang bertindak</p>', '<p>Meskipun hal itu mengganggu konsentrasi saya, tetapi saya tidak mau mengambil risiko dengan memberitahukan karena bisa saja yang lainnya tidak terganggu dengan hal tersebut</p>', '<p>Tidak memberi tahu dengan alasan bisa saja tersinggung jika diingatkan tentang tali sepatu yang lepas</p>', '<p>Mengawasi pelatih jika mulai terlihat mengganggu saat jalan baru saya beri tahu bahwa tali sepatunya lepas sambil mengingatkan beliau agar lebih berhati-hati</p>', 5, 3, 2, 1, 4, 0, 1, 1, NULL, 1),
('7c01f3d6-bac6-409f-aa7e-1d31ce4f6176', '2023-10-16 07:48:00', '2023-10-16 07:48:00', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p>Sandi telah melaksanakan Ujian Semester 2. la mendapatkan nilai 82 untuk IPA, 89 untuk IPS, 79 untuk Bahasa Indonesia, 87 untuk Matematika, dan X untuk Bahasa Inggris. Jika Sandi mendapat nilai rata-rata 84, maka nilai X adalah....</p>', '<p>78</p>', '<p>81</p>', '<p>83</p>', '<p>86</p>', '<p>87</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('7d4a2031-620e-4557-bd91-ad501c3195fa', '2023-10-26 07:07:17', '2023-10-26 07:07:17', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Anda telah berkerja sesuai dengan prosedur yang perusahaan berikan kepada setiap karyawan dengan jelas, sudah terdokumentasi sebagai panduan bagi setiap karyawan dalam berkerja dan telah menerapkannya setiap hari dengan baik, namun terkadang ada kondisi dimana sebuah masalah yang timbul tidak dijelaskan bahkan tidak ada di dalam prosedur yang perusahaan berikan, yang anda lakukan.....</p>', '<p>Tetap mengikuti sop yang ada meskipun pekerjaan selesai jadi sangat lama dan mengganggu kinerja</p>', '<p>Meminta bantuan kepada rekan karyawan yang lain untuk dicarikan solusi terbaik</p>', '<p>Melihat dari kondisi yang ada dan saya sesuaikan dengan misi perusahaan agar pekerjaan cepat terselesaikan</p>', '<p>Menyuruh atas untuk mereview kembali prosedur yang ada agar karyawan dapat berkerja dengan baik</p>', '<p>Memikirkan penyelesaian yang sekira cocok dan bisa saya kerjakan sesuai kemampuan saya dan misi perusahaan</p>', 3, 2, 5, 1, 4, 0, 1, 3, NULL, 1),
