('7dc36868-3f90-4625-880d-f72688b6b0ab', '2023-10-13 06:34:43', '2023-10-13 06:34:43', NULL, 'dfcc80d7-7e2f-4c19-88cc-d69371bbee12', NULL, 0, NULL, NULL, NULL, '<p>Wawasan Nusantara adalah cara pandang bangsa Indonesia tentang diri dan lingkungannya berdasarkan ideologi nasionalnya yang dilandasi oleh Pancasila dan UUD 1945 yang merupakan aspirasi bangsa Indonesia yang merdeka, berdaulat, dan bermanfaat serta menjiwai, tata hidup dan tindak kebijakannya dalam mencapai tujuan nasional. Tujuan wawasan nusantara terbagi menjadi tujuan ke dalam dan tujuan keluar. Tujuan ke dalam wawasan nusantara yaitu....</p>', '<p>Untuk mewujudkan kesatuan dalam segenap aspek kehidupan bangsa, baik aspek alamiah maupun aspek social</p>', '<p>Untuk ikut serta rnewujudkan kebahagiaan, ketertiban, dan perdamaian seluruh umat manusia</p>', '<p>Kemajemukan dan keanekaragaman budaya, suku, etnis, agama yang mewarnai kebangsaan Indonesia, tidak boleh dipandang sebagai hal negatif dan menjadi ancaman yang bisa saling menegaskan.</p>', '<p>memuliakan kemanusiaan universal</p>', '<p>kesetiaan yang tertinggi terdapat harus diserahkan pada negara kebangsaan</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('7dec3f71-7047-4edb-bc6e-677585e60c04', '2023-10-14 04:57:39', '2023-10-14 04:57:39', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Anda seorang sarjana yang baru lulus dari Universitas Negeri. Saat ini anda sedang mencari pekerjaan dan menyadari bahwa sangat sulit untuk mencari pekerjaan tanpa adanya kenalan di perusahaan. Menurut anda cara yang paling mudah yang dapat dilakukan untuk mendapatkan pekerjaan adalah...</p>', '<p>Mencari dari lingkup profesional</p>', '<p>Mencari dari lingkaran pertemanan dekat</p>', '<p>Mencari dari alumni tempat anda kuliah</p>', '<p>Mencari dari lingkungan keluarga</p>', '<p>Mencari dari kelompok minat yang sama dengan anda</p>', 4, 2, 5, 1, 3, 0, 1, 3, NULL, 1),
