('7f238ac4-c491-4b03-b806-b2ebd82706df', '2023-10-16 04:31:23', '2023-10-16 04:31:23', NULL, '7353afdf-8c22-4e71-a553-90921b9692ab', NULL, 0, NULL, NULL, NULL, '<p>Integritas selalu berkaitan dengan kredibilitas, dimana menyangkut tentang keterampilan atau kemampuan, sedangkan integritas berkaitan dengan...</p>', '<p>Kepribadian</p>', '<p>Hati</p>', '<p>Perilaku</p>', '<p>Skill</p>', '<p>Pengetahuan</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('800ea476-b253-420a-99e6-b7abcb22ef8a', '2023-10-26 06:49:37', '2023-10-26 06:49:37', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Salah satu sistem aplikasi di perusahaan anda diretas oleh perusahaan saingan. Anda sebagai ketua tim IT diminta untuk menganalisa kelemahan aplikasi yang digunakan perusahaan dan diminta untuk meningkatkan keamanan aplikasi tersebut sehingga tidak bisa diretas lagi oleh perusahaan saingan, yang anda lakukan adalah......</p>', '<p>Menghentikan retasan dan mencari kelemahan aplikasi tersebut sistem keamanan aplikasi tersebut</p>', '<p>Bersama tim IT membuat aplikasi yang baru yang tidak bisa diretas oleh perusahaan pesaing</p>', '<p>Meminta tim IT menganalisa kelemahan aplikasi tersebut dan meningkatkan system keamanan aplikasi tersebut agar tidak diretas lagi</p>', '<p>Meminta semua tim IT untuk bekerja sama membalas meretas aplikasi perusahaan saingan</p>', '<p>Menanam virus pada aplikasi yang diretas sehingga perusahaan saingan mendapatkan imbasnya</p>', 4, 3, 5, 2, 1, 0, 1, 3, NULL, 1),
('80644aff-3611-413c-9648-7a01ce24e640', '2023-10-18 03:40:27', '2023-10-18 03:40:27', NULL, '557e3be9-1ea4-45e4-8163-29eb4435e058', NULL, 0, NULL, NULL, NULL, '<p>KIPAS : ANGIN = &hellip; : &hellip;</p>', '<p>Kemarau: Kering</p>', '<p>Jalan: Macet</p>', '<p>Kompor: Apl</p>', '<p>Lemari: Dingin</p>', '<p>Rapi: Bersih</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('8082bc49-b84d-4e93-a942-0c2b850433d7', '2023-10-17 09:04:36', '2023-10-17 09:04:36', NULL, 'b6b3d933-7f1c-4ac1-abf2-14928a6ab49f', NULL, 0, NULL, NULL, NULL, '<p>Bacalah teks berikut! Microsoft dan Google hadir dalam pertemuan dua hari di Seattle bersama raksasa piranti lunak Cisco dan Symantec untuk menemukan cara mengurangi kegiatan para teroris di dunia maya. Pertemuan itu dipimpin oleh Komisi Kerja Perserikatan Bangsa-Bangsa (PBB). Seperti dikutip dari laman tetech24, 1 Maret 2010, Richard Barrett, wakil ketua komisi kerja PBB mengatakan bahwa terdapat tingkat kejahatan tinggi di internet. Menurut Barrett, \"Sangat penting bila sektor swasta dilibatkan, sektor swasta merupakan mitra esensial untuk melangkah maju\", ucapnya (vivanews.com).</p>\n<p>Kata esensial dalam teks tersebut memiliki persamaan makna dengan ...</p>', '<p>Indah</p>', '<p>perlu sekali</p>', '<p>kurang</p>', '<p>petan</p>', '<p>kuat</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
