('834d56f5-b590-4447-b48a-0142f8f02e6e', '2023-10-17 03:50:25', '2023-10-17 03:50:25', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Kantor anda adalah kantor yang fleksibel dan memiliki ruang kerja yang bebas untuk dipakai bersama kapanpun. Ketika anda bekerja di kantor anda senang jika ...</p>', '<p>Ruangan terbuka</p>', '<p>Banyak orang di satu ruangan</p>', '<p>Suasananya bersih dan nyaman</p>', '<p>Banyak makanan dan minuman</p>', '<p>Keadaannya sepi</p>', 3, 4, 5, 2, 1, 0, 1, 3, NULL, 1),
('838c20a0-917c-4624-9890-7017ad9fb8ca', '2023-10-17 04:49:57', '2023-10-17 04:49:57', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Rekan kerja anda dimarahi oleh atasan pada saat mengumpulkan tugas tim karena sudah terlambat beberapa jam. hal ini dikarenakan rekan anda harus mengkompilasi pekerjaan tersebut terlebih dahulu sebelum dikumpulkan ditambah lagi semua rekan anggota tim juga terlambat mengumpulkan tugas mereka, sehingga rekan anda yang bertugas untuk mengkompilasi setiap pekerjaan jadi tidak menyelesaikan pekerjaannyatepat waktu. Sikap anda sebaiknya...</p>', '<p>Mendengarkan rekan anda dimarahi setelah itu memberikan semangat untuk tidak dimasukkan ke hati ucapan atasan</p>', '<p>Meminta maaf kepada teman karena keterlambatan juga disebabkan oleh anggota tim yang lain</p>', '<p>Mengakui kesalahan kepada atasan jika anda juga turut berkontribusi pada masalah tersebut</p>', '<p>Mengakui kesalahan kepada teman dan berjanji tidak akan mengulanginya lagi</p>', '<p>Mengajak rekan anda untuk membicarakannya dan menghibur rekan yang dimarahi</p>', 1, 3, 5, 4, 2, 0, 1, 3, NULL, 1),
('83fc1054-1492-4d10-b55c-064827cc3581', '2023-10-17 04:07:12', '2023-10-17 04:07:12', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Perusahaan anda yang bergerak di bidang IT akan membuat aplikasi media sosial yang dapat menjangkau seluruh kalangan masyarakat.Perusahaan juga merencanakan penggunaan media sosial tidak dibatasi oleh umur sehingga pengguna aplikasi lebih banyak dan berimbas pada omset perusahaan yang semakin besar. Anda sebagai karyawan di perusahaan tersebut sebaiknya?</p>', '<p>Mendukung ide dan gagasan perusahaan karena akan mendatangkan omset yang besar</p>', '<p>Meminta perusahaan untuk meninjau ulang tentang pembatasan usia karena usia anak-anak rentan terhadap penyalahgunaan media sosial</p>', '<p>Bersama tim membantu mengembangkan aplikasi media sosial yang mudah dan mampu menjangkau semua kalangan</p>', '<p>Merencanakan pembuatan media sosial yang menjangkau seluruh kalangan tetapi ramah anak</p>', '<p>Mengusulkan kepada perusahaan untuk membuat aplikasi media sosial yang selain bisa menjangkau seluruh kalangan juga dapat untuk memposting konten secara bebas</p>', 2, 5, 3, 4, 1, 0, 1, 2, NULL, 1),
('841b5ffe-6c7f-46dd-8dfa-28d7e51f46a5', '2023-10-13 08:39:15', '2023-10-13 08:39:15', NULL, 'e9f84a80-562c-4b59-b70d-8f1c9f4e3b4f', NULL, 0, NULL, NULL, NULL, '<p>Mobil yang dikendarai Ayah melaju dengan kecepatan rata-rata 81 km/jam. Jarak yang akan ditempuh 324 km dan mobil beristirahat selama 20 menit di tengah perjalanan. Jika mobil berangkat pada pukul 12.11, maka mobil tersebut akan tiba di tempat tujuan pada pukul ...</p>', '<p>15.43</p>', '<p>15.56</p>', '<p>16.10</p>', '<p>16.31</p>', '<p>16.57</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('84abc549-f082-41a0-b8be-327555b6dc0b', '2023-10-18 04:49:03', '2023-10-18 04:49:03', NULL, '557e3be9-1ea4-45e4-8163-29eb4435e058', NULL, 0, NULL, NULL, NULL, '<p>Separuh pelamar sejenis pekerjaan gagal karena tidak memenuhi syarat administrative, tiga pelamar lainnya gagal setelah wawancara, sehingga tinggal 2/5 dari seluruh pelamar. Berapakah jumlah pelamar untuk pekerjaan tersebut?</p>', '<p>10</p>', '<p>20</p>', '<p>30</p>', '<p>40</p>', '<p>50</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('8504dc81-daae-413a-8717-69f851f88173', '2023-10-25 06:24:37', '2023-10-25 06:24:37', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Anda baru saja mengundurkan diri dari sebuah perusahaan karena terdapat masalah pribadi yang membuat anda tidak merasa Nyaman lagi dalam berkerja. Masalah tersebut disebabkan kekasih anda yang sudah menjalin hubungan bersama anda selama 5 tahun berselingkuh dengan seorang wanita kemudian memutuskan untuk menikahi wanita tersebut. Kebetulan kekasih anda merupakan rekan se kantor dan satu divisi dengan anda, kejadian ini membuat anda memilih untuk membuka lembaran baru dan keluar dari perusahaan. Setelah satu bulan memenangkan diri, anda diterima lagi di sebuah perusahaan baru yang lebih bonafit karena kecerdasan dan kompeten anda. Setelah beberapa bulan anda ditugaskan oleh perusahaan untuk bergabungmenangani suatu proyek dengan beberapa orang kompeten yang akan berkerja bersama anda, salah satu orang dalam tim tersebut yaitu wanita bernama Sinta yang merupakan istri dari mantan kekasih yang telah mengkhianati anda. Bagaimana anda menyikapinya....</p>', '<p>Bekerja seperti biasa dengan mandiri dan penuh tanggung jawab</p>', '<p>Bekerja seperti biasa dan pelan-pelan berdiskusi dengan atasan atas keberatan anda</p>', '<p>Bekerja seperti biasa, namun menghindari berinteraksi dengan Sinta agar tidak terjadi konflik</p>', '<p>Bekerja seperti biasa sesuai dengan protokol dan peraturan</p>', '<p>Bekerja seperti biasa dengan didasari semangat kerja sama tim</p>', 3, 2, 1, 4, 5, 0, 1, 5, NULL, 1),
('862530cd-d893-4af2-bb57-8f5ae6c8f611', '2023-10-14 07:39:22', '2023-10-14 07:39:22', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Jika ada tawaran pekerjaan yang sebetulnya sangat cocok dengan minat dan bidang saya akan tetapi gajinya lebih kecil dari pekerjaan saat ini, maka saya....</p>', '<p>Meminta pendapat dari keluarga saya karena ini juga berkaitan dengan mereka</p>', '<p>Menerima tawaran tersebut karena pekerjaan yang sekarang sama sekali berada di luar minat saya</p>', '<p>Bertahan dengan pekerjaan saya saat ini</p>', '<p>Memperbandingkan sisi positif dan sisi negatifnya</p>', '<p>Menolak tawaran tersebut karena bagi saya gaji adalah faktor paling penting</p>', 4, 3, 2, 5, 1, 0, 1, 4, NULL, 1),
('86f8eb7d-1857-47c3-92c8-2b3e99348809', '2023-10-13 06:20:30', '2023-10-13 06:20:30', NULL, 'dfcc80d7-7e2f-4c19-88cc-d69371bbee12', NULL, 0, NULL, NULL, NULL, '<p>Moto Bhinneka Tunggal Ika secara lebih jelas dan konstitusional dituangkan dalam konsep wawasan nusantara melalui</p>', '<p>TAP MPR No. III/MPR/1973</p>', '<p>TAP MPR No. IV/MPR/1973</p>', '<p>TAP MPR No. V/MPR/1973</p>', '<p>TAP MPR No. VI/MPR/1973</p>', '<p>TAP MPR No. VII/MPR/1973</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('87adf6bf-e26a-46ff-827e-a60ca1287b1e', '2023-10-19 07:20:37', '2023-10-19 07:20:37', NULL, '80cec561-fc0b-46c7-aed4-f0ad73061557', NULL, 0, NULL, NULL, NULL, '<p>Yang dimaksud <em>Staat Fundamental Norm</em> dalam ketatanegaraan Repulik Indonesia adalah.....</p>', '<p>Hukum pidana dan perdata</p>', '<p>UUD 1945</p>', '<p>Pancasila</p>', '<p>Negara Kesatuan Republik Indonesia</p>', '<p>Bhinneka Tunggal Ika</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('895cba0e-fc18-493b-b149-a8d8c781e156', '2023-10-18 03:04:55', '2023-10-18 03:04:55', NULL, '557e3be9-1ea4-45e4-8163-29eb4435e058', NULL, 0, NULL, NULL, NULL, '<p><img src=\"/storage/upload_files/questions/20231018100328soal 31.jpg\" alt=\"\" width=\"500\" height=\"169\" /></p>', '<p>Gambar A</p>', '<p>Gambar B</p>', '<p>Gambar C</p>', '<p>Gambar D</p>', '<p>Gambar E</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('8a1dc1be-c3f7-4968-b8d4-9ad04e407875', '2023-10-17 06:04:38', '2023-10-17 06:04:38', NULL, 'b6b3d933-7f1c-4ac1-abf2-14928a6ab49f', NULL, 0, NULL, NULL, NULL, '<p>Berikut ini yang bukan merupakan lembaga antikorupsi yaitu...</p>', '<p>Indonesian Corruption Watch</p>', '<p>ICW</p>', '<p>Imparsial</p>', '<p>KPK</p>', '<p>KKI</p>', 0, 0, 0, 0, 0, 0, 1, 5, NULL, 1),
('8ad77856-04b3-48cb-89ab-e2993b0ea39d', '2023-10-25 07:10:24', '2023-10-25 07:10:24', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Pada tahun ini dibuka seleksi penerimaan CPNS secara besar-besaran. Anda mencoba peruntungan anda dengan ikut mendaftar. Setelah anda melihat-lihat formasinya latar belakang pendidikan anda bersedia. Diluar daerah meski karena dari kecil anda tidak pernah lepas dari keluarga anda terlebih anda sering sakit dan memiliki riwayat penyakit maag, keluarga anda melarang untukmengikuti seleksi CPNS tahun ini namun anda sangat ingin mencoba kesempatan ini. Terlebih anda sudah belajar keras beberapa bulan sebelum pendaftaran dibuka. Maka hal yang harus anda lakukan......</p>', '<p>Menerima saran dari orang tua untuk tidak mengikuti seleksi CPNS tahun ini</p>', '<p>Tetap mengikuti seleksi CPNS secara diam-diam tanpa diketahui oleh pihak keluarga</p>', '<p>Memberi pengertian kepada keluarga dan mengikuti seleksi CPNS</p>', '<p>Mengikuti seleksi CPNS hanya untuk menguji kemampuan diri</p>', '<p>Mengikuti seleksi CPNS dengan formasi apapun yang terdapat di daerah anda</p>', 1, 2, 5, 3, 4, 0, 1, 3, NULL, 1),
('8b4582ae-2082-4033-92b7-5ee5485e0cef', '2023-10-20 06:55:13', '2023-10-20 06:55:13', NULL, '00cc482f-6b53-42a2-9045-e1b555bb5d19', NULL, 0, NULL, NULL, NULL, '<p>Untuk mengisi liburan panjang akhir semester, Lila, Indi, Lulu, Tata dan Doni sedang dalam perjalanan menuju sebuah tempat wisata di kota sebelah dengan mengendarai sepeda motor.</p>\n<ul>\n<li>Lila mengendarai sepeda motor dengan kecepatan lebih kecil daripada Indi tetapi tidak lebih besar daripada Tata</li>\n<li>Lulu mengendarai sepeda motor dengan kecepatan tidak lebih dari Tata dan tidak kurang Indi</li>\n<li>Doni mengendarai sepeda motor dengan kecepatan tidak lebih dari Indi dan tidak kurang dari Lili</li>\n</ul>\n<p>Jika Lulu sampai di tempat tujuan dalam waktu 35 menit dan Tata menghabiskan waktu 45 menit untuk sampai tempat tujuan,pernyataan yang benar adalah....</p>', '<p>Indi sampai di tempat tujuan dalam waktu kurang dari 35 menit</p>', '<p>Tata dan Lila sampai di tempat tujuan bersamaan</p>', '<p>Doni sampai di tempat tujuan lebih dari 35 menit</p>', '<p>Lila sampai di tempat tujuan dalam waktu lebih dari 45 menit</p>', '<p>Tata sampai di tempat tujuan dalam waktu 35 menit</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('8c3db04b-46c3-4609-a8d2-8a3977928b64', '2023-10-18 04:06:35', '2023-10-18 04:06:35', NULL, '557e3be9-1ea4-45e4-8163-29eb4435e058', NULL, 0, NULL, NULL, NULL, '<p>Empat tahun yang lalu jumlah usia Angkasa dan Bia adalah 27 tahun. Sedangkan sebelas tahun yang akan datang dua kali usia yang tua sama dengan dua kali usia yang muda ditambah 6 tahun. Pada saat ini berapa tahun usia yang tua?</p>', '<p>16 tahun</p>', '<p>17 tahun</p>', '<p>18 tahun</p>', '<p>19 tahun</p>', '<p>20 tahun</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('8d155b47-ec93-4a3e-acd2-10ec4d816fe3', '2023-10-14 04:23:16', '2023-10-14 04:23:16', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Siang itu telepon kantor bagian pelayanan berdering tetapi pegawai yang bertugas tidak ada ditempat. Disisi lain, masih banyak pegawai yang berada di sekitar kantor namun tidak ada satupun yang berani mengangkat telepon itu. Sikap anda sebaiknya...</p>', '<p>Membiarkan saja</p>', '<p>Mencabut kabel telepon agar tidak mengganggu</p>', '<p>Mengangkat telepon dan mencatat pesan yang disampaikan untuk diteruskan ke rekan anda</p>', '<p>Meminta teman lain mengangkatnya</p>', '<p>Mengirim pesan kepada teman agar segera kembali ke meja kerja</p>', 2, 1, 5, 3, 4, 0, 1, 3, NULL, 1),
('8d42ba4a-ba6f-4981-b123-74b039ba00eb', '2023-10-19 07:41:40', '2023-10-19 07:41:40', NULL, '80cec561-fc0b-46c7-aed4-f0ad73061557', NULL, 0, NULL, NULL, NULL, '<p>Nasionalisme Pancasila adalah pandangan atau paham kecintaan manusia Indonesia terhadap bangsa dan tanah airnya yang didasarkan pada nilai-nilai Pancasila. Prinsip nasionalisme bangsa Indonesia dilandasi nilai-nilai Pancasila yang diarahkan agar bangsa Indonesia senantiasa, kecuali....</p>', '<p>menempatkan persatuan kesatuan, kepentingan dan keselamatan bangsa dan negara di atas kepentingan pribadi atau kepentingan golongan</p>', '<p>menunjukkan sikap rela berkorban demi kepentingan bangsa dan negara</p>', '<p>bangga sebagai bangsa Indonesia dan bertanah air Indonesia serta tidak merasa rendah hati</p>', '<p>mengakui persamaan derajat, persamaan hak dan kewajiban antara sesama manusia dan sesama bangsa</p>', '<p>menumbuhkan sikap saling mencintai sesama manusia</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('8d63900c-93a7-4dc7-8fba-e7e4469c6e9a', '2023-10-20 07:57:18', '2023-10-20 07:57:18', NULL, '00cc482f-6b53-42a2-9045-e1b555bb5d19', NULL, 0, NULL, NULL, NULL, '<p>Keni dapat selesai mengecat rumah dalam waktu 6 hari, sedangkan Bondan dapat selesai mengecat rumah dalam waktu 12 hari. Jika mereka mengecat rumah bersama-sama, berapa waktu yang diperlukan untuk menyelesaikan pengecatan rumah?</p>', '<p>4 hari</p>', '<p>5 hari</p>', '<p>6 hari</p>', '<p>7 hari</p>', '<p>8 hari</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('8d9fd135-0dac-42c6-b776-b8e17a3485ce', '2023-10-14 05:20:52', '2023-10-14 05:20:52', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Saya mendapatkan tugas untuk mengikuti sebuah pelatihan di Ibu Kota selama satu minggu. Oleh panitia penyelenggara saya ditempatkan sekamar dengan orang yang berasal dari kota lain yang memiliki kebiasaan dan budaya yang berbeda dengan saya. Sikap saya adalah...</p>', '<p>mengajukan keberatan tetapi akhirnya menerima aturan panitia kegiatan</p>', '<p>Mengajukan keberatan meminta untuk ditempatkan dengan orang yang berasal dari kota yang sama</p>', '<p>Menerima aturan panitia dan berusaha mengenali dan memahami teman sekamar dengan baik</p>', '<p>Menerima aturan panitia dan berusaha mengenali dan memahami teman sekamar dengan baik</p>', '<ol>\n<li>Protes keras dan meminta panitia untuk menyediakan kamar sendiri</li>\n</ol>\n<p>&nbsp;</p>', 3, 2, 5, 4, 1, 0, 1, 3, NULL, 1),
('8e752367-04a5-4317-933a-3e76882eb97c', '2023-10-16 05:22:18', '2023-10-16 05:22:18', NULL, '7353afdf-8c22-4e71-a553-90921b9692ab', NULL, 0, NULL, NULL, NULL, '<p>Rhania Dialza akan menulis karya ilmiah yang berjudul \"Pengelolaan limbah sampah plastik di Lingkungan rumah tangga\". Penulisan judul karangan yang tepat adalah....</p>', '<p>Pengelolaan Limbah Sampah Plastik di lingkungan rumah tangga</p>', '<p>Pengelolaan Limbah Sampah Plastik di Lingkungan Rumah Tangga</p>', '<p>pengelolaan limbah sampah plastik di lingkungan rumah tangga</p>', '<p>Pengelolaan Limbah Sampah Plastik Di Lingkungan Rumah Tangga</p>', '<p>Pengelolaan Limbah Sampah Plastik Di lingkungan Rumah Tangga</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('8ee94203-99fe-483f-96e4-e611ac638ed6', '2023-10-18 05:04:41', '2023-10-18 05:04:41', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Jika terdapat suatu masalah didalam pekerjaan diketuai oleh anda, maka anda akan...</p>', '<p>memanggil bantuan orang lain untuk menyelesaikan masalah ini</p>', '<p>menyalahkan orang lain sebagai penyebab masalah</p>', '<p>menyalahkan orang lain sebagai penyebab masalah</p>', '<p>mencari tahu apakah ada pihak lain yang ikut dalam masalah ini</p>', '<p>membiarkan masalah tersebut</p>', 3, 2, 5, 4, 1, 0, 1, 3, NULL, 1),
('8f171fdd-f5d6-4203-8307-474562365e1a', '2023-10-16 09:25:49', '2023-10-16 09:25:49', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Pagi ini saya mendapatkan tugas piket di ruang pelayanan. Saat sampai di kantor saya melihat ruang tunggu pelayanan masih berantakan dan banyak barang-barang berserakan. Padahal sebentar lagi pelayanan akan segera dibuka. Yang saya lakukan adalah...</p>', '<p>Mencari Cleaning Service untuk membersihkan ruang tunggu pelayanan</p>', '<p>Pura-pura tidak tau karena hal itu bukan menjadi tanggung jawab saya</p>', '<p>Melaporkan ke atasan bahwa kondisi ruang pelayanan berantakan</p>', '<p>Membiarkan orang lain untuk membereskan ruang tunggu pelayanan</p>', '<p>Berinisiatif membantu membersihkan dan merapikan ruang pelayanan sebelum jam layanan dimulai</p>', 4, 1, 3, 2, 5, 0, 1, 5, NULL, 1),
('8f2b9f51-e654-4e9b-9911-71645452f685', '2023-10-17 08:53:02', '2023-10-17 08:53:02', NULL, 'b6b3d933-7f1c-4ac1-abf2-14928a6ab49f', NULL, 0, NULL, NULL, NULL, '<p>Belanda adalah negara penjajah Indonesia yang paling lama menjajah yakni mencapai 346 tahun. Dalam kurun waktu itu, Belanda berhasil menguasai wilayah Pulau Jawa, Sumatera, Sulawesi, dan Papua. Berikut adalah tujuan Belanda menjajah Indonesia, kecuali.....</p>', '<p>Mengambil hasil rempah-rempah</p>', '<p>Mempekerjakan tanpa upah</p>', '<p>Memonopoli perdagangan</p>', '<p>Menyebarkan agama</p>', '<p>Mengupayakan pendidikan</p>', 0, 0, 0, 0, 0, 0, 1, 5, NULL, 1),
('8f89c415-508c-4cb6-8b4b-3710651ada05', '2023-10-14 07:10:21', '2023-10-14 07:10:21', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Sari adalah seorang guru di sebuah sekolah negeri. Kini pemerintah membuat program guru belajar untuk meningkatkan kompetensi guru. Guru dapat mengikuti beberapa pelatihan daring yang dibuka di website guru belajar dan setelah menyelesaikan pelatihan akan mendapatkan sertifikat. Sikap Sari dalam menanggapi program pemerintah&hellip;</p>', '<p>Segera mengikuti pelatihan agar kompetensi Sari meningkat dan mampu membagikan ilmu kepada yang lain</p>', '<p>Biasa saja, karena tidak mempengaruhi jumlah gaji yang diterima</p>', '<p>Tidak perlu mengikuti karena memerlukan kuota yang tidak sedikit untuk mengikutinya</p>', '<p>Mengikutinya agar dapat mengumpulkan banyak sertifikat</p>', '<p>Mengikutinya karena rekan-rekan yang lain juga mengikuti pelatihan tersebut</p>', 5, 2, 1, 4, 3, 0, 1, 1, NULL, 1),
('90b2b404-a356-47e4-be4e-ad36d392f37a', '2023-10-16 09:20:57', '2023-10-16 09:20:57', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Saya adalah salah satu pegawai di Dinas Pariwisata suatu kabupaten. Hari ini pimpinan tempat saya bekerja mengadakan diskusi dengan agenda optimalisasi pariwisata di era digital. Semua karyawan diminta untuk memberi saran terkait peningkatan kunjungan dan layanan wisata agar pada tahun ini dapat mencapai target yang telah ditetapkan. Sikap saya</p>', '<p>Memberikan potongan 50% sehingga banyak wisatawan yang akan tertarik</p>', '<p>Mengusulkan untuk memberikan cashback sebesar-besarnya bagi para wisatawan</p>', '<p>Mengusulkan untuk menggunakan pelayanan promosi dan tiket secara online untuk menjangkau wisatawan lebih luas serta meningkatkan layanan secara langsung untuk wisatawan lokal</p>', '<p>Mengusulkan agar penjual yang berjualan dikawasan wisata dapat memberikan harga yang murah dan bonus kepada pengunjung</p>', '<p>Memberikan masukan bahwa untuk meningkatkan kunjungan wisatawan, pemda harus memperbaiki fasilitas-fasilitas pendukung dan memberikan semua yang masyarakat inginkan</p>', 4, 3, 5, 2, 1, 0, 1, 3, NULL, 1),
('91a482fe-a1b7-401c-9ffb-3e5f86fa9aea', '2023-10-16 08:02:06', '2023-10-16 08:02:06', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p>Seorang pengendara sepeda motor dengan kecepatan 60 km/jam dalam waktu 30 menit dapat menempuh jarak tertentu. Dengan kecepatan satu sepertiga kali lebih cepat dalam waktu 1,33 jam, pengendara tersebut akan menempuh jarak... km</p>', '<p>102,4</p>', '<p>104,6</p>', '<p>104,8</p>', '<p>106,4</p>', '<p>106,8</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('91aef2e3-45e5-4705-a6a7-db81f4b3f6b5', '2023-10-16 07:43:50', '2023-10-16 07:43:50', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p>Umur rata-rata hitung suatu kelompok yang terdiri dari guru dan dosen adalah 40 tahun. Jika umur rata-rata para guru adalah 35 tahun dan umur rata-rata para dosen adalah 50 tahun, maka perbandingan banyaknya guru dan dosen adalah....</p>', '<p>1:2</p>', '<p>2:1</p>', '<p>2:3</p>', '<p>3:2</p>', '<p>3:1</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('91cf1e7e-3780-4f11-b04f-0f2ea68c0633', '2023-10-26 07:36:51', '2023-10-26 07:36:51', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Anda adalah seorang suami dan tulang punggung keluarga. Anda karyawan perusahaan dan sangat mencintai pekerjaan anda, jika pasangan anda tidak menyukai tempat dimana anda bekerja maka sikap anda....</p>', '<p>Membawa pasangan anda ke tempat anda bekerja anda membiarkan dirinya menilainya</p>', '<p>Tetap memilih pekerjaan tersebut dengan risiko memutuskan hubungan dengan pasangan anda</p>', '<p>Mempertimbangkan untuk berhenti dari pekerjaan anda</p>', '<p>Menjelaskan bahwa anda juga mencintai pekerjaan tersebut</p>', '<p>Menanyakan alasan pasangan saya mengatakan hal tersebut</p>', 2, 1, 3, 4, 5, 0, 1, 5, NULL, 1),
('9282ac17-e639-4361-bd75-0dc214bf1e79', '2023-10-17 08:05:00', '2023-10-17 08:05:00', NULL, 'b6b3d933-7f1c-4ac1-abf2-14928a6ab49f', NULL, 0, NULL, NULL, NULL, '<p>Pada masa Orde Baru telah ditetapkan Pedoman Penghayatan dan Pengamalan Pancasila (P4). Ketetapan MPR tersebut sangat populer sepanjang masa Orde Baru, yang jargonnya adalah ingin melaksanakan Pancasila dan UUD 1945 secara murni dan konsekuen. Ketetapan MPR yang dimaksud adalah...</p>', '<p>Ketetapan MPR No. II/MPR/1987</p>', '<p>Ketetapan MPR No. II/MPR/1978</p>', '<p>Ketetapan MPR No, II/MPR/1977</p>', '<p>Ketetapan MPR No. II/MPR/1979</p>', '<p><em>Ketetapan MPR No. II/MPR/1988</em></p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('92ce64ba-3418-401a-a551-4129130a3581', '2023-10-16 08:33:16', '2023-10-16 08:33:16', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p><img src=\"/../storage/upload_files/questions/20231016033136Soal 59.jpg\" alt=\"\" width=\"381\" height=\"121\" /></p>', '<p>Gambar A</p>', '<p>Gambar B</p>', '<p>Gambar C</p>', '<p>Gambar D</p>', '<p>Gambar E</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('942ee78c-1ea4-4b1f-9c47-a70fbef15947', '2023-10-17 05:57:31', '2023-10-17 05:57:31', NULL, 'b6b3d933-7f1c-4ac1-abf2-14928a6ab49f', NULL, 0, NULL, NULL, NULL, '<p>Berikut merupakan Wewenang dan kewajiban Mahkamah Konstitusi kecuali...</p>', '<p>mengadili pada tingkat pertama dan terakhir yang putusannya bersifat final untuk menguji undang-undang terhadap UUD</p>', '<p>memutuskan sengketa kewenangan lembaga negara yang kewenangannya diberikan oleh UUD</p>', '<p>memutuskan pembubaran partai politik</p>', '<p>memutus perselisihan tentang hasil pemilihan umum</p>', '<p>mengusulkan pengangkatan hakim agung</p>', 0, 0, 0, 0, 0, 0, 1, 5, NULL, 1),
('94c90c1a-c0d2-4666-b8f3-7476048a5ccb', '2023-10-16 08:00:33', '2023-10-16 08:00:33', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p>Jarak kota Yogyakarta dan Pati adalah 300 km. soni berkendara dar&iacute; kota Yogyakarta dengan kecepatan 30 km/jam, sedangkan Jono berkendara dari kota Pati ke Yogyakarta dengan kecepatan 50 km/jam. Jika mereka berangkat pada waktu yang sama, yaitu pukul 09.10,, maka mereka akan berpapasan pada pukul&hellip;</p>', '<p>12.22</p>', '<p>12.34</p>', '<p>12.38</p>', '<p>12.42</p>', '<p>12.55</p>', 0, 0, 0, 0, 0, 0, 1, 5, NULL, 1),
('960a27fa-1316-4e9b-89da-f647f8945ee5', '2023-10-18 03:08:18', '2023-10-18 03:08:18', NULL, '557e3be9-1ea4-45e4-8163-29eb4435e058', NULL, 0, NULL, NULL, NULL, '<p><img src=\"/storage/upload_files/questions/20231018100647soal 32.jpg\" alt=\"\" width=\"500\" height=\"250\" /></p>', '<p>Gambar A</p>', '<p>Gambar B</p>', '<p>Gambar C</p>', '<p>Gambar D</p>', '<p>Gambar E</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('96926777-20c2-4411-a25d-bc341a2b5779', '2023-10-26 07:13:39', '2023-10-26 07:13:39', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Instansi kantor anda melaksanakan pelatihan yang sangatlah bermanfaat bagi peningkatan kemampuan anda. Akan tetapi pelatihan tersebut diadakan dihari sabtu dan minggu. Hal yang harus saya lakukan adalah....</p>', '<p>Lebih baik saya mengikuti pelatihan yang diadakan bukan dihari libur</p>', '<p>Hari libur sabtu dan minggu adalah hak pegawai untuk berlibur dari urusan pekerjaan dan yang berkaitan dengannya</p>', '<p>Saya bersedia untuk mengorbankan dua hari libur tersebut untuk bisa ikut dalam pelatihan</p>', '<p>Saya bersedia untuk mengikuti pelatihan akan tetapi hanya dihari sabtu saja</p>', '<p>Saya menyarankan kepada pegawai lain yang masih lajang saja untuk mengikuti pelatihan tersebut</p>', 2, 1, 5, 4, 3, 0, 1, 3, NULL, 1),
('9853ceb4-f5b2-4ac6-b92f-42ea293d8741', '2023-10-13 06:41:06', '2023-10-13 06:41:06', NULL, 'dfcc80d7-7e2f-4c19-88cc-d69371bbee12', NULL, 0, NULL, NULL, NULL, '<p>Cermatilah kalimat berikut!</p>\n<ul>\n<li>Pada era globalisasi ini, diakui oleh seluruh lapisan masyarakat bahwa teknologi dan ilmu pengetahuan mengalami perkembangan yang pesat sehingga berdampak besar pada lingkungan kehidupannya</li>\n<li>Hal ini tercermin dalam upaya masyarakat yang terus berusaha untuk belajar dan menyesuaikan diri dengan perkembangan yang ada</li>\n<li>Mereka terbius oleh kecanggihan teknologi sehingga dampak negatif yang ditimbulkan oleh teknologi tersebut sering terabaikan</li>\n<li>Namun, saat ini mulai disangsikan manfaatnya karena dianggap merusak tata lingkungan dan terjadi banyak bencana</li>\n<li>Karena itu, yang perlu direnungkan adalah bagaimana manusia dapat mempertahankan kearifan dalam mengolah lingkungan hidup tersebut</li>\n</ul>\n<p>Urutan kalimat tersebut agar menjadi paragraf eksposisi yang padu adalah.&hellip;&hellip;</p>', '<p>(1), (2), (3), (4), (5)</p>', '<p>(2), (1), (5), (3), (4)</p>', '<p>(3), (2), (1), (5), (4)</p>', '<p>(4), (1), (3), (5), (4)</p>', '<p>(5), (2), (3), (4), (1)</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('98baf3e9-7e29-4ca3-8099-baefed8f30dc', '2023-10-25 06:18:45', '2023-10-25 06:18:45', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Anda adalah seorang anggota unit biasa. Saat ini unit anda dihadapkan pada situasi rumit yang membutuhkan pengambilan keputusan saat ini juga dari pimpinan unit, padahal pimpinan unit baru tiba dikantor 4 jam lagi, sikap anda adalah...</p>', '<p>Tetap menunggu pimpinan unit untuk datang</p>', '<p>Meminta rekan lain saja yang mengambil keputusan agar anda tidak disalahkan</p>', '<p>Bagaimanapun juga, saya tidak bersedia mengambil keputusan karena hal itu berisiko tinggi bagi karier saya</p>', '<p>Saya akan mengambil keputusan untuk menyelamatkan kondisi rumit tersebut</p>', '<p>Saya menelpon dulu pimpinan lalu mengambil keputusan sesual arahan pimpinan dan berdasarkan kondisi saat itu</p>', 4, 3, 2, 1, 5, 0, 1, 5, NULL, 1),
