('9aa0b95b-2997-4837-9a6f-7fa200842766', '2023-10-18 08:04:33', '2023-10-18 08:04:33', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Suatu hari Aya, meminjam buku Cerita favorit sAya dan karena suatu alasan buku tersebut dihilangkan oleh teman dekat saya. Reaksl saya&hellip;.</p>', '<p>Saya marah kepada teman saya</p>', '<p>Saya memintanya mengganti buku tersebut karena buku itu favorit saya</p>', '<p>Saya menyukai buku tersebut namun buku itu telah hilang</p>', '<p>Saya memusuhinya dan melarangnya meminjam buku saya lagi</p>', '<p>Saya memintanya mengganti dan mengatakan kepadanya untuk lebih berhati-hati Jika dia meminjam buku saya lagi</p>', 3, 4, 2, 1, 5, 0, 1, 5, NULL, 1),
('9bf08700-bcfe-491d-b1c6-688472329155', '2023-10-16 04:15:09', '2023-10-16 04:15:09', NULL, '7353afdf-8c22-4e71-a553-90921b9692ab', NULL, 0, NULL, NULL, NULL, '<p>Semangat nasionalisme perlu ditanamkan dengan menghargai lambang negara. Secara konstitusional, lambang negara Indonesia adalah</p>', '<p>Sang Saka Merah Putih</p>', '<p>Bahasa Indonesia</p>', '<p>Garuda Pancasila</p>', '<p>Lagu Indonesia Raya</p>', '<p>Bhinneka Tunggal Ika</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('9cad08b7-05d9-4d2f-bc28-84e13547efcc', '2023-10-13 08:46:52', '2023-10-13 08:46:52', NULL, 'e9f84a80-562c-4b59-b70d-8f1c9f4e3b4f', NULL, 0, NULL, NULL, NULL, '<p>Rumah Dinda jaraknya 2,2 km dari sekolah. Bila ia berjalan dengan kecepatan rata-rata 4 km/jam, berapa jam yang dibutuhkan olehnya untuk berjalan pergi pulang selama seminggu bila ia sekolah dari hari Senin sampai Jumat? ..</p>', '<p>5 jam</p>', '<p>5,2 jam</p>', '<p>5,5 jam</p>', '<p>5,7 jam</p>', '<p>6 jam</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('9ce14a61-5817-4a2b-ab7a-c321c68be383', '2023-10-25 06:29:19', '2023-10-25 06:29:19', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Setiap kali ada rapat penting pasti anda selalu terlambat datang pimpinan seringkali menegurnya. Namun seiring berjalannya waktu keadaan tidak berubah kali ini rapat sangat penting anda beranggapan jika rapat terlambat maka anda dan orang lain di kelompok ini akan kesulitan dalam pendelegasian tugas. Benar saja teman anda datang terlambat setelah rapat berlangsung setengah jam. la baru tiba masuk dalam kelompok anda dan mengatakan minta maaf jika terlambat, padahal tugas dia sudah dibacakan oleh pimpinan setengah jam yang lalu. Artinya dia datang sekarang pun tidak ada gunanya. Sebagai anggota kelompok sikap anda....</p>', '<p>Menggantikan pekerjaannya karena biar cepat selesai</p>', '<p>Berusaha menyelesaikan tugas tepat waktu agar beres semua</p>', '<p>Akan bekerja sesuai tugas kepadanya</p>', '<p>Berusaha memberi informasi kepadanya</p>', '<p>Semua tetap berkerja sesuai tugasnya</p>', 1, 4, 3, 2, 5, 0, 1, 5, NULL, 1),
('9d006b30-97eb-4710-a5b1-f0f1d2413aaa', '2023-10-13 07:55:14', '2023-10-13 07:55:14', NULL, 'e9f84a80-562c-4b59-b70d-8f1c9f4e3b4f', NULL, 0, NULL, NULL, NULL, '<p>Enam mahasiswa yaitu A, B, C, D, E, dan F. masing-masing akan presentasi di depan kelas. Masing-masing hanya akan maju ke depan kelas satu kali saja dan sesuai dengan urutan sebagai berikut:</p>\n<ul>\n<li>C akan maju pada urutan keempat atau terakhir</li>\n<li>D akan menjadi pembicara ketiga setelah A</li>\n<li>B akan maju sebelum C</li>\n<li>F akan maju sebelum D</li>\n</ul>\n<p>Dari urutan berikut, manakah yang memenuhi persyaratan tersebut ?...</p>', '<p>E, F, A, C, B, D</p>', '<p>A, F, C, D, B, E</p>', '<p>E, F, A, B, D, C</p>', '<p>B, A, F, E, D, C</p>', '<p>F, A, D, E, B, C</p>', 0, 0, 0, 0, 0, 0, 1, 5, NULL, 1),
('9d4a5d8d-f40b-4a08-9a83-f5b144411feb', '2023-10-18 03:57:09', '2023-10-18 03:57:09', NULL, '557e3be9-1ea4-45e4-8163-29eb4435e058', NULL, 0, NULL, NULL, NULL, '<p>Setiap harinya di keluarga Susan, tugas mencuci piring, memasak dan berbelanja dilaksanakan oleh tiga orang. Keluarga Susan terdiri dari 5 anggota keluarga, yaitu ayah, ibu, Susan. Rano,dan Santi. Ayah tidak bertugas pada hari Rabu, Kamis, dan Sabtu. Ibu tidak dapat bertugas pada hari Rabu dan Sabtu. Susan hanya bisa bertugas pada hari Kamis dan Jumat. Rano hanya mencuci, memasak dan berbelanja pada hari Minggu. Santi hanya membantu pada hari Jumat dan Senin pada minggu pertama setiap bulannya. Anggota keluarga yang bertugas mencuci piring, memasak dan berbelanja pada tiap hari Jumat ialah....</p>', '<p>Santi, Ibu, Ayah</p>', '<p>Rano, Santi, Ibu</p>', '<p>Ayah, Ibu, dan Susan</p>', '<p>Ayah, Susan, dan Rano</p>', '<p>Susan, Santi. Rano</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('9db1839d-7097-480a-bfa9-1f9ba4e136b9', '2023-10-17 07:53:34', '2023-10-17 07:53:34', NULL, 'b6b3d933-7f1c-4ac1-abf2-14928a6ab49f', NULL, 0, NULL, NULL, NULL, '<ol>\n<li>Bangsa Indonesia menyatakan kepercayaanya dan ketaqwaanya kepada Tuhan Yang Maha Esa.</li>\n<li>Mengembangkan sikap saling mencintai sesama manusia.</li>\n<li>Memajukan pergaulan demi persatuan dan kesatuan bangsa.</li>\n<li>Keputusan yang diambil harus dapat dipertanggungjawabkan secara moral kepada Tuhan Yang Maha Esa, menjunjung tinggi harkat dan</li>\n<li>martabat manusia, nilai-nilai kebenaran dan keadilan mengutamakan persatuan dan kesatuan demi kepentingan bersama.</li>\n<li>Suka melakukan kegiatan dalam rangka mewujudkan kemajuan yang merata dan berkeadilan sosial.</li>\n</ol>\n<p>Pernyataan yang merupakan pengamalan sila ke-1 dan sila ke-3 adalah</p>', '<p>1 dan 2</p>', '<p>3 dan 4</p>', '<p>2 dan 3</p>', '<p>1 dan 3</p>', '<p>4 dan 5</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('9df3dbb5-dec0-4851-a985-9511e8a95f5e', '2023-10-17 04:15:59', '2023-10-17 04:15:59', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Anda adalah karyawan di perusahaan yang sekarang ini sedang melaksanakan Work From Home akibat dampak dari pandemi. Setiap pukul 08.00 akan diadakan briefing melalui media video conference. Permasalahannya, akses internet dirumah anda tidak lancar sehingga anda seringterlambat menghadiri briefing dan tidak dapat mengikuti briefing dengan baik. Apa yang akan anda lakukan?</p>', '<p>Meminta pengertian kepada atasan anda bahwa akses internet dirumah anda tidak begitu lancar sehingga sering terlambat briefing</p>', '<p>Mencari tempat yang memiliki akses internet yang lancar sebelum briefing melalui media video conference</p>', '<p>Mencari informasi penyedia jasa pelayanan internet yang,memiliki akses yang lancar di daerah anda</p>', '<p>Meminta bantuan kepada tetangga yang mempunyai wifi untuk berbagi akses internet sehingga dapat mengikuti briefing dengan baik</p>', '<p>Memasang wifi sebagai upaya untuk mendapatkan akses internet yang memadai dirumah anda</p>', 1, 4, 2, 3, 5, 0, 1, 5, NULL, 1),
('9dfe66a1-56a8-4e0a-8fa0-36cb6975ec2e', '2023-10-17 03:34:23', '2023-10-17 03:34:23', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Anda bersama dengan tim anda akan melakukan survey di suatu daerah, salah satu anggota anda adalah ibu hamil. Keadaan ini membuat kerja tim anda lebih lamban dari tim lainnya. Apa yang harus anda lakukan ?</p>', '<p>Menerima segala kondisi karena semuanya sudah konsekuensi dalam bekerja bersama tim</p>', '<p>Menanyakan keadaan anggota tim tersebut dan memintanya menaikkan tempo kerjanya</p>', '<p>Hal tersebut tidak bisa dihindarkan dan mengapresiasi teman tersebut karena masih mau bekerja dengan semangat walaupun sedang hamil</p>', '<p>Mengecek keadaan anggota tim tersebut dan memintanya menaikkan tempo kerjanya agar tidak tertinggal jauh dengan tim lainnya</p>', '<p>Mengecek keadaan anggota tim tersebut secara terus menerus dan menyemangati anggota tim lain untuk terus semangat dan tidak masalah jika kerja tim menjadi lambat</p>', 3, 1, 5, 2, 4, 0, 1, 3, NULL, 1),
('9e035782-3109-446d-a22f-4467b8ea3899', '2023-10-19 07:16:19', '2023-10-19 07:16:19', NULL, '80cec561-fc0b-46c7-aed4-f0ad73061557', NULL, 0, NULL, NULL, NULL, '<p>Ketetapan arah kebijaksanaan pertahanan dan keamanan, antara lain disebut pengembangan kemampuan sistem pertahan keamanan rakyat semesta yang bertumpu pada kekuatan rakyat. TNI dan Polri sebagai kekuatan utama yang didukung komponen lainnya dengan meningkatkan kesadaran bela negara, melalui wajib latih dan membangun kondisi juang sertamewujudkan kebersamaan TNI, Polri, dan rakyat diatur dalam......</p>', '<p>UU No.3 tahun 2002</p>', '<p>UU No.2 tahun 2002</p>', '<p>TAP MPR No. IV/MPR/1999</p>', '<p>UU No.39 Tahun 1999</p>', '<p>TAP MPR No. XI / MPR 1999</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('9e16fa46-d614-4e79-936b-b99fcc2e0330', '2023-10-16 05:13:10', '2023-10-16 05:13:10', NULL, '7353afdf-8c22-4e71-a553-90921b9692ab', NULL, 0, NULL, NULL, NULL, '<p>Nasionalisme terdiri dari dua aspek, yaitu risorgimento dan integral. Integral nasionalism mengacu pada....</p>', '<p>upaya pembangunan dari tekanan sosial yang dihadapi oleh suatu kelompok masyarakat</p>', '<p>upaya pembebasan dari tekanan politik yang dihadapi oleh suatu kelompok masyarakat dalam upayanya membentuk dan membangun rasakebangsaan</p>', '<p>pembebasan dan pembentukan paham kebangsaan yang terus berkelanjutan dalam suatu negara-bangsa</p>', '<p>pembentukan dan pembangunan paham kebangsaan yang terus berkelanjutan dalam suatu negara-bangsa</p>', '<p>upaya pembebasan dari tekanan sosial dan politik yang dihadapi oleh suatu kelompok masyarakat dalam upayanya membentuk dan membangun rasa kebangsaan</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
