('9ea48c9f-72f9-4f4d-baec-b0d382f69a34', '2023-10-18 05:23:24', '2023-10-18 05:23:24', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Saya berhasil melewati hambatan dipekerjaan saya karena saya.....</p>', '<p>saya tidak putus ada ketika mengalami kegagalan</p>', '<p>saya mendapat dukungan dari sekitar</p>', '<p>saya berani mengambil resiko dan bertanggung jawab</p>', '<p>saya berani mencoba hal baru dan mengeksplor banyak hal</p>', '<p>hanya keberuntungan dan coba-coba saja</p>', 5, 3, 4, 2, 1, 0, 1, 1, NULL, 1),
('9eee4b81-7d40-4dae-a996-debb2d2b9e20', '2023-10-16 05:02:29', '2023-10-16 05:02:29', NULL, '7353afdf-8c22-4e71-a553-90921b9692ab', NULL, 0, NULL, NULL, NULL, '<p>Berikut ini merupakan hasil ratifikasi konvensi Internasional yang dilakukan oleh Pemerintah Indonesia paska reformasi, kecuali..</p>', '<p>Pengesahan konvensi yang menentang penyiksaan dan perlakuan atau penghukuman lain yang kejam, tidak manusiawi atau merendahkan martabat manusia</p>', '<p>Kebebasan berserikat dan perlindungan hak untuk berorganisasi</p>', '<p>Pelanggaran dan tindakan segera penghapusan bentuk-bentuk pekerjaan terburuk untuk anak</p>', '<p>Usia minimum untuk diperbolehkan bekerja</p>', '<p>Konvensi perubahan dokumen identitas pegawai negeri</p>', 0, 0, 0, 0, 0, 0, 1, 5, NULL, 1),
('9f690c6d-f158-4119-bf3c-8008ca2e1b0c', '2023-10-20 06:43:26', '2023-10-20 06:43:26', NULL, '00cc482f-6b53-42a2-9045-e1b555bb5d19', NULL, 0, NULL, NULL, NULL, '<p>Untuk mengisi liburan panjang akhir semester, Lila, Indi, Lulu, Tata dan Doni sedang dalam perjalanan menuju sebuah tempat wisata di kota sebelah dengan mengendarai sepeda motor.</p>\n<p>Lila mengendarai sepeda motor dengan kecepatan lebih kecil daripada Indi tetapi tidak lebih besar daripada Tata</p>\n<ul>\n<li>Lulu mengendarai sepeda motor dengan kecepatan tidak lebih dari Tata dan tidak kurang Indi.</li>\n<li>Doni mengendarat sepeda motor dengan kecepatan tidak lebih dari Indi dan tidak kurang dari Lili</li>\n</ul>\n<p>Bagaimanakah urutan anak yang mengendarai sepeda motor dengan kecepatan paling kecil ?</p>', '<p>Lila-Doni-Indi-Lulu-Tata</p>', '<p>Lila-Indi-Doni-Lulu-Tata</p>', '<p>Doni-Lulu-Tata-Indi-Lila</p>', '<p>Tata-Lulu-Indi-Lila-Doni</p>', '<p>Tata-Lulu-Indi-Doni-Lila</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('9f9c2653-0d4c-4f6c-af5c-35d297426870', '2023-10-25 06:22:13', '2023-10-25 06:22:13', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Anda adalah seorang ASN senior di sebuah instansi suatu hari anda mendapat video dari salah satu group WhatsApp anda tentang pengangkatan honorer yang sudah mengabdi lebih dari 8 tahun menjadi PNS tanpa tes. Anda sangat bahagia dengan berita tersebut karena mayoritas rekan-rekan kerja anda adalah honorer yang sudah mengabdi bertahun-tahun namun belum diangkat. Setiap hari ketika melihat rekan anda yang merupakan honorer tetapi sangat berdedikasi dalam berkerja, anda berdoa dengan tulus agar mereka segera diangkat menjadi ASN untuk mendapatkan kehidupan yang lebih baik dengan penghasilan yang lebih layak. Informasi dari video yang anda dapatkan dari satu grup WhatsApp tersebut bagikan jawaban dari doa-doa anda selama ini. Tanpa pikir panjang, anda segera membagikannya ke grup sekolah anda dan dalam sekejap banyak ucapansyukur, optimis dan terima kasih dari rekan-rekan anda yang merasa bahagia dengan informasi tersebut. Beberapa rekan anda yang merupakan ASN baru dan masih sangat mudah, pesan tersebut berisi informasi bahwa berita yang baru anda kirimkan adalah hoax dan ia juga menyatakan bukti-bukti valid bahwa video tersebut hanyalah hoax, maka hal yang sebaiknya anda lakukan.......</p>', '<p>Mengucapkan terima kasih atas informasi yang telah diberikan junior anda</p>', '<p>Segera mengklarifikasi di grup WhatsApp kantor bahwa berita yang anda sampaikan tidak benar</p>', '<p>Mengucapkan terima kasih atas informasi yang diberikan junior anda dan memintanya untuk tetap diam sampai suasana kondusif</p>', '<p>Berterimakasih pada junior anda dan menunggu waktu yang tepat untuk mengklarifikasi berita di grup</p>', '<p>Berterimakasih pada junior anda dan meminta maaf serta mengklarifikasi di grup kantor</p>', 3, 4, 1, 2, 5, 0, 1, 5, NULL, 1),
('9f9eda79-c464-43b5-ae0b-a7f56385c384', '2023-10-17 04:08:40', '2023-10-17 04:08:40', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Anda adalah pegawai divisi pelaksanaan dan perencanaan proyek pada suatu perusahaan swasta. Perusahaan tersebut meminta para pegawainya untuk mengisi laporan harian kegiatan secara online melalui aplikasi web. Namun, anda sering bekerja di lapangan sehingga membuat pengisian laporan harian kegiatan terkendala sinyal, maka sikap anda sebaiknya...</p>', '<p>Meminta kelonggaran pada atasan untuk membuat laporan harian kegiatan secara manual</p>', '<p>Meminta teman yang berada di lokasi yang memiliki sinyal bagus untuk mengisi laporan harian kegiatan milik anda</p>', '<p>Saat anda berada di tempat dengan sinyal yang buruk, anda menunda pengisian laporan harian kegiatan keesokan saja</p>', '<p>Berusaha mencari tempat dengan sinyal yang baik untuk dapat mengisi laporan harian kegiatan harian</p>', '<p>Mengisi laporan harian kegiatan di kantor saat sedang tidak bekerja di lapangan</p>', 1, 3, 4, 5, 2, 0, 1, 4, NULL, 1),
('9fd970df-f2b9-466c-a65f-b6433f713166', '2023-10-14 05:08:30', '2023-10-14 05:08:30', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Pada sebuah diskusi dengan tim kerja yang terdiri dari rekan-rekan kerja Anda di kantor biasanya saya adalah...</p>', '<p>Pendengar dan pengamat yang baik dalam diskusi</p>', '<p>Lebih banyak mendengar dan berbicara sekadarnya</p>', '<p>Jika perlu bicara maka saya utarakan, jika tidak maka saya cukup mendengar</p>', '<p>Mengamati sejenak lalu aktif berpendapat</p>', '<p>Selau aktif berpendapat dan mengarahkan teman-teman untuk berpendapat juga</p>', 1, 2, 3, 4, 5, 0, 1, 5, NULL, 1),
('a10e5aa9-a751-4239-9742-7201a51f1a1b', '2023-10-13 05:57:05', '2023-10-13 05:57:05', NULL, 'dfcc80d7-7e2f-4c19-88cc-d69371bbee12', NULL, 0, NULL, NULL, NULL, '<p>Berikut ini yang merupakan contoh sikap dan perilaku yang mencerminkan Kesadaran Berbangsa dan Bernegara dalam kehidupan sehari-hari adalah....</p>', '<p>Mencintai, menjaga dan melestarikan lingkungan hidup</p>', '<p>Menjaga nama baik bangsa dan negara</p>', '<p>Menjalankan hak dan kewajiban sesuai peraturan perundang-undangan yang berlaku</p>', '<p>Memahami dan mengamalkan nilai-nilai Pancasila dalam kehidupan sehari-hari</p>', '<p>Mendahulukan kepentingan bangsa dan negara daripada kepentingan pribadi atau golongan</p>\n<p>&nbsp;</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1);
