('a1ee086d-05f6-43bb-839d-4fb6f381d3b9', '2023-10-17 09:06:43', '2023-10-17 09:06:43', NULL, 'b6b3d933-7f1c-4ac1-abf2-14928a6ab49f', NULL, 0, NULL, NULL, NULL, '<p>Dalam kehidupan yang berdasarkan Pancasila, kehidupan bermasyarakat tidak dapat dipisahkan satu dengan yang lainnya, begitu pula dalam hal perekonomian yang harus mengedepankan kepentingan bersama. Hal itu sesuai dengan prinsip Pancasila, yaitu sila.......</p>', '<p>Pertama</p>', '<p>Kedua</p>', '<p>Ketiga</p>', '<p>Keempat</p>', '<p>Kelima</p>', 0, 0, 0, 0, 0, 0, 1, 5, NULL, 1),
('a23ae8d3-b1dd-4bf9-b4fb-3bb69af6f276', '2023-10-26 06:35:28', '2023-10-26 06:35:28', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Sebagai bagian dan penerapan sistem informasi yang baru. Setiap pegawai dikantor saya diminta untuk segera melakukan update data pribadi secara online. Tindakan saya adalah.&hellip;...</p>', '<p>Meminta bantuan pendampingan karena keterbatasan saya di bidang teknologi</p>', '<p>Menunggu rekan kerja yang lain untuk melakukan update dan mengikuti cara mereka</p>', '<p>Melakukan update sesegera mungkin dengan meminta bantuan dari tim sistem informasi</p>', '<p>Mengabaikan pekerjaan tersebut dengan harapan sistem tersebut masih dalam percobaan</p>', '<p>Mempelajari cara melakukan update dan data apa saja yang harus dimasukan dalam sistem</p>', 4, 2, 5, 1, 3, 0, 1, 3, NULL, 1),
('a3043979-e382-4560-a8be-f0926efa2a20', '2023-10-14 03:48:22', '2023-10-14 03:48:22', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Anda bekerja di bagian farmasi di salah satu Rumah Sakit Pemerintah. Pada suatu hari ada orang yang membawa resep mengenai suatu obat akan tetapi resep itu tidak anda kenali. Untuk mengatasi persoalan itu, pembeli ini kemudian menawarkan sejumlah uang untuk anda dan mengatakan bahwa obat itu sangat dibutuhkannya. Tindakan anda adalah...</p>', '<p>Saya menerima tawaran tersebut karena pada dasarnya obat itu tidak berbahaya</p>', '<p>Saya agak ragu akan memutuskan tindakan apa</p>', '<p>Saya langsung menyatakan ketidakmampuan saya memberikan obat tersebut</p>', '<p>Saya berdiskusi dengan rekan satu unit saya mengenai hal tersebut</p>', '<p>Saya tidak menerima uangnya namun tetap memberikan obatnya dengan alasan kemanusiaan</p>', 1, 2, 5, 4, 3, 0, 1, 3, NULL, 1),
('a30bcc02-f3ff-4801-9de1-9fbff3d67823', '2023-10-19 07:43:39', '2023-10-19 07:43:39', NULL, '80cec561-fc0b-46c7-aed4-f0ad73061557', NULL, 0, NULL, NULL, NULL, '<p>Kanker paru saat ini sangat ditakuti sebagai salah satu penyakit yang mematikan. Hanya 25 persen kanker jenis ini dapat terdiagnosis pada tahap dini. Para ahli telah berupaya menemukan cara agar bisa mendeteksi sedini mungkin kanker paru sehingga pasien bisa diselamatkan. Di antara mereka adalah para peneliti dari University of Kelitucky\'s Chandleer Medical di Lexington, AS yang mencoba teknik pemeriksaan antibodi dengan ketepatan tinggi untuk mendiagnosis sel kanker tahap dini.Mereka menganalisis 212 \"calon\" penderita kanker dengan semacam protein antibodi. Cara ini bisa digunakan untuk membedakan antara tumor jinak dan kanker. Makna kata Antibodi pada paragraf di atas adalah......</p>', '<p>Zat yang menghambat kerja enzim</p>', '<p>Zat yang dibentuk dalam darah untuk memusnahkan bakter&iacute; virus atau untuk melawan toksin yang dihasilkan oleh bakteri</p>', '<p>Zat yang mempunyai kemampuan untuk menghambat timbulnya bau apek</p>', '<p>Zat yang dapat merangsang pembentukan antibodi jika diinjeksikan ke dalam tubuh</p>', '<p>Zat yang ditambahkan dalam zat lain atau sistem lain untuk mencegah pembekuan</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('a36bb6f5-f7ad-4b13-a67a-623e7072cd92', '2023-10-19 06:59:04', '2023-10-19 06:59:04', NULL, '80cec561-fc0b-46c7-aed4-f0ad73061557', NULL, 0, NULL, NULL, NULL, '<p>Teori geopolitik Indonesia merupakan doktrin dasar bagi terbentuknya suatu negara nasional yang kuat dan tangguh. Sebagai dokrin, berikut ini adalah unsur yang harus diperhatikan, kecuali...</p>', '<p>Konsepsi ruang</p>', '<p>Konsepsi wilayah</p>', '<p>Konsepsi politik</p>', '<p>Konsepsi keamanan</p>', '<p>Konsepsi frontier</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('a3bb32aa-4754-4a16-b0ca-fe9a35db8f61', '2023-10-14 07:35:08', '2023-10-14 07:35:08', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Ketika sedang mengerjakan laporan rutin saya diminta oleh Kepala Bagian Personalia untuk mewawancarai calon staff untuk unit kerja saya. Tindakan saya adalah...</p>', '<p>Saya akan tetap mengerjakan laporan tersebut karena apabila tertunda akan membuat banyak pihak kerepotan</p>', '<p>Saya akan segera menuju ruangan yang diminta Kabag Personalia karena ini untuk unit saya juga</p>', '<p>Saya akan melakukan wawancara tersebut karena sifat dari laporan yang saya kerjakan adalah sebuah rutinitas</p>', '<p>Saya akan menyanggupi untuk melakukan wawancara, karena pada dasarnya dua hal ini sama-sama berupa pekerjaan</p>', '<p>Saya akan menyelesaikan laporan tersebut terlebih dahulu karena bisa jadi akan dibutuhkan kapan saja</p>', 4, 3, 2, 1, 5, 0, 1, 5, NULL, 1),
('a3f8584f-14dd-4a5b-9486-918ed3f5e9e8', '2023-10-20 08:08:32', '2023-10-20 08:08:32', NULL, '00cc482f-6b53-42a2-9045-e1b555bb5d19', NULL, 0, NULL, NULL, NULL, '<p><img src=\"/storage/upload_files/questions/20231020030723Soal 55.jpg\" alt=\"\" width=\"604\" height=\"177\" /></p>', '<p>2</p>', '<p>&frac12;</p>', '<p>3/2</p>', '<p>3 1/3</p>', '<p>2 1/3</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('a4126009-0b00-4678-9f56-72ee816a1cf1', '2023-10-16 09:22:58', '2023-10-16 09:22:58', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Saya adalah seorang pegawai perusahaan asuransi. Saat ini saya sedang sedang mengambil cuti bulan madu untuk beberapa hari. Namun, tiba-tiba ada pelanggan yang pernah saya layani menghubungi dan menanyakan hal-hal yang berkaitan dengan urusan perusahaan. Sikap saya....</p>', '<p>Mematikan handphone dan tidak menjawab panggilan dari pelanggan</p>', '<p>Menjawab telepon tersebut kemudian menjelaskan segala permasalahan yang pelanggan sedang hadapi</p>', '<p>Mengalihkan panggilan kepada teman kerja saya sesuai dengan tugasnya</p>', '<p>Memahami permasalahan yang dihadapi oleh pelanggan, kemudian meneruskan kepada teman saya yang di kantor</p>', '<p>Memohon maaf, dan menjelaskan kondisi saya bahwa sedang cuti serta memberikan nomor kantor untuk dapat dihubungi</p>', 1, 3, 2, 4, 5, 0, 1, 5, NULL, 1),
