('a7caf05f-c711-470c-8d92-f0c83a07d7b0', '2023-10-19 06:42:59', '2023-10-19 06:42:59', NULL, '80cec561-fc0b-46c7-aed4-f0ad73061557', NULL, 0, NULL, NULL, NULL, '<p>Bentuk dari nasionalisme dimana negara mendapatkan kebenaran politik sebagai suattu hal yang alamiah dan juga ekspresi dari suatu bangsa atau ras merupakan pengertian dari....</p>', '<p>Nasionalisme sipil</p>', '<p>Nasionalisme romantis</p>', '<p>Nasionalisme sosial</p>', '<p>Nasionalisme kenegaraan</p>', '<p>Nasionalisme etnis</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('a7cb523a-dc70-4a1b-a968-d5e16b7e59e8', '2023-10-14 06:50:11', '2023-10-14 06:50:11', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Deni adalah seorang mahasiswa tingkat akhir. Dia sering mendapatkan nilai buruk karena lupa mengumpulkan tugas. Sifat pelupa ini juga mempengaruhi kehidupan berorganisasinya. Deni sering melewatkan rapat organisasi karena lupa kapan jadwalnya. Seorang teman menyarankan Deni untuk menggunakan aplikasi pengingat di handphonenya. Sikap Deni sebaiknya...</p>', '<p>Mencoba aplikasi saat Deni merasa kegiatannya sangat padat dan memiliki banyak tugas untuk diserahkan</p>', '<p>Menggunakan aplikasi pengingat untuk membantu mengatur waktu dalam mengumpulkan tugas dan mengikuti kegiatan organisasi</p>', '<p>Mengajak teman-temannya untuk menggunakan aplikasi pengingat agar lebih mudah dalam mengatur waktu</p>', '<p>Menggunakan catatan secara manual di buku harian karena ini lebih mudah</p>', '<p>Menggunakan fitur-fitur yang tersedia di aplikasi pengingat agar seluruh kegiatannya dapat terperinci dengan baik</p>', 4, 5, 2, 1, 3, 0, 1, 2, NULL, 1),
('aa035619-2ec0-454a-b9f9-dfaec8482659', '2023-10-18 03:59:55', '2023-10-18 03:59:55', NULL, '557e3be9-1ea4-45e4-8163-29eb4435e058', NULL, 0, NULL, NULL, NULL, '<p>Hasil survei kampung X menunjukan bahwa oncom lebih disukai daripada ketan goreng, rawon dan gudeg sama-sama disukai tetapi oncom lebih disukai daripada rawon dan gudeg. Sate lebih disukai daripada oncom, Rawon lebih disenangi daripada ketan goreng. Urutan makanan berdasarkan yang paling digemari sampai yang tidak digemari adalah?</p>', '<p>Gudeg atau rawon, oncom, sate, kemudian ketan goreng</p>', '<p>Sate, rawon atau gudeg, keroncong kemudian ketan goreng</p>', '<p>Oncom, sate, rawon atau gudeg kemudian ketan goreng</p>', '<p>Sate, oncom, rawon atau gudeg, kemudian ketan goreng</p>', '<p>Oncom, sate, rawon atau gudeg, kemudian ketan goreng</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('aa7f97d9-aec0-443d-bd90-bad7346cb9cc', '2023-10-18 09:01:28', '2023-10-18 09:01:28', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Sebagai ketua RT anda diundang untuk menghadiri acara keagamaan kaum minoritas yang agamanya bukan agama yang anda peluk, yang anda lakukan....</p>', '<p>Menghadiri undangannya dan mengikuti tiap sesinya</p>', '<p>mengirimkan wakil untuk menghadiri acaranya</p>', '<p>menolak karena tidak sesuai dengan agama yang anda anut</p>', '<p>menolak dan tidak menghadirinya dengan alasan sedemikian rupa agar meyakinkan mereka</p>', '<p>menghadiri undangannya meski tidak harus sampai selesai acara tersebut</p>', 4, 3, 1, 2, 5, 0, 1, 5, NULL, 1),
('aa8eb02b-f1da-4893-ad62-012b76a80887', '2023-10-25 04:04:06', '2023-10-25 04:04:06', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Pada hari kerja atasan menyuruh untuk menutup pelayanan dan mengajak seluruh pegawai kantor untuk menghadiri pesta pernikahan salah satu mitra bisnisnya. Yang anda lakukan adalah......</p>', '<p>Ikut pergi ke pesta pernikahan sebentar kemudian kembali untuk melakukan pelayanan</p>', '<p>Meminta ijin atasan untuk melaksanakan pelayanan terlebih dahulu kemudian menyusul ke tempat pesta</p>', '<p>Mengajak teman untuk tetap melaksanakan pelayanan dan tidak menghadiri pesta</p>', '<p>Menolak ide atasan dengan keras karena banyak yang membutuhkan pelayanan</p>', '<p>Menerima saja dan ikut pergi ke pesta pernikahan</p>', 4, 5, 3, 1, 2, 0, 1, 2, NULL, 1),
('ac01a4dc-5af4-4961-9f5b-0cba47df3b42', '2023-10-23 09:11:31', '2023-10-23 09:11:31', NULL, '00cc482f-6b53-42a2-9045-e1b555bb5d19', NULL, 0, NULL, NULL, NULL, '<p><img src=\"/storage/upload_files/questions/20231023041004Soal 59.jpg\" alt=\"\" width=\"538\" height=\"265\" /></p>', '<p>Gambar A</p>', '<p>Gambar B</p>', '<p>Gambar C</p>', '<p>Gambar D</p>', '<p>Gambar E</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 3),
('ac5cbdc2-5edc-4e5e-8464-bf26114534ad', '2023-10-14 04:06:29', '2023-10-14 04:06:29', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Mengarahkan konsumen ke loket lainnya, dengan melihat bahwa penjaga loket yang merupakan rekan Saya waktunya lebih luang</p>', '<p>Mengarahkan konsumen ke satpam karena satpam lebih mudah dimintai bantuan</p>', '<p>Mengarahkan konsumen ke satpam karena satpam lebih mudah dimintai bantuan</p>', '<p>Mengarahkan konsumen ke loket yang seharusnya, yaitu loket administrasi yang berada di lantai dua. Semua itu sudah sesuai dengan aturan yang diberlakukan</p>', '<p>Memberi saran ke konsumen bahwa sebaiknya dia membawa rekan atau saudara yang bisa membantu keperluannya karena perlu diingat bahwa dia difabel</p>', '<p>Mencari rekan pengganti untuk&nbsp; loket yang saya jaga, kemudian membantukonsumen untuk kepengurusan administrasi menuju lantai dua</p>', 4, 3, 2, 1, 5, 0, 1, 5, NULL, 1),
('ac619f33-d55d-45f4-b8b6-df588c510d42', '2023-10-13 06:52:26', '2023-10-13 06:52:26', NULL, 'dfcc80d7-7e2f-4c19-88cc-d69371bbee12', NULL, 0, NULL, NULL, NULL, '<p>Sutomo atau yang akrab disapa Bung Tomo merupakan pahlawan yang terkenal karena peranannya dalam membangkitkan semangat arek-arek Suroboyo untuk melawan penjajah Belanda melalui tentara NICA, yang berakhir dengan pertempuran 10 November 1945 dan.kini diperingati sebagai Hari Pahlawan. Sikap dan perilaku yang dilakukan oleh Bung Tomo disebut...</p>', '<p>Patriotisme</p>', '<p>Nasionalisme</p>', '<p>Natonality</p>', '<p>Nation</p>', '<p>Negara</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('ac8ab501-5ab1-4bf1-968e-a267c66f8ccf', '2023-10-18 05:21:27', '2023-10-18 05:21:27', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Jika anda mendapatkan tugas dari pimpinan namun anda tidak menyukai tugas tersebut, anda akan...</p>', '<p>meminta rekan kerja anda yang mengerjakan</p>', '<p>bernegosiasi dengan atasan agar pekerjaannya tidak terlalu rumit</p>', '<p>tetap menyelesaikannya dan berkonsultasi dengan atasan</p>', '<p>tetap menyelesaikan dan meminta bantuan rekan anda</p>', '<p>meminta rekan kerja anda membantu anda menyelesaikannya</p>', 2, 1, 5, 4, 3, 0, 1, 3, NULL, 1),
('acc76bb8-f360-4863-8bab-f20817210f41', '2023-10-14 07:29:48', '2023-10-14 07:29:48', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Ketua RT tempat saya tinggal mengirimkan pesan untuk mencetak undangan rapat sebanyak 30 buah untuk disebar jam 7 malam nanti. Sementara itu saya harus lembur hingga jam 6 sore, sehingga tidak ada waktu untuk mencetak di rumah atau di rental komputer. Tindakan saya adalah....</p>', '<p>Mencetak di rumah menggunakan printer pribadi dan menjelaskan kondisi saya kepada Pak RT</p>', '<p>Mencetak di kantor karena hal ini sudah biasa dilakukan oleh pegawai lainnya</p>', '<p>Menunggu semua pegawai pulang lalu dengan sangat hati-hati mencetak dengan printer meja saya</p>', '<p>Saya pergi keluar untuk membeli kertas dengan uang saya sendiri dan mencetak di kantor</p>', '<p>Saya mengonfirmasi kepada bagian potokopi mengenai boleh atau tidaknya saya mencetak undangan itu di kantor</p>', 5, 1, 2, 3, 4, 0, 1, 1, NULL, 1),
('ad28f5b9-a06e-460a-9e00-695820ea882e', '2023-10-14 07:37:06', '2023-10-14 07:37:06', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Pada saat sedang mengajar telpon saya tiba-tiba bergetar beberapa kali dan sepertinya adalah hal yang penting. Dari notifikasi pop up tampak bahwa yang menelepon adalah ibu saya dan meninggalkan pesan bahwa ayah saya masuk rumah sakit. Tindakan saya adalah....</p>', '<p>Membalas pesan tersebut dan kemudian melanjutkan mengajar</p>', '<p>Melanjutkan kegiatan mengajar</p>', '<p>Meminta ijin kepada kelas untuk pergi ke rumah sakit</p>', '<p>Meminta ijin kepada kelas untuk menelpon sebentar dan memastikan kondisi ayah lalu memutuskan apakah melanjutkan mengajar atau pergi ke rumah sakit</p>', '<p>Tidak melanjutkan mengajar dan kemudian menelpon untuk mengetahui kondisi ayah saya</p>', 3, 1, 4, 5, 2, 0, 1, 4, NULL, 1),
('ae8119bb-88cd-44bb-9f27-cf51e2a04e5e', '2023-10-17 05:35:03', '2023-10-17 05:35:03', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Orang tua anda ribut karena kakak pertama anda diterima di salah satu perusahaan Negara asing yang latar belakang budaya, agama, adat tidak sama dengan keluarga anda, mereka bilang, perusahaan tersebut akan mempersulit kehidupan pribadi kakak anda, padahal menurut kakak anda perusahaan tersebut akan membuat kakak anda berkembang, bagaimana menurut anda....</p>', '<p>mewajarkan sudut pandang orang tua anda yang mugkin khawatir terhadap kakak anda, dan menyadari bahwa orang tua anda masih berpikir secara tradisional</p>', '<p>setuju dengan pikiran kedua orang tua anda karena kita harus menjauhi orang yang berbeda dengan kita</p>', '<p>merasa takut terhadap teman yang latar belakang budaya dan agamanya beda</p>', '<p>memutuskan pertemanan dengan orang yang latar belakangnya berbeda</p>', '<p>membantu kakak pertama anda agar tetap dapat bekerja</p>', 5, 2, 3, 1, 4, 0, 1, 1, NULL, 1),
('af007e97-ba24-4122-9bf6-59f269229940', '2023-10-16 04:59:05', '2023-10-16 04:59:05', NULL, '7353afdf-8c22-4e71-a553-90921b9692ab', NULL, 0, NULL, NULL, NULL, '<p>Berdasarkan posisi seseorang dalam organisasi, konflik dapat dibedakan menjadi empat konflik, salah satunya yaitu konflik horizontal. Wujud sikap untuk mencegah terjadinya konflik horizontal adalah</p>', '<p>Mengimplementasikan sila ke lima dengan memberikan upah buruh sesuai dengan standar peraturan pemerintah berdasarkan nilai keadilan</p>', '<p>Mengusahakan tidak memegang dua peran atau jabatan sekaligus dalam sebuah organisasi</p>', '<p>Memilih penasihat organisasi yang mampu berdiskusi dengan baik dan memiliki komitmen untuk memajukan organisasi</p>', '<p>Memberikan bonus kepada pegawai dengan pencapaian kerja terbaik setiap bulannya</p>', '<p>Berkomunikasi dengan terbuka dan menghormati pendapat setiap orang dalam melakukan diskusi dengan cara musyawarah untukmencapai mufakat agar tidak menimbulkan perbedaan persepsi dan konflik berkelanjutan</p>', 0, 0, 0, 0, 0, 0, 1, 5, NULL, 1),
('af396a1c-7470-435a-ba5d-ae530f50d9e5', '2023-10-17 04:10:12', '2023-10-17 04:10:12', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Saat anda sedang mengerjakan suatu tugas di salah satu aplikasi perusahaan, ternyata aplikasi tersebut mengalami eror sehingga mengganggu pekerjaan anda. Sikap anda sebaiknya....</p>', '<p>Segera menutup aplikasi tersebut agar tidak banyak data yang hilang</p>', '<p>Menghubungi tim IT perusahaan untuk memperbaiki aplikasi yang eror tersebut</p>', '<p>Menghubungi tim IT perusahaan untuk memperbaiki aplikasi yang eror tersebut</p>', '<p>Menanyakan kepada teman yang pernah mengalami permasalahan serupa</p>', '<p>Terus mengerjakan dan berharap aplikasi bisa kembali normal</p>', 5, 4, 2, 3, 1, 0, 1, 1, NULL, 1),
('b03cac90-6999-46f2-a5ab-a26cc180ed5e', '2023-10-20 06:39:19', '2023-10-20 06:39:19', NULL, '00cc482f-6b53-42a2-9045-e1b555bb5d19', NULL, 0, NULL, NULL, NULL, '<p>Jika Abu suka mobil-mobilan, maka Brio suka kapal-kapalan. Mereka adalah saudara dan Brio tidak suka kapal-kapalan namun dia suka mobil-mobilan.</p>\n<p>Kesimpulannya...</p>', '<p>Abu dan Brio suka kapal-kapalan</p>', '<p>Abu tidak suka mobil-mobilan</p>', '<p>Abu dan Brio suka mobil-mobilan</p>', '<p>Brio menyukai apa yang Abu sukai</p>', '<p>Brio tidak suka mobil-mobilan</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('b0c3743f-8985-4d9b-8a49-50fe4e128c35', '2023-10-25 07:04:50', '2023-10-25 07:04:50', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Tim kerja anda diberikan tugas untuk membuat daftar proyek berskala besar oleh pimpinan dengan deadline yang cukup ketat. Padahal, tugas tersebut merupakan tugas yang belum pernah anda kerjakan sebelumnya sehingga anggota tim anda juga kebingungan karena belum memahami maksud dan cara mengerjakan tugas tersebut. Sikap anda sebagai ketua tim....</p>', '<p>Mempelajari tugas serupa secara mandiri baru membagikan pengetahuan saya pada anggota tim</p>', '<p>Meminta tiap anggota tim untuk mempelajari proyek tersebut baru kemudian mendiskusikan cara terbaik untuk menyelesaikannya</p>', '<p>Mengerjakan proyek tersebut bersama sesuai dengan kemampuan tim dan mengatasi setiap kesulitan yang ada secara musyawarah</p>', '<p>Meminta bantuan senior tim lain untuk bersama-sama dengan tim menyelesaikan proyek tersebut agar tugas dapat selesai tepat waktu</p>', '<p>Meminta bimbingan atasan untuk menjelaskan lebih dulu bagaimana cara mengerjakan proyek tersebut selesai tepat waktu</p>', 2, 3, 5, 4, 1, 0, 1, 3, NULL, 1),
('b17adcbf-ffbc-4e28-9edf-fa9e82b18282', '2023-10-20 07:44:24', '2023-10-20 07:44:24', NULL, '00cc482f-6b53-42a2-9045-e1b555bb5d19', NULL, 0, NULL, NULL, NULL, '<p>Adhi memiliki usia 7 tahun lebih muda dari Bimo. Sedangkan Bimo memiliki usia 2 tahun lebih tua dari Chandra. Selisih usia antara Adhi dan Chandra adalah...</p>', '<p>1 tahun</p>', '<p>2 tahun</p>', '<p>5 tahun</p>', '<p>7 tahun</p>', '<p>12 tahun</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('b190f6ac-925c-4738-bf91-fc6ec8f69ce6', '2023-10-13 07:06:29', '2023-10-13 07:06:29', NULL, 'dfcc80d7-7e2f-4c19-88cc-d69371bbee12', NULL, 0, NULL, NULL, NULL, '<p>Dengan mengudap makanan ringan, perut akan terasa hangat. Apalagi kalau <em>camilan </em>itu dimakan pada waktu cuaca mendung. Ibu rumah tangga bisa menyediakan <em>camilan</em> yang menyehatkan setiap hari. Untuk ibu yang hobinya masak, hal ini bukan masalah akan tetapi apa jadinya kala ibu itu seorang wanita <em>karir</em> yang sibuk dengan urusan di luar rumah? Kalau sudah begini siapkan saja <em>biskuit</em> siap saji yang menyehatkan.</p>\n<p>Perbaikan penulisan pada kata yang bercetak miring dalam paragraf tersebut adalah....</p>', '<p>Cemilan, karier, beskuit</p>', '<p>Camilan, karir, biskuit</p>', '<p>Camilan, karier, beskuit</p>', '<p>Cemilan, karir, biskuit</p>', '<p>Camilan, karier, biskuit</p>', 0, 0, 0, 0, 0, 0, 1, 5, NULL, 1),
('b215ba8b-dddf-40ed-bbdb-084c57add82a', '2023-10-17 04:43:37', '2023-10-17 04:43:37', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Saya adalah seorang resepsionis di sebuah Rumah Sakit Daerah. Semenjak pandemi ini, banyak sekali masyarakat yang menyampaikan keluhan atas pelayanan di instansi tempat saya bekerja. Sebenarnya, untuk mengurangi interaksi sudah diberlakukan layanan aduan secara daring(online), namun masih saja ada masyarakat yang tidak mengerti dan datang untuk menyampaikan. Sikap saya....</p>', '<p>Tidak melayani masyarakat yang datang karena pelayanan keluhan saat ini menggunakan sistem online</p>', '<p>Menerima keluhan masyarakat sembari mengajarkan mereka untuk menyampaikan keluahannya melalui portal online yang sudah disediakan</p>', '<p>Menyelesaikan segala keluhan yang disampaikan agar masalahnya segera terselesaikan dengan cepat</p>', '<p>Mendengar keluhan masyarakat dan menyampaikan bahwa saat ini layanan keluhan dilakukan secara online</p>', '<p>Menanggapi keluhan yang disampaikan dan mengajarkan untuk menyampaikan keluhan secara online</p>', 1, 5, 2, 4, 3, 0, 1, 2, NULL, 1),
('b2935ea8-5f0f-4eba-a144-30a166c1d363', '2023-10-14 09:02:24', '2023-10-16 02:44:38', NULL, 'e9f84a80-562c-4b59-b70d-8f1c9f4e3b4f', NULL, 0, NULL, NULL, NULL, '<p>Carilah gambar yang berbeda!</p>', '<p><img src=\"/../storage/upload_files/questions/20231016093743aa.jpg\" alt=\"\" width=\"109\" height=\"108\" /></p>', '<p><img src=\"/../storage/upload_files/questions/20231016093851ab.jpg\" alt=\"\" width=\"112\" height=\"111\" /></p>', '<p><img src=\"/../storage/upload_files/questions/20231016094123ac.jpg\" alt=\"\" width=\"110\" height=\"111\" /></p>', '<p><img src=\"/../storage/upload_files/questions/20231016094300ad.jpg\" alt=\"\" width=\"109\" height=\"108\" /></p>', '<p><img src=\"/../storage/upload_files/questions/20231016094430ae.jpg\" alt=\"\" width=\"109\" height=\"108\" /></p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('b3ee0ccf-b881-405a-9bfe-d2c8df7cee56', '2023-10-20 07:59:13', '2023-10-20 07:59:13', NULL, '00cc482f-6b53-42a2-9045-e1b555bb5d19', NULL, 0, NULL, NULL, NULL, '<p>Fida mengendarai sepeda motor berangkat dari kota A menuju kota B dengan kecepatan 80km/jam. Jarak kota A dan kota B pada peta adalah18 cm dengan skala peta 1: 4.600.000. Deni berangkat 30 menit setelah Fida dengan kecepatan 72 km/jam.Berapa selisih waktu yang dibutuhkan Fida dan Deni untuk sampai di kota B?.....</p>', '<p>1 jam</p>', '<p>1 jam 8 menit</p>', '<p>1 jam 30 detik</p>', '<p>50 menit</p>', '<p>69 menit</p>', 0, 0, 0, 0, 0, 0, 1, 5, NULL, 1),
('b43401d6-9acf-4fd1-a9a1-670f2750ef4a', '2023-10-16 04:46:57', '2023-10-16 04:46:57', NULL, '7353afdf-8c22-4e71-a553-90921b9692ab', NULL, 0, NULL, NULL, NULL, '<p>Petani dan nelayan bekerja untuk menyediakan sumber makanan, tenaga media merawat sampai mengupayakan kesembuhan terhadap penyakit, TNI dan Polri yang menjaga keamanan dan ketertiban, serta guru yang mencerdaskan generasi. Hal ini merupakan upaya bela negara berlatar belakang.....</p>', '<p>Pengabdian</p>', '<p>Kesukarelaan sesuai profesi</p>', '<p>Kewajiban</p>', '<p>Pengabdian sesuai profesi</p>', '<p>Kewajiban sesuai profesi</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
