('b880bb19-5781-4a2f-a2c5-60b86d1071af', '2023-10-13 07:47:16', '2023-10-13 07:47:16', NULL, 'e9f84a80-562c-4b59-b70d-8f1c9f4e3b4f', NULL, 0, NULL, NULL, NULL, '<p>Andi berjalan lebih cepat daripada Ari, Indah berjalan lebih cepat daripada Dina. Wika berjalan lebih lambat daripada Ari. Tidak ada anak yang berjalan dengan kecepatan sama.</p>\n<p>Jika Indah berjalan lebih cepat daripada Ari, maka....</p>', '<p>Dina berjalan lebih cepat daripada Ari</p>', '<p>Wika berjalan lebih cepat daripada Dina</p>', '<p>Indah berjalan lebih cepat daripada Wika</p>', '<p>Ari berjalan lebih cepat daripada Andi</p>', '<p>Andi berjalan lebih cepat daripada Dina</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('b9902bc4-ab61-4ec1-bf62-7a84aeeb2169', '2023-10-26 09:06:23', '2023-10-26 09:06:23', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Tike adalah seorang pegawai di sebuah toko yang pemimpinnya tidak seagama dengannya. Hari ini adalah hari terakhir libur lebaran, sehingga Tike akan memanfaat waktu sebaik-baiknya untuk bersilaturahmi dengan keluarga dan melakukan kegiatan yang selama ini tidak bisa ia kerjakan di jam kerja. Namun, pimpinan menghubungi Tike menganai tugas kantomya yang belumselesai. Sebagai Tike, apa yang akan anda lakukan?</p>', '<p>memakluminya karena hari itu bukan hari lebaran dan pimpinan yang tidak seagama dengan anda tidak pernah merasakan lebaran seperti yang dialami anda, jadi wajar saja</p>', '<p>kesal karena merasa atasan sangat tidak empati terhadap anda yang masih merasakan hawa lebaran</p>', '<p>atasan telah mengganggu hari libur anda</p>', '<p>menceritakan terhadap rekan kerja yang lain dan menumbuhkan kebencian pada atasan</p>', '<p>membiarkan saja dan tak peduli</p>', 1, 2, 3, 5, 4, 0, 1, 4, NULL, 1),
('b9da5bed-6c4f-49de-9bf6-79411e80732a', '2023-10-16 04:23:38', '2023-10-16 04:23:38', NULL, '7353afdf-8c22-4e71-a553-90921b9692ab', NULL, 0, NULL, NULL, NULL, '<p>Tokoh satu ini adalah seorang yang genius, ia mampu berbicara dan menulis secara sempurna sedikitnya dalam sembilan bahasa. Kelemahannya hanya satu, ia hidup melarat. Itulah tulisan Wellem Schermerhorn seorang pejabat Belanda dalam hak dagbeok van schermerhorn(buku harian Schermerhorn) saat mengomentari H. Agus Salim. Faktanya memang demikian, H. Agus Salim selalu bersahaja. Sikap integritas yang patut menjadi teladan dari H. Agus Salim adalah...</p>', '<p>Kerja keras</p>', '<p>Peduli</p>', '<p>Adil</p>', '<p>Sederhana</p>', '<p>Tanggung jawab</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
