('bdc16f9d-d1ad-4a5a-9a5b-7fd096b38548', '2023-10-16 07:25:26', '2023-10-16 07:25:26', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p>Seorang mahasiswa X harus mengerjakan sebuah essai dengan aturan sebagai berikut:</p>\n<p>- Soal 2 hanya boleh dikerjakan bersama soal 3</p>\n<p>- Soal 1 hanya boleh dikerjakan jika soal 5 tidak dikerjakan</p>\n<p>- Soal 2 tidak boleh dikerjakan jika soal 4 dikerjakan</p>\n<p>- Soal 5 hanya boleh dikerjakan bersama soal 6</p>\n<p>Jika soal 1 dan 4 dikerjakan, maka yang pasti tidak dikerjakan adalah soal...</p>', '<p>2 dan 3</p>', '<p>2 dan 5</p>', '<p>3 dan 4</p>', '<p>3 dan 6</p>', '<p style=\"text-align: left;\">4 dan 5</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
