('c846c66a-c123-4a3a-b9d8-fe96b8e54d29', '2023-10-26 09:15:08', '2023-10-26 09:15:08', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Anda bekerja pada bagian pengadaan di rumah sakit swasta, pada hari minggu handphone anda berbunyi tampak panggilan dari rumah sakit. Biasanya karena ada kebutuhan obat yang sifatnya cito, padahal pada saat itu saya sedang persiapan untuk pergi bersama keluarga. Bagaimana sikap anda....</p>', '<p>Membiarkan saja panggilan itu</p>', '<p>Segera mengangkat panggilan</p>', '<p>Bergegas menyelesaikan persiapan untuk piknik, kemudian segera menelpon balik</p>', '<p>Membatalkan acara dan berangkat ke rumah sakit segera</p>', '<p>Mengangkat panggilan itu setelah ditelpon beberapa kali untuk memastikan bahwa memang ada sesuatu yang penting</p>', 4, 5, 1, 2, 3, 0, 1, 2, NULL, 1),
('c8788cfc-8162-47ef-a6d6-f944413e8fbe', '2023-10-14 05:16:13', '2023-10-14 05:16:13', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Kemajuan di segala bidang khususnya budaya mengharuskan bangsa Indonesia dapat lebih selektif dalam menyerap budaya asing memilah dan memilih budaya yang cocok dengan kepribadian bangsa Indonesia, serta bersikap kritis terhadap nilai-nilai budaya yang kondusif dan serasi untuk menghadapi ancaman dan tantangan pembangunan bangsa. Budaya asing bisa menjadi ancaman tetapi bangsa kita tidak dapat menutup diri dari pengaruh yang datang dari luar. Sikap anda sebaiknya...</p>', '<p>Menyerap kebudayaan dari luar yang sesuai dengan kepribadian bangsa</p>', '<p>Menerima kebudayaan asing yang sangat diperlukan saja</p>', '<p>Menerima semua budaya luar untuk mengejar ketinggalan</p>', '<p>Menolak nilai-nilai asing demi kelestarian budaya bangsa</p>', '<p>Memilih kebudayaan yang baik dengan yang tidak baik</p>', 5, 3, 1, 2, 4, 0, 1, 1, NULL, 1),
('c8c6e866-3a3b-4de2-88dc-8eaf9f21dd5d', '2023-10-16 08:03:47', '2023-10-16 08:03:47', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p>Pada perjalanan tertentu, jika suatu kereta melaju dengan kecepatan rata-rata 50 km/jam, maka kereta tersebut akan terlambat 2 jam sampai tujuan. Jika kereta melaju dengan kecepatan rata-rata 70 km/jam, maka sampai ditujuan 2 jam lebih cepat. Berapakah jarak antara kedua kota tersebut? ...</p>', '<p>Kurang dari 80 km</p>', '<p>Antara 80 km - 100 km</p>', '<p>Antara 80 km - 100 km</p>', '<p>Antara 120 km - 140 km</p>', '<p>Lebih dari 140 km</p>', 0, 0, 0, 0, 0, 0, 1, 5, NULL, 1),
