('cc464916-bc0a-4229-aded-fa7a9e8052d6', '2023-10-14 06:35:56', '2023-10-14 06:35:56', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Hampir setiap minggu saya selalu ditugaskan pimpinan untuk keluar kota. Sebagai seorang instruktur pemberdayaan UMKM di kementerian, pekerjaan saya membutuhkan berbagai perangkat dan materi. Mulai dari barang bawaan pribadi, dokumen perjalanan dinas yang sangat penting, hingga materi-materi presentasi yang akan saya sampaikan. Hal tersebut menuntut saya untuk selalu mempersiapkan dengan sebaik-baiknya, namun saya menyadari bahwa saya seorang yang pelupa, sehingga tidak jarang ada saja barang penting yang tertinggal. Belum lagi jangkauan tempat saya bertugas sampai pada desa-desa terluar sehingga sangat mungkin sekali beresiko kerusakan selama perjalanan bahkan hilang, sikap saya...</p>', '<p>Menyimpan dengan sistem online agar dapat diakses dimana saja dengan mudah dan cepat</p>', '<p>Meminta orang lain untuk melakukan ceking sebelum berangkat agar tidak ada barang yang tertinggal</p>', '<p>Membawa dokumen cadangan untuk meminimalisir apabila terjadi kerusakan bahkan hilang</p>', '<p>Menyimpan dokumen pada flashdisk atau hardisk</p>', '<p>Menyiapkan jauh-jauh hari agar tidak ada barang yang tertinggal</p>', 5, 1, 3, 4, 2, 0, 1, 1, NULL, 1),
