('d13c7070-2c7b-4550-ab13-86d735164eb6', '2023-10-20 06:46:55', '2023-10-20 06:46:55', NULL, '00cc482f-6b53-42a2-9045-e1b555bb5d19', NULL, 0, NULL, NULL, NULL, '<p>Untuk mengisi liburan panjang akhir semester, Lila, Indi, Lulu, Tata dan Doni sedang dalam perjalanan menuju sebuah tempat wisata di kota sebelah dengan mengendarai sepeda motor.</p>\n<ul>\n<li>Lila mengendarai sepeda motor dengan kecepatan lebih kecil daripada Indi tetapi tidak lebih besar daripada Tata</li>\n<li>Lulu mengendarai sepeda motor dengan kecepatan tidak lebih dari Tata dan tidak kurang Indi</li>\n<li>Doni mengendarai sepeda motor dengan kecepatan tidak lebih dari Indi dan tidak kurang dari Lili</li>\n</ul>\n<p>Doni menambah kecepatan menjadi tidak lebih lambat daripada Lulu dan Tata menurunkan kecepatannya menjadi tidak lebih cepat daripada Indi.</p>\n<p>Pernyataan yang salah adalah..</p>', '<p>Kecepatan Lulu lebih besar daripada Indi</p>', '<p>Kecepatan Doni lebih besar daripada Lulu</p>', '<p>Kecepatan Lulu lebih kecil daripada Tata</p>', '<p>Kecepatan Lili paling kecil diantara kelima anak tersebut</p>', '<p>Kecepatan Indi kurang dari kecepatan Doni</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
