('d34931c5-4d0b-4bb2-8a3d-e3dd8f7b06e1', '2023-10-16 07:29:12', '2023-10-16 07:29:12', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p>Seorang mahasiswa X harus mengerjakan sebuah essai dengan aturan sebagai berikut:</p>\n<p>- Soal 2 hanya boleh dikerjakan bersama soal 3</p>\n<p>- Soal 1 hanya boleh dikerjakan jika soal 5 tidak dikerjakan</p>\n<p>- Soal 2 tidak boleh dikerjakan jika soal 4 dikerjakan</p>\n<p>- Soal 5 hanya boleh dikerjakan bersama soal 6</p>\n<p>Jika mahasiswa tersebut sudah, mengerjakan soal 5 dan soal 3, maka...</p>', '<p>Soal nomor 1 dan 4 tidak dikerjakan</p>', '<p>Soal nomor 1 dan 4 dikerjakan</p>', '<p>Soal nomor 2 dan 6 tidak dikerjakan</p>', '<p>Soal nomor 2 dan 6 pasti dikerjakan</p>', '<p>Soal nomor 1 dan 6 pasti tidak dikerjakan</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
