('da68909d-22b1-4bed-9c94-1d7b8515930f', '2023-10-26 06:14:34', '2023-10-26 06:14:34', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Semalam sebelum tanggal 17 agustus. Warga desa tempat anda tinggal selalu mengadakan pentas wayang orang yang melibatkan partisipasi semua warga dalam menyiapkan acara, bersamaan dengan itu, anda ditunjuk oleh kantor tempat anda bekerja sebagai panitia kegiatan tujuh belasan yang diadakan dikantor. Apa yang akan kamu lakukan ?</p>', '<p>Izin tidak mengikuti kegiatan pentas wayang orang ditempat anda kepada ketua RT karena anda harus menjadi ketua panitia tujuh belasan dikantor</p>', '<p>Meminta atasan anda untuk mencari orang lain untuk menjadi ketua panitia tujuh belasan karena anda harus ikut berpartisipasi mempersiapkan kegiatan ditempat anda tinggal</p>', '<p>Saat jam kantor anda mempersiapkan kegiatan tujuh belasan yang diadakan kantor dan saat berada di rumah anda berpartisipasi menyiapkan kegiatan pentas wayang orang</p>', '<p>Membagi tugas kepada rekan-rekan satu kepanitiaan tujuh belasan dikantor sehingga anda tidak terlalu sibuk mempersiapkan kegiatan tujuh belasan dikantor dan dapat berpartisipasi mempersiapkan kegiatan di tempat tinggal</p>', '<p>Menyuruh anak anda untuk mewakili anda dalam mempersiapkan pentas wayang orang ditempat anda tinggal akan membentuk tim kepanitiaan tujuh belasan yang solid sehingga acara tujuh belasan dikantor berlangsung meriah</p>', 2, 1, 5, 4, 3, 0, 1, 3, NULL, 1),
('dadd5d21-1fc0-4d21-965b-3fe4bf598004', '2023-10-16 04:36:38', '2023-10-16 04:36:38', NULL, '7353afdf-8c22-4e71-a553-90921b9692ab', NULL, 0, NULL, NULL, NULL, '<p>Sikap dan perilaku warga negara yang dijiwai oleh kecintaannya kepada NKRI yang berdasarkan Pancasila dan UUD 1945 dalam menjamin kelangsungan hidup bangsa dan negara merupakan pengertian</p>', '<p>Integritas</p>', '<p>Patriotisme</p>', '<p>Bela negara</p>', '<p>Pertahanan negara</p>', '<p>Nasionalisme</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('db44d0bc-530f-4982-8d99-c6f5280af6c0', '2023-10-13 04:20:04', '2023-10-13 04:20:04', NULL, 'dfcc80d7-7e2f-4c19-88cc-d69371bbee12', NULL, 0, NULL, NULL, NULL, '<p>Pelaksanaan tugas pegawai di lingkungan kerjanya dalam menjalankan perannya, sesuai tugas dan fungsinya yang diamanatkan pada jabatannya dilandaskan pada komitmen, integritas, profesionalisme, transparan, dan bebas dari KKN merupakan bentuk integritas...</p>', '<p>Organisasional</p>', '<p>Manajerial</p>', '<p>Internal</p>', '<p>Eksternal</p>', '<p>Struktural</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('dbbb93d2-b447-4a18-8de3-b9129e56a504', '2023-10-14 04:09:45', '2023-10-14 04:09:45', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Dalam suatu pelatihan kepegawaian yang saya ikuti, ada gerakan 3S, yaitu Senyum, Sapa, dan Salam yang harus diterapkan di seluruh bagian instansi. Saat ini, saya ditempatkan di bagian front office yang merupakan bagian terdepan di instansi tempat saya bekerja. Sikap saya setelah pelatihan kepegawaian tersebut adalah....</p>', '<p>Melakukan seperti yang saya lakukan setiap hari karena khawatir gerakan 3S akan tampak seperti suatu hal yang aneh bagi orang lain</p>', '<p>Saya akan mulai gerakan 3S hanya jika saya sudah siap.</p>', '<p>Cukup dengan memasang poster yang bertuliskan gerakan 3S dan artinya, itu sudah membuat semua orang memahami bahwa saya sudah melakukan anjuran pelatihan tersebut</p>', '<p>Menerapkan gerakan 3S seperti yang diajarkan di pelatihan</p>', '<p>Menerapkan gerakan 3S seperti yang diajarkan di pelatihan hanya pada saat awal bekerja saja biar seragam dengan bagian lainnya</p>', 1, 2, 3, 5, 4, 0, 1, 4, NULL, 1),
('dcf3a0ef-d7f5-44d4-af25-9f79f9aabb8c', '2023-10-16 04:16:43', '2023-10-16 04:16:43', NULL, '7353afdf-8c22-4e71-a553-90921b9692ab', NULL, 0, NULL, NULL, NULL, '<p>Nasionalisme yang dinikmati oleh negara atas partisipasi aktif warga negara berdasarkan kebenaran politik disebut....</p>', '<p>Nasionalisme politis</p>', '<p>Nasionalisme religius</p>', '<p>Nasionalisme kewarganegaraan</p>', '<p>Nasionalisme romantik</p>', '<p>Nasionalisme ketatanegaraan</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('de4d72c7-dbcf-44a0-84ad-38d75473dbde', '2023-10-26 06:21:41', '2023-10-26 06:21:41', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Anda akan menikah dengan orang berbeda dengan suku anda sesuai adat pihak calon pasangan anda, anda harus melakukan salah satu tradisi yang diwajibkan bagi pengantin di luar suku calon pasangan anda akan tetapi, anda tidak mampu melakukan tradisi tersebut berkaitan dengan kesehatan anda.apa yang anda lakukan?</p>', '<p>Tidak melakukan tradisi tersebut karena kesehatan lebih penting</p>', '<p>Mengomunikasikan kepada pihak calon pasangan anda jika anda tidak dapat melakukan tradisi tersebut</p>', '<p>Tradisi hanya formalitas saja, anda tidak harus melaksanakannya</p>', '<p>Menganggap tradisi tersebut berbahaya dan meminta warga setempat untuk tidak melakukan lagi</p>', '<p>Tradisi tersebut sebagai bentuk diskriminasi terhadap suku dan lain yang tidak se budaya dengan mereka</p>', 4, 5, 3, 2, 1, 0, 1, 2, NULL, 1),
