('de8577e1-8763-4347-b31d-c4eb0aae8303', '2023-10-19 07:56:15', '2023-10-19 07:56:15', NULL, '80cec561-fc0b-46c7-aed4-f0ad73061557', NULL, 0, NULL, NULL, NULL, '<p>(1) Ada beberapa jenis benang yang banyak digunakan untuk merajut. (2) Namun demikian, pada umumnya jenis benang yang lebih sering digunakan adalah benang katun, wol, polyester, dan nylon. (3) Benang katun terbuat dari serat alami (kapas), benang wol dapat digunakan untuk membuat syal hangat. (4) Sedangkan benang nylon dan polyester memiliki karakteristik yang sangat cocok untuk bahan membuat tas.Kalimat utama paragraf tersebut adalah nomor........</p>', '<p>(1)</p>', '<p>(2)</p>', '<p>(3)</p>', '<p>(4)</p>', '<p>(1) dan (3)</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('deabf437-69c7-4f13-93ea-04c92f834b61', '2023-10-17 05:39:04', '2023-10-17 05:39:04', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Anda memiliki rekan kerja yang tidak mempercayai adanya covid dan rekan kerja anda ini pernah bercerita bahwa ia mengikuti kelompok pembenci pemerintah dan pernah melempari batu pada ambulans karena mereka yakin bahwa itu hanyalah ambulans kosong yang menakut-nakuti masyrakat, bagaimana sikap anda...</p>', '<p>setuju dengan teman anda namun tidak mengikuti kelompok tersebut karena sibuk</p>', '<p>setuju dan mengikuti kelompok tersebut karena anda yakin wabah virus korona hanya dibuat-buat</p>', '<p>setuju karena adanya virus korona hanya untuk kepentingan perdagangan</p>', '<p>tidak ikut-ikutan dan lebih berjaga-jaga kesehatan dengan minum vitamin dan menjaga kontak dengan orang lain</p>', '<p>tidak ikut-ikutan</p>', 2, 1, 3, 5, 4, 0, 1, 4, NULL, 1),
