('e14808e1-0a71-4f61-8f5f-88b724bdc69b', '2023-10-17 06:03:16', '2023-10-17 06:03:16', NULL, 'b6b3d933-7f1c-4ac1-abf2-14928a6ab49f', NULL, 0, NULL, NULL, NULL, '<p>Nilai-nilai yang terkandung dalam masyarakat yang ditinjau dari sisi sosial budaya adalah...</p>', '<p>Kejujuran, toleransi, dan kepedulian</p>', '<p>Kejujuran dan kecakapan</p>', '<p>Kejujuran, ketangkasan dan kepedulian</p>', '<p>Toleransi dan kejujuran</p>', '<p>Toleransi dan kepedulian</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('e2b168e6-752f-41ba-a8ee-65f04ee2b2fd', '2023-10-13 04:09:38', '2023-10-13 04:09:38', NULL, 'dfcc80d7-7e2f-4c19-88cc-d69371bbee12', NULL, 0, NULL, NULL, NULL, '<p>Suatu upaya untuk mempersatukan berbagai perbedaan pada kelompok budaya atau kelompok sosial dalam suatu wilayah sehingga membentuk satu kesatuan yang harmonis di dalam NKRI dengan semboyan Bhinneka Tunggal Ika disebut dengan....</p>', '<p>Integritas Nasional</p>', '<p>Pandangan hidup bangsa</p>', '<p>Geopolitik Indonesia</p>', '<p>Nasionalisme Kebangsaan</p>', '<p>Nasionalisme sipil</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('e2e443e3-9fb4-4293-bb1e-214cb018f18c', '2023-10-19 06:45:00', '2023-10-19 06:45:00', NULL, '80cec561-fc0b-46c7-aed4-f0ad73061557', NULL, 0, NULL, NULL, NULL, '<p>Pernyataan dibawah ini yang tidak termasuk ciri-ciri suasana toleransi yang tumbuh dan berkembang dalam masyarakat multikultural Indonesia adalah....</p>', '<p>Membebaskan setiap orang untuk memilih dan menjalankan agamnya</p>', '<p>Menghargai kehidupan pribadi setiap orang</p>', '<p>Tidak memaksakan pendapat saat berada dalam rapat</p>', '<p>Memberikan hak yang menjadi milik setiap individu</p>', '<p>Melatih anak-anak muda untuk mengetahui kebudayaan daerah sendiri</p>', 0, 0, 0, 0, 0, 0, 1, 5, NULL, 1),
('e2ff1f0c-8769-4c2a-91de-04e49888ca56', '2023-10-17 03:06:23', '2023-10-17 03:06:23', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Seorang rekan kerja anda memberikan usulan pada saat sedang melakukan diskusi bersama rekan kerja anda sesama divisi. Menurut rekan kerja anda usulannya sangat baik dalam meningkatkan hasil kerja, namun menurut anda usulan tersebut memiliki risiko yang besar dan merugikan perusahaan jika tetap dilakukan. Ketika anda memberikan tanggapan, rekan kerja tersebut tidak terima dengan usulan anda. Bagaimana sikap anda seharusnya?</p>', '<p>Memintanya untuk memberikan gagasan yang memiliki risiko kecil dan realistis</p>', '<p>Memintanya untuk memikirkan kembali gagasan yang diusulkan</p>', '<p>Diam saja dan mengikuti semua gagasan rekan kerja</p>', '<p>Mengajaknya berbicara dengan bahasa yang santai dan ringan serta fokus pada tujuan awal</p>', '<p>Keluar saja dari ruang diskusi dan memberitahukan kepada atasan</p>', 3, 4, 2, 5, 1, 0, 1, 4, NULL, 1),
('e542df1c-c4d0-49e5-934f-db60f6f50c55', '2023-10-18 05:37:42', '2023-10-18 05:37:42', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Rekan anda sudah berjanji untuk pergi ke suatu tempat wisata minggu ini. Namun ketika hari minggu tiba rekan anda tidak menghubungi anda dan mengingkari janjinya. Maka anda....</p>', '<p>memarahinya karena anda sudah menunggu seharian</p>', '<p>mungkin rekan anda ada urusan mendadak</p>', '<p>tidak mau berteman kembali dengan rekan anda</p>', '<p>menghubunginya dan meminta penjelasannya</p>', '<p>tidak mau berbuat janji kepada rekan anda kembali</p>', 3, 4, 1, 5, 2, 0, 1, 4, NULL, 1),
('e75f7913-d028-4a86-b34f-d0db446ff3dc', '2023-10-18 04:24:28', '2023-10-18 04:24:28', NULL, '557e3be9-1ea4-45e4-8163-29eb4435e058', NULL, 0, NULL, NULL, NULL, '<p>&hellip;, &hellip;, &hellip;, 33, 22, 99, 27, 297, 32</p>', '<p>7, 18, 22</p>', '<p>9, 13, 15</p>', '<p>12, 11, 17</p>', '<p>12, 16, 18</p>', '<p>16, 19, 23</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('e7940e06-dc76-4e7d-ac3d-6184364215f0', '2023-10-14 05:33:43', '2023-10-14 05:33:43', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Suatu hari anda pergi ke suatu daerah yang disana ada sebuah kebudayaan dimana salah satu binatang dianggap membawa aura negatif bagi warga suku tersebut yaitu anjing sebagai binatang yang menimbulkan aura negatif maka kepala suku biasanya memerintahkan untuk membunuh anjing-anjing tersebut. Namun anda ingat pemerintah saat ini sedang menggalangkan kampanye menyayangi hewan. Sedangkan pembunuhan terhadap hewan eksploitasi hewan untuk sirkus dll adalah suatu hal yang melanggar hukum. Sikap anda adalah....</p>', '<p>Mengkomunikasikan hal tersebut dengan kepala suku, bahwa pemerintah sedang menggalakkan program untuk menyayangi hewan</p>', '<p>Melaporkan kepada pihak terkait untuk segera di usut</p>', '<p>Memfoto kemudian mengupload ke instagram dan mengadakan petisi</p>', '<p>Ikut melakukan adat tersebut sebagai upaya menghormati adat</p>', '<p>Saya akan bertindak pura-pura tidak tahu</p>', 5, 4, 3, 1, 2, 0, 1, 1, NULL, 1),
('e7fa8235-9279-4ad7-8e95-a951589e37eb', '2023-10-19 06:51:16', '2023-10-19 06:51:16', NULL, '80cec561-fc0b-46c7-aed4-f0ad73061557', NULL, 0, NULL, NULL, NULL, '<p>Seseorang yang berintegritas adalah seseorang yang bertindak secara konsisten dan utuh, baik melalui perkataan maupun perbuatan. Sikap dan perilakunya dengan aturan, kode etik dan standar operasional yang sudah ditetapkan serta sesuai dengan undang-undang. Dibawah ini yang bukan merupakan sikap seseorang yang memiliki jiwa integritas adalah.....</p>', '<p>Bertanggung jawab</p>', '<p>Menghargai waktu</p>', '<p>Cinta tanah air</p>', '<p>Jujur dan dapat dipercaya</p>', '<p>Memiliki prinsip dan nilai-nilai hidup</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('e824142a-f3f7-42d2-bd04-b25e13f4d3de', '2023-10-13 07:51:31', '2023-10-13 07:51:31', NULL, 'e9f84a80-562c-4b59-b70d-8f1c9f4e3b4f', NULL, 0, NULL, NULL, NULL, '<p>Andi berjalan lebih cepat daripada Ari, Indah berjalan lebih cepat daripada Dina. Wika berjalan lebih lambat daripada Ari. Tidak ada anak yang berjalan dengan kecepatan sama.</p>\n<p>Jika Indah berjalan lebih lambat daripada Andi, maka anak yang berjalan paling cepat adalah....</p>', '<p>Ari</p>', '<p>Andi</p>', '<p>Dina</p>', '<p>Wika</p>', '<p>Sari</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('e9dfa1f4-f26f-4c8c-b83c-82f1115c72ed', '2023-10-13 07:24:04', '2023-10-13 07:24:04', NULL, 'e9f84a80-562c-4b59-b70d-8f1c9f4e3b4f', NULL, 0, NULL, NULL, NULL, '<p>Covid-19 : paru-paru = panu : ....</p>', '<p>Kulit</p>', '<p>Gatal</p>', '<p>Tangan</p>', '<p>Badan</p>', '<p>Kepala</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1),
('eafd765a-69dd-4e2c-9b36-d5e67b590c62', '2023-10-18 04:28:53', '2023-10-18 04:28:53', NULL, '557e3be9-1ea4-45e4-8163-29eb4435e058', NULL, 0, NULL, NULL, NULL, '<p>Jika P= luas lingkaran yang berjari jari 1 m, dan Q = luas lingkaran yang berjari-jari 2 m, maka.....</p>', '<p>P &gt; Q</p>', '<p>P = Q</p>', '<p>P &lt; Q</p>', '<p>P dan Q tidak dapat ditentukan</p>', '<p>P = 3Q</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
