('f6c9075a-96d9-49dc-ab98-c99808aa9506', '2023-10-13 10:02:32', '2023-10-13 10:02:32', NULL, 'e9f84a80-562c-4b59-b70d-8f1c9f4e3b4f', NULL, 0, NULL, NULL, NULL, '<p>9, 6, 1, -6, &hellip;, -26</p>', '<p>-9</p>', '<p>-11</p>', '<p>-15</p>', '<p>-17</p>', '<p>-19</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('f6f82a2f-2d57-47d9-bdf8-0d7db667542f', '2023-10-13 06:48:09', '2023-10-13 06:48:09', NULL, 'dfcc80d7-7e2f-4c19-88cc-d69371bbee12', NULL, 0, NULL, NULL, NULL, '<p>Cermatilah kalimat berikut!</p>\n<ul>\n<li>Kesibukan acapkali menjadi alasan sehingga kita menghalalkan\" segala cara untuk memperoleh kepraktisan,terutama membeli buah potongan</li>\n<li>Menurut penelitian, sinar dan oksigen biasanya akan mempercepat penghancuran vitamin yang terkandung dalam buah tersebut</li>\n<li>Buah tersebut dalam hal rasa, mungkin tidak akan menjadi masalah, tetapi dalam hal nutrisi berbeda</li>\n</ul>', '<p>(1), (2), (3)</p>', '<p>(3), (1), (2)</p>', '<p>(1), (3), (2)</p>', '<p>(2), (3), (1)</p>', '<p>(3), (2), (1)</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('f70c5448-1141-479a-9cb0-4ad9349f964a', '2023-10-26 06:28:33', '2023-10-26 06:28:33', NULL, '6747b4a2-21ed-48fa-a0ea-bc2e9e29247d', NULL, 0, NULL, NULL, NULL, '<p>Pada instansi tempat anda bekerja anda memiliki atasan yang sudah lanjut usia dan kurang paham teknologi terkini. Suatu hari, atasan anda ingin membeli pakan kura-kura kesayangannya di salah satu platform belanja online dan meminta anda memesankan produk tersebut. Setelah beberapa hari pesanan pun sampai, atasan anda merasa senang telah menerima paketnya dan segera membukanya. Begitu atasan anda meneliti paket tersebut, memiliki wajahnya berubah kecewa, menurutnyaproduk yang ia terima tidak sama dengan yang biasa ia beli di toko offline dari segi kemasan yang lebih tipis dan pabrik yang mengeluarkan. Atasan anda biasa membeli produk dari pabrik X meski secara kasatmata produk tersebut sama dengan yang biasa dibeli atasan anda. Maka hal yang harus anda lakukan......</p>', '<p>Memberi pengertian kepada atasan anda tentang belanja online, salah satunya produk yang tidak sesuai ekspektasi</p>', '<p>Memberi pengertian kepada atasan anda dan segera menulis ulasan sesuai keadaan aslinya pada toko online tersebut</p>', '<p>Memberikan pengertian kepada atasan anda dan mencari info lebih dalam terkait produk tersebut</p>', '<p>Memberi pengertian kepada atasan anda dan menghubungi penjual agar barang segera diganti</p>', '<p>Memberi pengertian kepada atasan anda dan segera memberi rating rendah pada toko tersebut</p>', 3, 4, 5, 2, 1, 0, 1, 3, NULL, 1),
('f7274a38-bc54-4959-97f0-3a1f10488052', '2023-10-13 06:31:20', '2023-10-13 06:31:20', NULL, 'dfcc80d7-7e2f-4c19-88cc-d69371bbee12', NULL, 0, NULL, NULL, NULL, '<p>Makna dari wawasan kebangsaan Indonesia yaitu mengamanatkan kepada seluruh bangsa agar menempatkan persatuan dan kesatuan serta kepentingan dan keselamatan bangsa dan negara di atas kepentingan pribadi dan golongan. Faktor penghambat wawasan kebangsaan Indonesia diantaranya, kecuali....</p>', '<p>Pikiran dan perasaan kecemburuan sosial</p>', '<p>Kesenjangan pembangunan antar wilayah</p>', '<p>Kesenjangan sosial dan ekonomis antar golongan penduduk</p>', '<p>Konsep wawasan nusantara dan ketahanan nasional sebagai acuan operasional</p>', '<p>Upaya-upaya untuk mengekang proses demokratisasi dan desentralisasi</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
