('f8539db5-179d-4fef-b5ee-15997f6833d8', '2023-10-14 07:44:07', '2023-10-14 07:47:28', NULL, '24bf9ebb-5643-42af-b6ad-4b54d6de83c4', NULL, 0, NULL, NULL, NULL, '<p>Saya akan turut memberikan kontribusi terhadap pembangunan nusa dan bangsa Indonesia..</p>', '<p>Jika saya berkarya sebagai pegawai negeri sipil</p>', '<p>Dimanapun saya berkarya, saya akan turut memberikan kontribusi terhadap pembangunan bangsa</p>', '<p>Ketika saya menjadi seorang birokrat tingkat atas</p>', '<p>Ketika saya menjabat menjadi anggota Dewan Perwakilan Rakyat, baik tingkat pusat maupun daerah</p>', '<p>Dimanapun saya berkarya, saya akan turut memberikan kontribusi terhadap pembangunan bangsa dengan syarat didukung oleh pemerintah</p>', 4, 5, 1, 2, 3, 0, 1, 2, NULL, 1),
('f88d0507-bef4-4399-b81c-64c74aa37527', '2023-10-17 06:01:21', '2023-10-17 06:01:21', NULL, 'b6b3d933-7f1c-4ac1-abf2-14928a6ab49f', NULL, 0, NULL, NULL, NULL, '<p>Kredibilitas menyangkut tentang kemampuan dan keterampilan, sedangkan integritas lebih menekankan pada?...</p>', '<p>Skill</p>', '<p>Pengetahuan</p>', '<p>Karya</p>', '<p>Hati</p>', '<p>Hasil</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('f8ff8927-2264-423c-8a5a-ca191cfe6ed0', '2023-10-16 05:35:16', '2023-10-16 05:35:16', NULL, '7353afdf-8c22-4e71-a553-90921b9692ab', NULL, 0, NULL, NULL, NULL, '<p>Sepandai-pandainya manusia, suatu waktu ia akan melakukan kesalahan juga. Tidak ada manusia yang sempurna, suatu waktu ia pasti pernah melakukan kesalahan/mengalami kegagalan juga. Pribahasa yang sesuai dengan yang di atas yaitu.....</p>', '<p>Bagai anak ayam kehilangan induk</p>', '<p>Tua-tua keladi, semakin tua makin jadi</p>', '<p>Sepandai-pandai tupai melompat, sekali waktu jatuh juga</p>', '<p>Tong kosong nyaring bunyinya</p>', '<p>Bagai pungguk merindukan bulan</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('f94bf940-dcfa-48e3-8e0f-7458eb2190e9', '2023-10-18 07:17:28', '2023-10-18 07:17:28', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Suatu hari tanpa sengaja saya bertemu dengan rekan saya yang pernah terlibat konflik dan memusuhi saya, reaksi saya....</p>', '<p>Saya dapat berpura-pura menyukai seseorang walaupun saya sangat membencinya</p>', '<p>Lebih baik menghindarinya daripada harus bertemu dengannya</p>', '<p>Mengatakan langsung bahwa saya tidak menyukainya agar dia blsa introspeksi diri</p>', '<p>Saat bertemu dengannya, saya akan menjaga jarak</p>', '<p>Bila dia melakukan kesalahan itu, adalah hal yang biasa karena tidak ada manusia yang sempurna</p>', 2, 4, 1, 3, 5, 0, 1, 5, NULL, 1),
