('faeb6f3e-940d-421d-a44d-3956401817a4', '2023-10-18 06:03:12', '2023-10-18 06:03:12', NULL, '9c9476b6-b195-4898-823b-4c2feca2426c', NULL, 0, NULL, NULL, NULL, '<p>Ketika melepas lelah di kantin sekolah, sambil makan dan minum, saya&hellip;</p>', '<p>Terlihat aktif dengan kelompok saya</p>', '<p>Lebih suka menikmati makanan yang saya pesan</p>', '<p>Berbincang sekadarnya dengan yang duduk satu meja</p>', '<p>Berusaha menjalin hubungan dengan kenalan baru</p>', '<p>Berbincang-bincang dengan teman-teman yang sudah kenal</p>', 5, 2, 1, 4, 3, 0, 1, 1, NULL, 1),
('fb34cb4f-2556-4643-9c2c-99a230f9c5dd', '2023-10-20 07:48:09', '2023-10-20 07:48:09', NULL, '00cc482f-6b53-42a2-9045-e1b555bb5d19', NULL, 0, NULL, NULL, NULL, '<p>Seorang siswa mengikuti ujian dan tidak dapat menjawab 3 pertanyaan. Jika siswa tersebut mendapat skor 85 dari 100, maka banyaknya soal.....</p>', '<p>40</p>', '<p>25</p>', '<p>20</p>', '<p>15</p>', '<p>30</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('fb817c19-e89a-4629-b2b8-110d9a48e67d', '2023-10-16 04:48:59', '2023-10-16 04:48:59', NULL, '7353afdf-8c22-4e71-a553-90921b9692ab', NULL, 0, NULL, NULL, NULL, '<p>Konflik horizontal merupakan terminologi konflik yang terjadi antar individu atau kelompok organisasi yang memiliki kedudukan yang sama atau setara dan dapat ditimbulkan karena kurangnya komunikasi, benturan persepsi dan perbedaan pendapat antar anggotanya. Konflik horizontal ini dapat timbul karena kurangnya implementasi sila-sila Pancasila yaitu sila ke...</p>', '<p>Satu</p>', '<p>Dua</p>', '<p>Tiga</p>', '<p>Empat</p>', '<p>Lima</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('fc5f8272-7405-4b8b-a781-07308735e49d', '2023-10-17 08:16:56', '2023-10-17 08:16:56', NULL, 'b6b3d933-7f1c-4ac1-abf2-14928a6ab49f', NULL, 0, NULL, NULL, NULL, '<p>Berikut adalah bentuk keikutsertaan warga di lingkungan tempat tinggalnya sebagai upaya bela negara....</p>', '<p>Ikut pelatihan wajib militer</p>', '<p>Mengikuti pendidikan warga negara di kelas</p>', '<p>Mengabdikan diri sesuai profesi</p>', '<p>Ikut melindungi batas negara</p>', '<p>Mengikuti kegiatan siskamling di lingkungan rumah</p>', 0, 0, 0, 0, 0, 0, 1, 5, NULL, 1),
('fcf762db-4424-4a66-b53b-88844ae31a7d', '2023-10-16 08:20:44', '2023-10-16 08:20:44', NULL, '6d64ab17-58b7-434c-8f5d-75d8a6ad4129', NULL, 0, NULL, NULL, NULL, '<p>1, 4, 27, 256, ...</p>', '<p>3512</p>', '<p>3375</p>', '<p>3125</p>', '<p>2417</p>', '<p>2858</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('fdf020c1-b05d-4160-bca3-d000d04b3528', '2023-10-16 05:24:48', '2023-10-16 05:24:48', NULL, '7353afdf-8c22-4e71-a553-90921b9692ab', NULL, 0, NULL, NULL, NULL, '<p>Makna dari wawasan kebangsaan Indonesia yaitu mengamanatkan kepada seluruh bangsa agar menempatkan persatuan dan kesatuan serta kepentingan dan keselamatan bangsa dan negara di atas kepentingan pribadi dan golongan. Faktor yang memperkokoh wawasan kebangsaan Indonesia diantaranya, kecuali....</p>', '<p>Keutuhan dan kedaulatan wilayah</p>', '<p>Pancasila dan UUD 1945 sebagai acuan dasar dalam hidup bermasyarakat, berbangsa, bernegara</p>', '<p>Kesenjangan pembangunan antar wilayah</p>', '<p>Konsep wawasan nusantara dan ketahanan nasional sebagai acuan operasional</p>', '<p>Kekayaan budaya bangsa Indonesia sebagai perwujudan cipta, rasa, dan karsa bangsa Indonesia</p>', 0, 0, 0, 0, 0, 0, 1, 3, NULL, 1),
('fe2d36c7-7b66-4947-9cd4-66c2f064dd6e', '2023-10-13 08:00:37', '2023-10-13 08:00:37', NULL, 'e9f84a80-562c-4b59-b70d-8f1c9f4e3b4f', NULL, 0, NULL, NULL, NULL, '<p>Winda dan Alya senang mengoleksi novel. Jika koleksi buku Winda saat ini 460.000 buah dan setiap tahun jumlah novel koleksinya bertambah sebanyak 6800 buah. Sementara Alya memiliki koleksi novel sebanyak 624.000 buah dan setiap tahun ia donasikan ke yayasan Anak Cerdas sebanyak 3450 buah setiap tahunnya. Berapa tahun lagi keduanya akan memiliki jumlah koleksi novel sama banyak?..</p>', '<p>13</p>', '<p>14</p>', '<p>15</p>', '<p>16</p>', '<p>17</p>', 0, 0, 0, 0, 0, 0, 1, 4, NULL, 1),
('fe63e8cc-2b7b-4214-9a0d-eecd5921a000', '2023-10-17 02:53:37', '2023-10-17 02:53:37', NULL, 'c9bf618a-44bb-4b02-be4b-cea62c3216ef', NULL, 0, NULL, NULL, NULL, '<p>Anda bekerja di Dinas Kependudukan dan Pencatatan Sipil. Anda berada di divisi pelayanan yang melayani pembuatan KTP. Suatu hari anak kenalan anda datang untuk membuat KTP baru dan mendapatkan nomor antrian 68. Saat itu, diloket anda baru melayani nomor antrian 26. Kenalan anda menelpon anda meminta anaknya untuk di dahulukan. Sikap anda menghadapi masalah ini adalah....</p>', '<p>Memintanya untuk menunggu sesuai antrian</p>', '<p>Memintanya menunggu sesuai antrian dan tetap melayani sesuai antrian selanjutnya</p>', '<p>Meminta izin pada antrian yang dia lewati untuk melayaninya terlebih dahulu karena dia merupakan anak kenalan anda</p>', '<p>Mendiamkannya saja dan tidak memperdulikan permintaan kenalan anda</p>', '<p>Meminta teman untuk melayani anak kenalan anda</p>', 4, 5, 1, 3, 2, 0, 1, 2, NULL, 1),
('fe88dbae-5ced-49b8-9140-44422333d7a5', '2023-10-13 06:42:43', '2023-10-13 06:42:43', NULL, 'dfcc80d7-7e2f-4c19-88cc-d69371bbee12', NULL, 0, NULL, NULL, NULL, '<p>Wawasan Nusantara adalah cara pandang bangsa Indonesia tentang diri dan lingkungannya berdasarkan ideologi nasionalnya yang dilandasi oleh Pancasila dan UUD 1945 yang merupakan aspirasi bangsa Indonesia yang merdeka, berdaulat, dan bermanfaat serta menjiwai tata hidup dan tindak kebijakannya dalam mencapai tujuan nasional. Tujuan wawasan nusantara terbagi menjadi tujuan ke dalam dan tujuan ke luar. Tujuan ke luar wawasan nusantara yaitu...</p>', '<p>Untuk mewujudkan kesatuan dalam segenap aspek kehidupan bangsa, baik aspek alamiah maupun aspek social</p>', '<p>Untuk ikut serta mewujudkan kebahagiaan, ketertiban, dan perdamaian seluruh umat manusia</p>', '<p>Kemajemukan dan keanekaragaman budaya, suku, etnis, agama yang mewarnai kebangsaan Indonesia, tidak boleh dipandang sebagai hal negatif dan menjadi ancaman yang bisa saling menegaskan.</p>', '<p>memuliakan kemanusiaan universal</p>', '<p>kesetiaan yang tertinggi terdapat harus diserahkan pada negara kebangsaan</p>', 0, 0, 0, 0, 0, 0, 1, 2, NULL, 1),
('ff73d2ac-77f9-4ba1-9bc8-2912b71512a2', '2023-10-18 03:52:30', '2023-10-18 03:52:30', NULL, '557e3be9-1ea4-45e4-8163-29eb4435e058', NULL, 0, NULL, NULL, NULL, '<p>Mahasiswa S1 baru dapat gelar Sarjana jika sudah lulus ujian Skripsi. Rina dan Nisa adalah sarjana S1. Jadi...</p>', '<p>Rina dan Nisa pasti mampu mengikuti ujian Skripsi</p>', '<p>Nisa tidak lulus ujian Skripsi</p>', '<p>Rina tidak lulus ujian Skripsi</p>', '<p>Rina dan Nisa belum tentu mampu mengikuti ujian Skripsi</p>', '<p>Rina lebih cerdas daripada Nisa</p>', 0, 0, 0, 0, 0, 0, 1, 1, NULL, 1);
